CREATE TABLE `activities_lang` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `activity_id` bigint(20) unsigned NOT NULL,
  `lang` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `title` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `card_content` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `intro_content` longtext COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `individual_content` longtext COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `collective_content` longtext COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
