INSERT INTO `activities_lang` VALUES (5,42,'es','Disfruta del tiempo en familia','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p><strong><span style=\"font-size: 12pt;\">En esta &eacute;poca del a&ntilde;o compartir las tradiciones en familia y transmitir la importancia de dar y recibir, as&iacute; como de disfrutar de las peque&ntilde;as cosas de la vida, se convierten en el mejor regalo que podemos ofrecer a nuestros seres queridos.</span></strong></p>\r\n<p><span style=\"font-size: 12pt;\">La necesidad de pasar tiempo en familia nace del deseo de compartir experiencias enriquecedoras con las personas a las que queremos.&nbsp;Estos&nbsp;momentos&nbsp;del a&ntilde;o son los ideales para crear lazos que perduren en el tiempo y permitan superar las adversidades.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Resulta primordial disfrutar con alegr&iacute;a, compartiendo tiempo de calidad en familia. La Navidad es tiempo de costumbres y tradiciones que invitan a participar con nuestros seres queridos.</span></p>\r\n<p><strong><span style=\"font-size: 12pt;\">Las Navidades suponen una oportunidad clave para regalar tiempo de calidad y fortalecer los v&iacute;nculos con nuestros familiares.</span></strong></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>En esta &eacute;poca del a&ntilde;o compartir las tradiciones en familia y &nbsp;transmitir la importancia de dar y recibir, as&iacute; como de disfrutar de las peque&ntilde;as cosas de la vida, se convierten en el mejor regalo que podemos ofrecer a nuestros seres queridos.</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">La familia es un grupo de personas vinculadas por parentesco o afinidad que conviven en un lugar determinado. All&iacute; se aprende sobre principios y valores para integrarse de manera adecuada en la sociedad.</span></p>\r\n<p><span style=\"font-size: 12pt;\">A veces sucede, que, con el ritmo de vida acelerado, tendemos a perder ciertas costumbres, como el de disfrutar en familia. De ah&iacute; que sea importante rescatar el valor de pasar m&aacute;s tiempo junto a tus seres queridos.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Hay que tener en cuenta que la mejor forma de conocer a cada uno de los integrantes de la&nbsp;familia, en todos sus aspectos, es compartiendo tiempo juntos.</span></p>\r\n<p><span style=\"font-size: 12pt;\"><strong>&iexcl;No permitas que las obligaciones, el trabajo y la vida moderna te distancien de tu familia!</strong></span></p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>La Navidad es una &eacute;poca para compartir en familia</h2>\r\n<p><span style=\"font-size: 12pt;\">Navidad es m&aacute;s que regalos, es un momento para compartir, ser solidarios y reafirmar el cari&ntilde;o por nuestra familia y amigos. Es un buen momento para compartir y motivar a vivir bien en armon&iacute;a.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Durante los d&iacute;as de fiestas, se presentan infinidad de ocasiones para pasar tiempo de calidad con nuestros familiares, tanto si hay ni&ntilde;os como si no, existen muchas cosas que podemos realizar mientras disfrutamos de la compa&ntilde;&iacute;a de esas personas tan importantes para nosotros.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Aqu&iacute; te dejamos algunas ideas:</span></p>\r\n</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/fotos-1080-x-810-10.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Crear un ambiente navide&ntilde;o.</strong>&nbsp;Decorar la casa juntos&nbsp;es un ritual muy especial, poner canciones de Navidad, sacar los adornos y ponerse manos a la obra, es sin duda una actividad divertida y entra&ntilde;able. No olvides que crear un buen ambiente navide&ntilde;o&nbsp;depende &uacute;nicamente de nosotros.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Prepara las tarjetas de felicitaci&oacute;n.&nbsp;</strong>Otra actividad que pod&eacute;is realizar es preparar las felicitaciones de Navidad, tanto como si las compr&aacute;is como si las hac&eacute;is manualmente, especialmente en el caso de que haya ni&ntilde;os en casa. Juntos pod&eacute;is decidir qui&eacute;n escribe a qui&eacute;n y pod&eacute;is pasar una tarde de lo m&aacute;s entretenida.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Visitar alg&uacute;n mercadillo de Navidad.&nbsp;</strong>En Navidad&nbsp;pr&aacute;cticamente&nbsp;todas las ciudades tienen un mercadillo,&nbsp;ya sea para comprar regalitos artesanales o para adquirir la decoraci&oacute;n y dulces t&iacute;picos de esta &eacute;poca tan especial. Acudir juntos a un lugar as&iacute; es una actividad que no puede faltar en vuestra agenda navide&ntilde;a.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Manualidades navide&ntilde;as en familia.&nbsp;</strong></span><span style=\"font-size: 12pt;\">Las manualidades no son s&oacute;lo cosa de ni&ntilde;os, (aunque los m&aacute;s peque&ntilde;os de la casa disfrutan especialmente), tambi&eacute;n existen infinitas alternativas para crear adornos de Navidad para los m&aacute;s mayores, basta con ojear un poco por internet, &iexcl;Encontrar&eacute;is infinidad de adornos que pod&eacute;is crear con cosas que ten&eacute;is por casa!</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Cocinar en familia.</strong>&nbsp;Hay pocas cosas m&aacute;s entretenidas que cocinar en familia, pod&eacute;is preparar juntos el men&uacute; de Navidad, unas galletas, un dulce t&iacute;pico de Navidad o cualquier comida que se presente en las vacaciones puede ser una buena excusa para pasar tiempo de calidad en familia.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Tarde de cine.&nbsp;</strong>Esta tambi&eacute;n es una opci&oacute;n de ocio interesante. Basta con ponerse de acuerdo sobre qu&eacute; pel&iacute;culas ser&aacute;n las escogidas, aderezarlo con unas palomitas o con algunos dulces y&hellip;&iexcl;Acci&oacute;n!</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Preparar un juego juntos.&nbsp;</strong>Esta es sin duda una actividad que os va a divertir, se trata de reunir preguntas entre todos y de crear un juego/concurso para el d&iacute;a de Navidad. &iquest;En qu&eacute; a&ntilde;o se casaron los abuelos? &iquest;Cu&aacute;l fue el primer trabajo de la t&iacute;a? Cada uno de los miembros de la familia puede plantear una serie de preguntas que luego formar&aacute;n parte del juego. &iquest;Qui&eacute;n ser&aacute; el que conoce mejor a toda la familia?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Tarro de agradecimiento.<span style=\"font-size: 12pt;\">&nbsp;</span></strong>Esta es sin duda una actividad muy entra&ntilde;able. Te proponemos que juntes a tu familia y les propongas crear el tarro de agradecimiento. En &eacute;l, durante los d&iacute;as previos a las navidades introducir&eacute;is una serie de mensajes escritos en unos papeles bien doblados, donde expresar&eacute;is vuestro agradecimiento por sucesos ocurridos a lo largo del a&ntilde;o. El d&iacute;a de Navidad se podr&aacute;n leer uno a uno. Los mensajes pueden ser an&oacute;nimos, en ese caso, &iexcl;tendr&eacute;is que ser capaces de adivinar qui&eacute;n ha escrito ese mensaje!</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Tarde de juegos.&nbsp;</strong>Sin duda el juego es siempre una buena elecci&oacute;n, es una de las mejores maneras de socializar, de fomentar la diversi&oacute;n y de aliviar el estr&eacute;s. La oferta es infinita, &iexcl;el &uacute;nico problema ser&aacute; ponerse de acuerdo!</span></p>\r\n</div>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Y para terminar hoy te retamos a que, junto con tus familiares, te animes a construir un &aacute;rbol geneal&oacute;gico de tu familia, &iquest;Hasta qu&eacute; generaci&oacute;n ser&aacute;s capaz de llegar? Quiz&aacute;s tengas que llamar a alg&uacute;n familiar para que os ayude a completarlo, seguro que es una buena excusa para conectar con familiares con los que hace tiempo que no hablas. </span></p>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520.png\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>El tiempo que se disfruta es el verdadero tiempo vivido</h2>\r\n<p>El tiempo en familia es un factor esencial que ayuda a crear fuertes lazos, amor, conexiones y relaciones entre los miembros de la familia. Pasar tiempo de calidad con la familia ayuda a enfrentar los desaf&iacute;os, inculca un sentimiento de seguridad, transmite los valores familiares y llena de confianza a todos los miembros de la misma.</p>\r\n<p>Hoy te animamos a que reflexiones acerca del tiempo que pasas con tu familia. &iquest;Es realmente suficiente? &iquest;Es tiempo de calidad? Si no es as&iacute;, piensa acerca de c&oacute;mo podr&iacute;as mejorar esta situaci&oacute;n.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy nos gustar&iacute;a que compartieras en el muro una imagen familiar, puede ser antigua o actual, adem&aacute;s nos encantar&aacute; saber qu&eacute; es lo que m&aacute;s te gusta de tu familia.</p>\r\n</div>\r\n</div>','2022-11-10 07:17:50','2023-12-07 13:10:34'),(6,25,'es','Bienvenido, Diciembre','<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">La Navidad es siempre un momento de reflexi&oacute;n, bien porque dejamos atr&aacute;s un a&ntilde;o lleno de aprendizajes y experiencias, bien porque empezamos uno nuevo, todav&iacute;a por definir.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Es el momento m&aacute;s adecuado para dedicar parte de nuestro tiempo y de nuestra energ&iacute;a a&nbsp;iniciar la b&uacute;squeda de lo positivo</strong>&nbsp;en todo aquello que nos rodea y en buscar lo mejor de nosotros mismos y de los que nos rodean.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">La Navidad representa una oportunidad para reorientar nuestros pensamientos hacia el optimismo, la esperanza y la ilusi&oacute;n de forma que nos proporcione la motivaci&oacute;n suficiente como para alcanzar unos objetivos saludables y beneficiosos para nuestra salud f&iacute;sica y mental.</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p>Hoy queremos darte la&nbsp;<strong>bienvenida a este original calendario de adviento.</strong>&nbsp;El objetivo es acompa&ntilde;arte a lo largo de este mes con divertidos retos, consejos, juegos y actividades para retarte a trabajar tu bienestar emocional individual y colectivo.</p>\r\n<p><strong>Cada d&iacute;a tendr&aacute;s una nueva ventana por descubrir, desde hoy hasta el d&iacute;a 24.</strong> Al abrir la ventana encontrar&aacute;s un tema sobre el que reflexionar, actuar y sobre el que comentar y compartir con tus compa&ntilde;eros/as. Mediante retos individuales y colectivos conseguir&aacute;s reforzar cada una de estas capacidades y acercarte un poquito m&aacute;s a tu equipo.</p>\r\n<p>En la pesta&ntilde;a de &ldquo;progreso&rdquo; podr&aacute;s ver cu&aacute;nto os falta para llegar al objetivo final. Cada reto superado, individual o colectivo, cada comentario o interacci&oacute;n que realic&eacute;is en el calendario os acercar&aacute; m&aacute;s a &eacute;l.</p>\r\n<p>Desde hoy hasta el d&iacute;a 24, no olvides abrir cada d&iacute;a la ventana correspondiente, si un d&iacute;a te olvidas, no te preocupes, siempre podr&aacute;s recuperar los retos de los d&iacute;as anteriores. Cada d&iacute;a una ventana, un desaf&iacute;o individual para trabajar el bienestar personal y un desaf&iacute;o colectivo para acercarte un poco m&aacute;s a tus compa&ntilde;eros/as.</p>\r\n<p style=\"text-align: justify;\">&iquest;Te animas?</p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>Aprende a planificar y priorizar</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Se acerca una &eacute;poca de reencuentros, de abrazos, cenas y risas en familia. Pero antes de que todo eso llegue, tenemos una larga lista de cosas por hacer. No te alteres ni te estreses, lo mejor es planificarse ahora que tenemos tiempo y organizar todo lo que est&aacute; por hacer. Si lo haces estamos seguros de que podr&aacute;s disfrutar mucho m&aacute;s de los momentos especiales que est&aacute;n por llegar.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Tienes todo el mes por delante para preparar todas las cosas que requieren esta &eacute;poca del a&ntilde;o, hay tiempo siempre que sepas planificarte, si lo haces evitar&aacute;s los nervios de los &uacute;ltimos d&iacute;as.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Aqu&iacute; te dejamos algunos consejos:</span></p>\r\n</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/depositphotos-321909386-xl-2015.jpg\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Decora tu casa con cabeza.</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">Si todav&iacute;a no tienes ni el &aacute;rbol ni los adornos navide&ntilde;os puestos en tu casa, hoy te proponemos sacar todo lo relacionado con la Navidad: adornos, luces, el &aacute;rbol. Revisa los adornos y anota aquello que eches en falta para ambientar tu hogar, puedes inspirarte en p&aacute;ginas o revistas de decoraci&oacute;n, decide cu&aacute;l quieres que sea tu inspiraci&oacute;n para estas fiestas, dorado, plateado, r&uacute;stico, estilo n&oacute;rdico&hellip;.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Ponte un poco de m&uacute;sica.</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">Deja que el esp&iacute;ritu navide&ntilde;o se cuele en tu hogar. Mientras te encuentres en plena tarea de ambientar tu casa, abre tu ordenador o tu dispositivo m&oacute;vil y ponte un poco de m&uacute;sica navide&ntilde;a. &iquest;A que ya sientes el olor de la Navidad?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Planifica tus compras.</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">Coge papel y boli y escribe a todas las personas a las que les quieras hacer un regalo, una vez tengas los nombres, dedica un rato a pensar qu&eacute; les podr&iacute;a gustar. Evita salir a comprar sin una idea predeterminada, ojea por internet, pregunta o com&eacute;ntalo con otras personas que las conozcan bien. Regala algo original, una experiencia que pod&aacute;is hacer juntos, un ramo de flores, una foto con una dedicatoria, un libro que te hayan recomendado, un &aacute;lbum de de las mejores fotos del a&ntilde;o o de un viaje que hay&aacute;is hecho, un vale para ir a un restaurante, para un masaje, para una excursi&oacute;n o una escapada, o, simplemente una bonita carta con todo lo que te cuesta decirle a diario. Lo importante en los regalos no es el qu&eacute;, sino el sentimiento que transmites en lo que regalas. Cuando las cosas se hacen con amor, nunca fallan.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Asigna un presupuesto.</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">Teniendo en cuenta tus gastos y tu realidad financiera, fija el presupuesto que puedes destinar a las navidades. Evita las tentaciones. Pi&eacute;nsalo dos veces antes de comprar algo. Sobre todo hazte esta pregunta &iquest;Es realmente necesario?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Planifica las comidas y los men&uacute;s de Navidad.</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">Son sin duda una de las grandes tareas y responsabilidades de las fiestas y que adem&aacute;s generan mucho estr&eacute;s a quienes se encargan de prepararlas. Si quieres evitarlo, primero de todo, haz una lista de invitados y apunta preferencias, intolerancias y alergias. Sabiendo el n&uacute;mero de comensales y teniendo en cuenta algunas particularidades, es m&aacute;s f&aacute;cil planificar el men&uacute; de Navidad.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Para facilitarte el trabajo, escoge platos que puedas preparar con antelaci&oacute;n y comb&iacute;nalos con algunos que puedas terminar antes de servirlos. Puedes hacer un simulacro de compra en alguna web de supermercado y obtener un presupuesto preliminar de lo que vas a gastar. Si no est&aacute;s contento/a, puedes modificar el men&uacute;. Recuerda que si compras con antelaci&oacute;n evitar&aacute;s tambi&eacute;n las subidas de precios de los &uacute;ltimos d&iacute;as.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Comparte responsabilidades, no tengas miedo a delegar.</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">Para que todo fluya mejor, fijad de qu&eacute; se va a encargar cada persona.&nbsp; &iexcl;Que no te d&eacute; reparo pedir ayuda y repartir tareas y asignar responsables! &iexcl;El trabajo en equipo es la clave del &eacute;xito!</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Aprende a planificarte con tiempo, te ayudar&aacute; a rebajar tus niveles de estr&eacute;s y conseguir&aacute;s disfrutar de estas fechas tan especiales.</strong></span></p>\r\n</div>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> As&iacute; que hoy te retamos a que planifiques todas aquellas tareas que vas a tener que llevar a cabo a lo largo de estos d&iacute;as, y para ello te dejamos esta plantilla que te resultar&aacute; muy &uacute;til para optimizar tu tiempo durante este mes.</span></p>\r\n<p><a class=\"btn btn-primary\" href=\"../../../../storage/files/uploads/planning-naviden%CC%83o-1.pdf\">PLANNING NAVIDE&Ntilde;O</a></p>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Que las Navidades no sean un motivo de estr&eacute;s.</h2>\r\n<p>Para ayudarte a lidiar mejor con esta feliz pero estresante &eacute;poca del a&ntilde;o, hemos querido compartirte algunos consejos importantes para que te olvides del estr&eacute;s, alivies la tensi&oacute;n y que estos d&iacute;as resulten lo m&aacute;s agradable posible. Esperamos que los pongas en pr&aacute;ctica.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Adem&aacute;s, hoy te animamos a que compartas con tus compa&ntilde;eros aquella tarea navide&ntilde;a con la que disfrutes m&aacute;s en estos d&iacute;as. &iexcl;Si&eacute;ntete libre de acompa&ntilde;ar tu comentario con alguna foto!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/fotos-calendario-navidad-copia.gif\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-10 07:26:02','2023-11-27 18:30:33'),(7,42,'fr','DécembreBienvenue décembre Bienvenue, décembre !','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p>Chaque r&eacute;veil est un nouvel apprentissage. Les humains sont inconsciemment plong&eacute;s dans un apprentissage constant, nous sommes curieux de nature, mais parfois nous avons tendance &agrave; laisser la paresse envahir nos habitudes.</p>\r\n<p>Cependant, il est important de ne jamais cesser de vouloir acqu&eacute;rir de nouvelles connaissances, demander, enqu&ecirc;ter, lire, &eacute;couter, pour continuer &agrave; grandir en tant que personne dans la sph&egrave;re personnelle et professionnelle.</p>\r\n<p>Qui veut apprendre ne trouve pas d\'excuses, apprend de chaque opportunit&eacute; qui se pr&eacute;sente &agrave; lui dans la vie, ou m&ecirc;me apprend &agrave; cr&eacute;er ces opportunit&eacute;s.</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p><strong>Cada d&iacute;a tendr&aacute;s una nueva ventana por descubrir, desde hoy hasta el d&iacute;a 24.</strong> Al abrir la ventana encontrar&aacute;s un tema sobre el que reflexionar, actuar y sobre el que comentar y compartir con tus compa&ntilde;eros. Mediante retos individuales y colectivos conseguir&aacute;s reforzar cada una de estas capacidades y acercarte un poquito m&aacute;s a tus compa&ntilde;eros de trabajo. A medida que los vayas superando, ver&aacute;s como te encuentras m&aacute;s comprometido contigo mismo, con tus compa&ntilde;eros y con el entorno.</p>\r\n<p>En la pesta&ntilde;a de &ldquo;progreso&rdquo;, podr&eacute;is ver cu&aacute;nto os falta para llegar al objetivo final. Cada reto superado, individual o colectivo, cada comentario o interacci&oacute;n que realic&eacute;is en el calendario os acercar&aacute; m&aacute;s a vuestro objetivo.</p>\r\n<p>Desde hoy hasta el d&iacute;a 24, no olvides abrir cada d&iacute;a la ventana correspondiente, si un d&iacute;a te olvidas, no te preocupes, siempre podr&aacute;s recuperar los retos de los d&iacute;as anteriores. Eso si, no intentes adelantarte, no podr&aacute;s nunca abrir las ventanas de los d&iacute;as posteriores. Cada d&iacute;a una ventana, un desaf&iacute;o individual para trabajar el bienestar personal y un desaf&iacute;o colectivo para acercarte un poco m&aacute;s a tus compa&ntilde;eros.</p>\r\n<p>&iquest;Te animas a comenzar con el primero?</p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>Deja que te invada el esp&iacute;ritu de la Navidad.</h2>\r\n<p><span style=\"font-size: 12pt;\">Se acerca una &eacute;poca de reencuentros, de abrazos, cenas y risas en familia. Pero antes de que todo eso llegue tenemos una larga lista de cosas por hacer. No te alteres ni te estreses, lo mejor es planificarse ahora que tenemos tiempo y organizar todo lo que est&aacute; por hacer. Si lo haces estamos seguros de que podr&aacute;s disfrutar mucho m&aacute;s de los momentos especiales que est&aacute;n por llegar.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Tienes todo el mes por delante para preparar todas las cosas que requieren esta &eacute;poca del a&ntilde;o, hay tiempo siempre que sepas planificarte, si lo haces evitar&aacute;s los nervios de los &uacute;ltimos d&iacute;as.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Aqu&iacute; te dejamos algunos consejos.</span></p>\r\n</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/depositphotos-321909386-xl-2015.jpg\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><strong>Decora tu casa con cabeza</strong></span><br /><span style=\"font-size: 12pt;\">Si todav&iacute;a no tienes ni el &aacute;rbol ni los adornos navide&ntilde;os puestos en tu casa, hoy te proponemos sacar todo lo relacionado con la navidad: adornos, luces, el &aacute;rbol si es reutilizable, si lo compras cada a&ntilde;o, es momento de ir a por &eacute;l. Revisa los adornos, y anota aquello que eches en falta para ambientar tu hogar, puedes inspirarte en p&aacute;ginas o revistas de decoraci&oacute;n, decide cu&aacute;l quieres que sea tu inspiraci&oacute;n para estas fiestas, dorado, plateado, r&uacute;stico, estilo n&oacute;rdico&hellip;.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><strong>Ponte un poco de m&uacute;sica</strong></span><br /><span style=\"font-size: 12pt;\">Deja que el esp&iacute;ritu navide&ntilde;o se cuele en tu hogar. Mientras te encuentres en plena tarea de ambientar tu casa, abre tu ordenador o tu dispositivo m&oacute;vil y ponte un poco de m&uacute;sica navide&ntilde;a. &iquest;A qu&eacute; ya sientes el olor de la Navidad?.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><strong> Planifica tus compras.</strong></span><br /><span style=\"font-size: 12pt;\">Coge papel y boli y escribe todas las personas a las que le quieras hacer un regalo, una vez tengas los nombres, dedica un rato a pensar que les podr&iacute;a gustar. Evita salir a comprar sin una idea predeterminada, ojea por internet, pregunta o com&eacute;ntalo con otras personas que las conozcan bien. Regala algo original, una experiencia que pod&aacute;is hacer juntos, un ramo de flores, una foto con una dedicatoria, un libro que te hayan recomendado, un &aacute;lbum de fotos de las mejores fotos del a&ntilde;o, o de un viaje que hay&aacute;is hecho, un vale para ir a un restaurante, para un masaje, para una excursi&oacute;n o una escapada, o, simplemente una bonita carta con todo lo que te cuesta decirle a diario. Lo importante en los regalos no es el qu&eacute;, sino el sentimiento que transmites en lo que regalas. Cuando las cosas se hacen con amor, nunca fallan.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><strong>Asigna un presupuesto.</strong></span><br /><span style=\"font-size: 12pt;\">Teniendo en cuenta tus gastos y tu realidad financiera, fija el presupuesto que puedes destinar a las navidades. Evita las tentaciones. Pi&eacute;nsalo dos veces antes de comprar algo. Sobre todo hazte esta pregunta &iquest;Es realmente necesario?.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><strong>Planifica las comidas y los Men&uacute;s de navidad</strong></span><br /><span style=\"font-size: 12pt;\">Son sin duda una de las grandes tareas y responsabilidades de las fiestas y que adem&aacute;s generan mucho estr&eacute;s a quienes se encargan de prepararlas. Si quieres evitarlo, primero de todo, haz una lista de invitados y apunta preferencias, intolerancias y alergias. Sabiendo el n&uacute;mero de comensales y teniendo en cuenta algunas particularidades, es m&aacute;s f&aacute;cil planificar el Men&uacute; de Navidad. Para facilitarte el trabajo, escoge platos que puedas preparar con antelaci&oacute;n y comb&iacute;nalos con algunos que puedas terminar antes de servirlos. Puedes hacer un simulacro de compra en alguna web de supermercado y obtener un presupuesto preliminar de lo que vas a gastar. Si no est&aacute;s contento, puedes modificar el men&uacute;. Recuerda que si compras con antelaci&oacute;n evitar&aacute;s tambi&eacute;n las subidas de precios de los &uacute;ltimos d&iacute;as.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><strong>Comparte responsabilidades, no tengas miedo a delegar.</strong></span><br /><span style=\"font-size: 12pt;\">Para que todo fluya mejor fijad de qu&eacute; se va a encargar cada uno. Que no te de reparo pedir ayuda y repartir tareas y asignar responsables! &iexcl;El trabajo en equipo es la clave del &eacute;xito!</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><strong>Aprende a planificarte con tiempo, te ayudar&aacute; a rebajar tus niveles de estr&eacute;s y conseguir&aacute;s disfrutar de estas fechas tan especiales.</strong></span></p>\r\n</div>\r\n<p class=\"txtdestacadow\"><span style=\"font-size: 12pt;\">As&iacute; que hoy te retamos a que planifiques todas aquellas tareas que vas a tener que llevar a cabo a lo largo de este mes, y para terminar te animamos a que realices esta sopa de letras, donde se encuentran escondidos alimentos t&iacute;picos de la Navidad..</span></p>\r\n<a class=\"btn btn-primary\" href=\"https://a.cstmapp.com/p/921622\">Sopa de letras</a></div>','<div class=\"row\">\r\n<div class=\"col-md-12\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/desafio-colectivo-2.png\" alt=\"\" width=\"600\" height=\"600\" /></div>\r\n<div class=\"col-md-12\">&nbsp;</div>\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Que las Navidades no sean un motivo de estr&eacute;s.</h2>\r\n<p>Para ayudarte a lidiar mejor con esta feliz pero estresante &eacute;poca del a&ntilde;o, hemos querido compartirte algunos consejos importantes para que te olvides del estr&eacute;s, alivies la tensi&oacute;n y que estos d&iacute;as resulten lo m&aacute;s agradable posible, esperamos que los pongas en pr&aacute;ctica.</p>\r\n<p class=\"txtdestacadog\">Adem&aacute;s ya sabes que otra manera de rebajar nuestras preocupaciones es comparti&eacute;ndolas con los dem&aacute;s. &iexcl;Aprovecha el d&iacute;a de hoy para compartir con tus compa&ntilde;eros aquello que te resulte m&aacute;s estresante de esta &eacute;poca del a&ntilde;o.</p>\r\n</div>\r\n</div>','2022-11-10 14:28:49','2022-11-10 14:28:49'),(8,44,'en','Celebra la vida, celebra la Navidad','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Every celebration reminds us that life is worth celebrating. Even or especially in difficult times, celebrations bring healing and comfort, and every celebration is a resurgence of life, a renewing of oneself and others.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">We have many reasons and motives to celebrate, to give ourselves and others a reason to get together and share something, and Christmas is a perfect excuse to do so.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">We have many reasons and motives to celebrate, to give ourselves and others a reason to get together and share something, and Christmas is a perfect excuse to do so.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Human beings have performed rituals of celebration since time immemorial, and this has served, among other things, to revive our condition of being social beings by nature.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Family and friendships provide support, learning and information, are crucial in creating our own identity, and allow us to unwind by providing entertainment and fun.</span></p>\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size: 12pt;\">In short, they contribute in an obvious way to the development and social well-being of an individual, which cannot be overlooked, and celebrations provide the perfect excuse.</span></strong></p>\r\n</div>\r\n</div>','<div class=\"row\"><!-- Columna Izda inicio-->\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Life is moments. Celebrate them!</h2>\r\n<p style=\"text-align: justify;\"><strong>Today, December 24th, is a day to celebrate, a day to get together with our loved ones and to share experiences and experiences.</strong></p>\r\n<p style=\"text-align: justify;\">Also on this day, we say goodbye to this original advent calendar that has accompanied you throughout this month. We sincerely hope that you have enjoyed the different challenges and resolutions that we have been presenting to you throughout these days, and we also hope that you will be encouraged to put some of them into practice in the year that is about to begin.</p>\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p style=\"text-align: justify;\"><!-- este es el separador de 10px--></p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we want to encourage you to celebrate these holidays with a lot of joy and illusion, we also want to encourage you to reflect on everything you have learned through the calendar, take some time to think about what good resolutions you plan to put into practice in 2022.</p>\r\n<p style=\"text-align: justify;\">Also create a nice Christmas greeting with this fun game we have designed. If you want you can take a screenshot and upload it on the wall to wish a Merry Christmas to all your colleagues.</p>\r\n</div>\r\n<!-- Columna Izda fin--> <!-- Columna Dch inicio-->\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/90.png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/89.png\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n<!-- Columna Izda fin--><!-- este es el separador de 10px-->\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\"><!-- este es el separador de 10px--></div>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"FELICITACI&Oacute;N NAVIDAD\" src=\"https://view.genial.ly/63a0ebf1e33265001338e9eb\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/fotos-1080-x-810-17.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n<div class=\"col-md-12\">&nbsp;</div>\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Life is too short to not celebrate the good times</h2>\r\n<p style=\"text-align: justify;\">Christmas is about giving and receiving love, family moments and traditions are spaces to give and receive, to nourish the spirit and enjoy the small and precious details of life.</p>\r\n<p style=\"text-align: justify;\">To celebrate Christmas you have to feel it and live it in a cheerful way, it\'is important to remember that December is only one month of the year and that Christmas is only one day, enjoy it to the max, celebrate it in a joyful way and create memories for years to come.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today you can use the wall to wish a Merry Christmas to all your colleagues in any way you want, with a picture, with a phrase, with a Christmas greeting and if you want you can also tell us how you are going to celebrate these special days!</p>\r\n<p style=\"text-align: center;\"><strong>We also say goodbye wishing you a Merry Christmas and a Happy New Year!</strong></p>\r\n</div>\r\n</div>','2022-11-16 08:36:23','2022-12-22 13:32:06'),(9,44,'es','Celebra la vida, celebra la Navidad','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Cada fiesta nos recuerda que la vida merece ser celebrada. Incluso o especialmente en los momentos dif&iacute;ciles, las celebraciones nos sanan y nos reconfortan. Toda fiesta es un resurgimiento de la vida, una renovaci&oacute;n de uno mismo y hacia los dem&aacute;s.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Tenemos muchas razones y motivos para celebrar, para darnos a nosotros mismos y brindarles a los dem&aacute;s un motivo por el que reunirse y compartir algo, y la Navidad es una excusa perfecta para hacerlo.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Tenemos muchas razones y motivos para celebrar, para darnos a nosotros mismos y brindarles a los dem&aacute;s un motivo por el que reunirse y compartir algo, y la Navidad es una excusa perfecta para hacerlo.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">El ser humano ha realizado rituales de celebraci&oacute;n desde tiempos inmemoriales, y eso ha servido, entre otras cosas, para reavivar nuestra condici&oacute;n de que somos seres sociales por naturaleza.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Las relaciones familiares y de amistad aportan apoyo, aprendizaje e informaci&oacute;n, resultan determinantes a la hora de crearnos una identidad propia, y nos permite desconectar, al proporcionarnos entretenimiento y diversi&oacute;n.</span></p>\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size: 12pt;\">En definitiva, contribuyen de una forma evidente al desarrollo y bienestar social de un individuo. Eso no puede pasarse por alto, y las celebraciones proporcionan la excusa perfecta.</span></strong></p>\r\n</div>\r\n</div>','<div class=\"row\"><!-- Columna Izda inicio-->\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>La vida son momentos &iexcl;Cel&eacute;bralos!</h2>\r\n<p style=\"text-align: justify;\"><strong>Hoy d&iacute;a 24 de Diciembre es sin duda un d&iacute;a para celebrar, un d&iacute;a para juntarnos con nuestros seres queridos y para compartir experiencias y vivencias.</strong></p>\r\n<p style=\"text-align: justify;\">Adem&aacute;s, en este d&iacute;a, nos despedimos de este original calendario de adviento que te ha acompa&ntilde;ado a lo largo de este mes. Esperamos de coraz&oacute;n que te hayan gustado los diferentes retos y prop&oacute;sitos que te hemos ido planteando a lo largo de todos estos d&iacute;as, esperamos tambi&eacute;n, que te animes a poner en pr&aacute;ctica alguno de ellos en el a&ntilde;o que est&aacute; por empezar.</p>\r\n<p style=\"text-align: justify;\"><!-- este es el separador de 10px--></p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy queremos animarte a que celebres estos d&iacute;as de fiesta con mucha alegr&iacute;a e ilusi&oacute;n, tambi&eacute;n queremos animarte a que reflexiones acerca de todo lo que has aprendido a trav&eacute;s del calendario, dedica un poco de tiempo a pensar sobre qu&eacute; buenos prop&oacute;sitos piensas poner en pr&aacute;ctica en el 2024.</p>\r\n<p style=\"text-align: justify;\">Adem&aacute;s, crea una bonita felicitaci&oacute;n navide&ntilde;a mediante este divertido juego que hemos dise&ntilde;ado. Si quieres puedes hacer una captura de pantalla y subirla en el muro para desearle una feliz navidad a todos tus compa&ntilde;eros/as.</p>\r\n</div>\r\n<!-- Columna Izda fin--> <!-- Columna Dch inicio-->\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/90.png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/89.png\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n<!-- Columna Izda fin--><!-- este es el separador de 10px-->\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\"><!-- este es el separador de 10px--></div>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"FELICITACI&Oacute;N NAVIDAD\" src=\"https://view.genial.ly/63a0ebf1e33265001338e9eb\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/fotos-1080-x-810-17.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n<div class=\"col-md-12\">&nbsp;</div>\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>La vida es muy corta para no celebrar los buenos momentos</h2>\r\n<p style=\"text-align: justify;\">La navidad tiene como objetivo dar y recibir amor, los momentos en familia y las tradiciones son espacios para alimentar el esp&iacute;ritu y disfrutar de los peque&ntilde;os y valiosos detalles de la vida.</p>\r\n<p style=\"text-align: justify;\">Para celebrar la navidad hay que&nbsp;sentirla y vivirla de manera alegre, es importante recordar que diciembre es solo un mes al a&ntilde;o y que la nochebuena es solo un d&iacute;a, disfr&uacute;tala al m&aacute;ximo, cel&eacute;brala de manera alegre y crea recuerdos para a&ntilde;os venideros.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy puedes aprovechar el muro para desear una Feliz Navidad a todos tus compa&ntilde;eros de la manera que quieras, con una imagen, con una frase, con una felicitaci&oacute;n Navide&ntilde;a y si lo deseas tambi&eacute;n puedes contarnos c&oacute;mo vas a celebrar estos d&iacute;as tan se&ntilde;alados!</p>\r\n<p style=\"text-align: center;\"><strong>Nosotros tambi&eacute;n nos despedimos dese&aacute;ndoos una &iexcl;Feliz Navidad y un pr&oacute;spero a&ntilde;o nuevo!</strong></p>\r\n</div>\r\n</div>','2022-11-16 08:36:23','2023-12-20 08:47:07'),(14,47,'en','Celebrate a sustainable christmas','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Respecting and caring for the natural world, as well as minimizing our environmental impact, must be priority for us all.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>It is our responsibility to get involved in looking after our planet, and to do so we need to make an effort every day to make our own small contribution.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Respect for our environment not only means understanding and appreciating it better, but also taking the necessary measures not to damage it.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Respecting and caring for the natural world, as well as minimizing our environmental impact, must be priority for us all.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">If we&rsquo;re concerned about our own wellbeing, then we should also be concerned about the wellbeing of the world in which we live.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>The sum of millions of small, individual actions can achieve a huge global impact. Adhering to good habits over time will give rise to major changes and minimize our impact on the planet.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Every day we engage in thousands of actions and activities in our day-to-day lives that can have a more or less aggressive impact on the environment: the energy we use, the way we travel, the recycling of our trash, the reuse of everyday objects, our water consumption&hellip;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Consequently, we need to ensure, as far as we possibly can, that our actions have the least possible impact.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Respect for our environment and the natural world should lead us to change the way we live, our attitude towards the world and, indeed, ourselves.</span></p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>Have a more sustainable Christmas</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The Christmas season in itself provides an excuse for us to drop our guard and indulge in certain excesses as an exception to the rule. However, observing a few sustainable habits during the festive season and encouraging our loved ones to follow suit CAN be done.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">It&rsquo;s well worth giving some thought to the fact that a more sustainable Christmas IS possible, precisely because this is a time when the values and gestures of solidarity come to the fore, and you will probably be helping to spread your commitment to solidarity to other people.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The average European generates one kilo of rubbish per day. At Christmas, this almost doubles to 1.75 kilos. Without a doubt, one of the first things we need to look at is responsible consumption during the festive period.</span></p>\r\n</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/fotos-1080-x-810-3.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Save energy by reducing your consumption. </strong>Whenever possible, use low energy lightbulbs and try to limit the time the Christmas lights are switched on to special times of day. Another idea is to use candles instead of electric lights.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Decorate sustainably. </strong>Create your own home-made decorations and take a break from plastic. Reuse and recycle objects you already have at home, such as candles, pine cones, plants, dry branches, etc. You can also use ornaments made from sustainable materials, pieces of wood, recycled glass balls, little ceramic houses, etc.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Responsible cooking. </strong>Go for Christmas menus that not only treat your taste buds but are good for the planet too! Include local, seasonal products on your shopping list. Try to avoid over -processed and over-packaged foods. Whenever you can, buy loose groceries.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>If you&rsquo;re going shopping, prioritize corner shops and local businesses. </strong>We all like a treat at this time of year, and there&rsquo;s nothing wrong with that, but use your common sense! If you&rsquo;re going to shop, do so mindfully.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Don&rsquo;t just buy for the sake of buying. </strong>Consumerism is not going to make you any happier. We recommend that you always ask yourself the following question before buying or requesting a gift? Is it really necessary? Another tip is to think about ten different situations in which you or the gift recipient will use this object. If you can&rsquo;t think of ten, then maybe it&rsquo;s not necessary.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Give the gift of experiences, moments, sensations&hellip; </strong>for example, trips, tickets to shows, dinners, and spa sessions, which can all be enjoyed in company and free you up from accumulating objects at home.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Reduce your use of plastic. </strong>Try to generate as little waste as possible, and, above all, avoid disposable plates, glasses and cutlery. To wrap your gifts, try using old newspapers or magazines, or offcuts of fabric.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Reuse and recycle! </strong>At the end of the festive season it&rsquo;s time to clear up, collect, save and recycle. Separate all the waste you&rsquo;ve generated and put it in the correct container. And keep all the materials, objects and decorations that you can use again next year.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">You know the score: you can also create a better world at Christmas!</span></p>\r\n</div>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">And to familiarize yourself with some of the measures you can put into practice during this Christmas season, we encourage you to play this fun game.</span></p>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"ALSO BECOMES AWARE OF CHRISTMAS\" src=\"https://view.genial.ly/63768d8fecd8e20017432429\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/regalo.png\" alt=\"\" width=\"420\" height=\"420\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">You\'re probably now more aware of all that you get out of recycling and all that you can still do. But if we focus on Christmas, you\'re probably now a little more aware of everything you can do to make this time of year a little less contaminating.</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">We encourage you to share what initiative you are going to put into practice this holiday season. Are you going to give more experiences and less gifts? Are you going to buy local products to make your Christmas dishes? We encourage you to upload a photo with your comment!</p>\r\n</div>\r\n</div>','2022-11-16 10:07:33','2022-11-29 10:08:48'),(15,47,'es','Toma conciencia también en Navidad','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">El cuidado y respeto por la naturaleza as&iacute; como minimizar el impacto medioambiental deber&iacute;a ser una prioridad para todo el mundo.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Es nuestra responsabilidad involucrarnos en el cuidado del planeta y para ello nos esforzamos diariamente para hacer nuestra peque&ntilde;a contribuci&oacute;n.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">El respeto por nuestro entorno, no solo se traduce en conocer y valorarlo mejor, sino tambi&eacute;n en tomar las medidas necesarias para no da&ntilde;arlo.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size: 12pt;\">El cuidado y respeto por la naturaleza as&iacute; como minimizar el impacto medioambiental deber&iacute;a ser una prioridad para todo el mundo.&nbsp;</span></strong></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Si nos preocupa nuestro propio bienestar tambi&eacute;n deber&iacute;a preocuparnos el bienestar del entorno en el que vivimos.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>La suma de las peque&ntilde;as acciones individuales conseguir&aacute; un gran impacto global. </strong>Mantener buenos h&aacute;bitos en el tiempo dar&aacute; lugar a grandes cambios y minimizar&aacute; nuestra huella en el planeta.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Cada d&iacute;a realizamos un mont&oacute;n de acciones y actividades en nuestro d&iacute;a a d&iacute;a que pueden tener efectos m&aacute;s o menos agresivos sobre el medio ambiente: la energ&iacute;a que utilizamos, la forma de trasladarnos, el reciclaje de los residuos que generamos, la reutilizaci&oacute;n de objetos cotidianos, el consumo del agua...</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Por tanto, debemos actuar, en la medida de lo posible, de forma que los efectos de nuestras acciones impacten lo menos posible.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Respetar el entorno y la naturaleza nos debe llevar a cambiar nuestra forma de vivir y nuestra actitud hacia el mundo y hacia nosotros mismos.</span></p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>Vive una Navidad m&aacute;s sostenible</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Las fiestas navide&ntilde;as suponen en s&iacute; mismas levantar la guardia para realizar ciertos excesos que nos permitimos como excepci&oacute;n. Sin embargo, aplicar unos h&aacute;bitos sostenibles durante estas fechas y contagiar a nuestros seres queridos es posible. </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Merece la pena hacer esta reflexi&oacute;n de que una Navidad m&aacute;s sostenible es posible, justamente por tratarse de una &eacute;poca en la que se ensalzan valores y gestos de solidaridad, probablemente estemos ayudando a contagiar nuestro prop&oacute;sito de solidaridad a los dem&aacute;s.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Cada &nbsp;persona en Espa&ntilde;a genera 1kg de basura al d&iacute;a aproximadamente. En Navidad este &iacute;ndice se duplica pasando a 1,75kg. Por ello, sin duda uno de los primeros puntos que debemos tener en cuenta es realizar un consumo responsable durante estas fechas.</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/fotos-1080-x-810-3.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Ahorra energ&iacute;a reduciendo tu consumo. </strong>Siempre que puedas utiliza bombillas de bajo consumo e intenta limitar las horas de encendido de las luces navide&ntilde;as a momentos especiales. Otra idea es utilizar velas en lugar de bombillas.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Decora de manera sostenible. </strong>Crea tu propia decoraci&oacute;n hecha a mano y dale un respiro al pl&aacute;stico. Reutiliza y recicla objetos que tienes al alcance como velas, pi&ntilde;as, plantas, ramas secas, etc. Tambi&eacute;n puedes recurrir a adornos hechos a partir de materiales sostenibles, piezas de madera, bolas de vidrio reciclado, casitas de cer&aacute;mica&hellip;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Cocina responsable. </strong>Opta por men&uacute;s de Navidad buenos para tu paladar y para el planeta. Incluye en tus comidas productos locales y de temporada. Intenta evitar productos demasiado procesados y sobre envasados. Siempre que puedas &iexcl;compra a granel!</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Si vas a comprar, prioriza comercios locales o de proximidad. </strong>A todos nos gusta darnos un capricho en estos d&iacute;as, y est&aacute; bien pero &iexcl;compra con sentido! Si vas a comprar que sea de forma responsable.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>No compres por comprar. </strong>El consumismo no te har&aacute; m&aacute;s feliz. Te animamos a que te hagas siempre la siguiente pregunta antes de comprar o pedir un regalo. &iquest;Lo necesito realmente? Otro truco es pensar en 10 situaciones distintas en las que t&uacute; o el destinatario va a poder usar ese objeto. Si no las encuentras quiz&aacute;s no lo necesites.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Regala experiencias, momentos, sensaciones&hellip; </strong>como por ejemplo viajes, entradas a espect&aacute;culos, cenas, sesiones de spa, que puedan disfrutarse en compa&ntilde;&iacute;a y que te liberen de acumular objetos en casa.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Reduce el consumo de pl&aacute;stico. </strong>Intenta generar pocos residuos y sobre todo evita platos, vasos y cubiertos desechables. Para envolver los regalos puedes probar a reutilizar papel de peri&oacute;dico y revistas o tambi&eacute;n retales de tela.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>&iexcl;Reutiliza y recicla! </strong>Una vez acaban las fiestas toca limpiar, recoger, guardar y reciclar. Separa todos los residuos que generes y depos&iacute;talos en el contenedor correspondiente. Y guarda todos aquellos materiales, objetos y adornos que puedan ser utilizados el a&ntilde;o que viene.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Ya lo sabes, crea un mejor, &iexcl;tambi&eacute;n &iexcl;tambi&eacute;n en Navidad!</span></p>\r\n</div>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Y&nbsp; para que te familiarices con algunas de las medidas que puedes poner en pr&aacute;ctica durante estas navidades te animamos a que realices este divertido juego.</span></p>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"TOMA CONCIENCIA TAMBI&Eacute;N EN NAVIDAD **EN**\" src=\"https://view.genial.ly/637e685d6571e9001267fcaa\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/regalo.png\" alt=\"\" width=\"420\" height=\"420\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">Seguramente ahora seas m&aacute;s consciente de todo lo que consigues cada vez que reciclas y de todo lo que todav&iacute;a puedes hacer.</p>\r\n<p style=\"text-align: justify;\">Pero si nos centramos en las navidades, seguro que ahora eres un poco m&aacute;s consciente de todo lo que puedes hacer para que esta &eacute;poca del a&ntilde;o sea algo menos contaminante.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Te animamos a que compartas qu&eacute; iniciativa vas a poner en pr&aacute;ctica en estas fechas. &iquest;Vas a regalar m&aacute;s experiencias y menos regalos? &iquest;comprar&aacute;s&nbsp; producto local para realizar tus platos navide&ntilde;os? &iexcl;An&iacute;mate a subir una foto junto a tu comentario!</p>\r\n</div>\r\n</div>','2022-11-16 10:07:33','2023-11-30 09:53:09'),(16,48,'en','Include physical exercise into your daily life','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Cultivating a healthy lifestyle is essential for complete physical and mental well-being.</strong>.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Although this is something we all want, often when it comes to taking action we look for excuses and end up eating poorly and leading a sedentary life.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">To achieve the best version of ourselves, it is important to incorporate certain habits into our routine, including physical exercise.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h2>Exercise not only changes your body, it changes your mind, your attitude and your mood</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Cultivating a healthy lifestyle is essential for complete physical and mental well-being.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>All of us, children, adults and seniors need to do sports. </strong>So much so, that doctors say that physical exercise is essential to lead a healthy life. Not only physically, but also in terms of mental health. Sport helps to improve our physical condition, but also enhances memory, concentration and mental agility.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">We all know that a sedentary lifestyle is one of the main enemies of health. Our body has been designed to be in movement, and muscles require physical activation to stay strong. In fact, many diseases can be prevented by following a proper sports routine.</span></p>\r\n</div>\r\n</div>','<div class=\"row\"><!-- Columna Izda inicio-->\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">With the huge variety of sports that exist, if you have not yet decided to practice any of them, you have not found yours! Apart from being necessary for your health, exercise will bring you so many benefits that, as soon as you discover what your sport is, you won\'t want to stop practicing it. We give you some good reasons to do it:</p>\r\n<p style=\"text-align: justify;\">We give you some good reasons to get started:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li style=\"text-align: left;\">Improves joint health and increases flexibility</li>\r\n<li style=\"text-align: left;\">Relieves stress, anger and anxiety</li>\r\n<li style=\"text-align: left;\">By practicing sports, endorphins are released, which is a hormone that is responsible for producing happiness.</li>\r\n<li style=\"text-align: left;\">It helps to maintain a healthy weight</li>\r\n<li style=\"text-align: left;\">Improves the quality of sleep and rest</li>\r\n<li style=\"text-align: left;\">It is a natural analgesic that can relieve pain and promote muscle relaxation</li>\r\n<li style=\"text-align: left;\">It takes care of your heart health and prevents cardiovascular diseases</li>\r\n<li style=\"text-align: left;\">Improves stamina and increases energy</li>\r\n<li style=\"text-align: left;\">Reduces the risk of osteoporosis</li>\r\n<li style=\"text-align: left;\">It can relieve menstruation pains by improving blood circulation</li>\r\n<li style=\"text-align: left;\">In addition, it helps to improve memory, learning ability, concentration and problem solving, so you will perform better in class work</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">According to the World Health Organization, more than 50% of the adult population in developed countries does not get enough physical activity. Are you among that percentage of people</p>\r\n</div>\r\n<!-- Columna Izda fin--> <!-- Columna Dch inicio-->\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/Fotosgifs%20Calendario%20-2.gif\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/fotosgifs-calendario-3.png\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n<!-- Columna Izda fin-->\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we challenge you to think about how you can incorporate exercise into your daily life (if you don\'t already). We also encourage you to play this fun game about sport, are you an expert on the subject?</p>\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\"><!-- este es el separador de 10px-->\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"INCORPORATE EXERCISE INTO YOUR DAILY ROUTINE\" src=\"https://view.genial.ly/637e6fbf0e1fce0016a55fc3\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/Disen%CC%83o%20sin%20ti%CC%81tulo-5.gif\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">If the practice of exercise has so many health benefits, then why is it so hard for us to include it in our daily routine? There are many reasons that prevent us from leading an active life. Lack of time, laziness, insecurity, not knowing what to do or how to do it...</p>\r\n<p style=\"text-align: justify;\">Sport, especially at the beginning, makes us feel tired and sore. That\'s why it\'s so hard to start taking care of yourself.</p>\r\n<p style=\"text-align: justify;\">Even so, there is a way to start leading a healthy life without dying trying. <strong>Psychological experts have determined that it takes 21 days to establish a habit.</strong></p>\r\n<p style=\"text-align: justify;\">What you need to avoid is \"beating yourself up\" senselessly, especially if you\'re just starting to train. Start slowly and progressively. Choose a sporting activity that you really like, and understand that more than a punishment, it is a lifestyle with which you will feel better. Movement should be part of our daily lives!</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">So today we encourage you to share with the rest of your colleagues the sport that you enjoy and practice with some frequency. If you are in a less active moment, share the one you would like to take up again or start doing, maybe this way you will be encouraged to activate it!</p>\r\n</div>\r\n</div>','2022-11-16 10:10:36','2022-11-24 16:43:14'),(17,48,'es','Incorpora el ejercicio físico a tu día a día','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Cultivar un estilo de vida saludable</strong>&nbsp;es fundamental para gozar de un&nbsp;bienestar&nbsp;completo,<strong> tanto&nbsp;f&iacute;sico como mental</strong>.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> Aunque esto es algo que todos deseamos, a menudo, a la hora de pasar a la acci&oacute;n buscamos excusas y acabamos aliment&aacute;ndonos de forma poco conveniente y llevando una vida demasiado sedentaria.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Para conseguir la mejor versi&oacute;n de nosotros mismos, es importante&nbsp; incorporar a nuestra rutina ciertos h&aacute;bitos, entre ellos el ejercicio f&iacute;sico.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Cultivar un estilo de vida saludable&nbsp;es fundamental para gozar de un&nbsp;bienestar&nbsp;completo, tanto&nbsp;f&iacute;sico como mental.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Todos, ni&ntilde;os/as, adultos y personas mayores necesitamos hacer deporte</strong>. Tanto es as&iacute;, que los m&eacute;dicos aseguran que el ejercicio f&iacute;sico es fundamental para poder llevar una vida sana. No solo a nivel f&iacute;sico, sino tambi&eacute;n en el plano que tiene que ver con la salud mental. El deporte ayuda a mejorar nuestra condici&oacute;n f&iacute;sica, pero tambi&eacute;n potencia la memoria, la concentraci&oacute;n y la agilidad mental.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Todos sabemos que el sedentarismo es uno de los principales enemigos de la salud. Nuestro cuerpo ha sido dise&ntilde;ado para estar en movimiento, y los m&uacute;sculos&nbsp;requieren de activaci&oacute;n f&iacute;sica para mantenerse fuertes. De hecho, muchas enfermedades se pueden prevenir llevando una rutina deportiva adecuada.</span></p>\r\n</div>\r\n</div>','<div class=\"row\"><!-- Columna Izda inicio-->\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>\"El ejercicio no solo cambia tu cuerpo, cambia tu mente, tu actitud y tu humor</h2>\r\n<p style=\"text-align: justify;\">Con la enorme variedad de deportes que existen, si a d&iacute;a de hoy a&uacute;n no te has animado a practicar ninguno, &iexcl;es que no has encontrado el tuyo! Aparte de ser necesario para tu salud, el ejercicio te aportar&aacute; tantos beneficios que, en cuanto descubras cu&aacute;l es tu deporte, no querr&aacute;s dejar de practicarlo.</p>\r\n<p style=\"text-align: justify;\">Te damos algunas buenas razones para ponerte a ello:</p>\r\n<ul>\r\n<li>Mejora la salud de tus articulaciones y aumenta la flexibilidad</li>\r\n<li>Alivia el estr&eacute;s, la ira y la ansiedad</li>\r\n<li>Al practicar deporte, se liberan endorfinas, que es una hormona que se encarga de producir felicidad</li>\r\n<li>Ayuda a mantener un peso saludable</li>\r\n<li>Mejora la calidad del sue&ntilde;o y del descanso</li>\r\n<li>Es un analg&eacute;sico natural con el que se puede aliviar el dolor y promover la relajaci&oacute;n muscular</li>\r\n<li>Cuida la salud de tu coraz&oacute;n y previene las enfermedades cardiovasculares</li>\r\n<li>Mejora la resistencia y aumenta la energ&iacute;a</li>\r\n<li>Disminuye el riesgo de sufrir osteoporosis</li>\r\n<li>Puede aliviar los dolores de la menstruaci&oacute;n gracias a la mejora de la circulaci&oacute;n sangu&iacute;nea</li>\r\n<li>Adem&aacute;s, ayuda a mejorar la memoria, la habilidad de aprendizaje, la concentraci&oacute;n y la resoluci&oacute;n de problemas, por lo que rendir&aacute;s m&aacute;s en el trabajo o en clase</li>\r\n</ul>\r\n<p>Seg&uacute;n la organizaci&oacute;n Mundial de la salud, m&aacute;s del 50% de la poblaci&oacute;n adulta de los pa&iacute;ses desarrollados no realiza suficiente actividad f&iacute;sica. &iquest;Te encuentras dentro de ese porcentaje de personas?</p>\r\n<p style=\"text-align: justify;\"><!-- este es el separador de 10px--></p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy te desafiamos a que reflexiones acerca de c&oacute;mo puedes incorporar el ejercicio en tu d&iacute;a a d&iacute;a (si es que no lo haces ya). Adem&aacute;s, te animamos a que realices este divertido juego sobre deporte &iquest;Eres un/a exper-to/a en la materia?</p>\r\n</div>\r\n<!-- Columna Izda fin--> <!-- Columna Dch inicio-->\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/deporte-1.jpg\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/deporte-2.jpg\" alt=\"\" width=\"420\" height=\"520\" /></p>\r\n</div>\r\n<!-- Columna Izda fin--><!-- este es el separador de 10px--></div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"EJERCICIO EN TU D&Iacute;A\" src=\"https://view.genial.ly/637a733b6d485c0013c2a4b8\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/deporte-420x520.jpg\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">Si la pr&aacute;ctica de ejercicio supone tantos beneficios para la salud, entonces &iquest;por qu&eacute; nos cuesta tanto incluirlo en nuestra rutina diaria? Existen m&uacute;ltiples causas que nos impiden llevar una vida activa. La falta de tiempo, la pereza, la inseguridad, no saber qu&eacute; hacer ni c&oacute;mo hacerlo&hellip;</p>\r\n<p style=\"text-align: justify;\">El deporte, sobre todo al principio, nos hace sentir cansados y doloridos. Por esta raz&oacute;n cuesta tanto empezar a cuidarse.</p>\r\n<p style=\"text-align: justify;\">Aun as&iacute;, existe una manera de empezar a llevar una vida sana sin morir en el intento.&nbsp;<strong>Los expertos en psicolog&iacute;a han determinado que se necesitan 21 d&iacute;as para establecer un h&aacute;bito.</strong></p>\r\n<p style=\"text-align: justify;\">Lo que tienes que evitar&nbsp;es &ldquo;machacarte&rdquo; sin sentido, especialmente si est&aacute;s empezando a entrenar. Empieza poco a poco y de manera progresiva. Elige una actividad deportiva que realmente te guste, y entiende que m&aacute;s que un castigo es un estilo de vida con el que te sentir&aacute;s mejor. &iexcl;El movimiento debe formar parte de nuestro d&iacute;a a d&iacute;a!</p>\r\n<p style=\"text-align: justify;\"><strong>&iexcl;Adem&aacute;s hoy hay premio, entre todos los que particip&eacute;is sortearemos 90 <span class=\"SpellE\">vouchers</span> de descuento para gastar en la tienda online de Oakley!</strong></p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">As&iacute; que hoy te animamos a que compartas con el resto de compa&ntilde;eros aquel deporte con el que disfrutas y practicas con cierta frecuencia. Si est&aacute;s en momento menos activo comparte aquel que te gustar&iacute;a retomar o iniciar, &iexcl;Quiz&aacute;s de esta manera de animes a reactivarlo!</p>\r\n</div>\r\n</div>','2022-11-16 10:10:36','2023-12-14 08:34:08'),(18,49,'en','Find time for yourself','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size: 12pt;\">Dedicating time to ourselves increases our confidence, and&nbsp;self-esteem; it helps us to think clearly, improves our relationship with colleagues, friends and family, and enhances our wellbeing.</span></strong></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">It is vitally important to devote some time every day to doing something you enjoy. Reading, cooking something new, going to a yoga class, engaging in a hobby at home, giving yourself a massage, meditating&hellip; whatever comforts you and recharges your batteries.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Ask yourself: &ldquo;What have I done for myself lately?&rdquo; If you can&rsquo;t come up with a good answer quickly, it&rsquo;s probably a very long time since you last took the time to focus on yourself. So now that a new year is starting, it&rsquo;s time to start being good to yourself, incorporating the excellent habit of taking time each day to give yourself what you need.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Try to make this quality time: don&rsquo;t rush it, banish any worries from your mind, and don&rsquo;t feel guilty about it.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Dedicating time to ourselves increases our confidence, and&nbsp;self-esteem; it helps us to think clearly, improves our relationship with colleagues, friends and family, and enhances our wellbeing.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The alarm clock rings and, as soon as you put your feet on the ground, you start to work... that is, in a hurry because there is no time. Breakfast, the children, the dog, work, shopping, the meeting you had scheduled, the house... The day is over and you haven\'t had a chance to take time for yourself or to do something you really enjoy. Sound familiar?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>In the same way that dreaming refreshes body and mind, failing to take time for yourself can turn daily life into an exhausting routine.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">It&rsquo;s also important that you realize that creativity is not found in the organized, logical left-hand side of your brain. Creativity is found in the chaotic and disorderly right-hand side of the brain. And the same applies to inspiration.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">It&rsquo;s very likely that your best ideas and solutions will come from one of those moments during which you&rsquo;re enjoying your free time. It&rsquo;s incredible what your mind can come up with when you give it free rein.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>If someone really wants to do something, they will find a way. If they find excuses, they don&rsquo;t really want to do it.</h2>\r\n<p style=\"text-align: justify;\">We know what you&rsquo;re thinking. &ldquo;I haven&rsquo;t got time to do what I really love doing&rdquo;, is something we say to ourselves on a daily basis to help justify our monotonous daily life full of tasks and obligations.</p>\r\n<p style=\"text-align: justify;\">Saying you don&rsquo;t have the time lowers the demands you place upon yourself. It makes you accept a situation that you really don&rsquo;t like.</p>\r\n<p style=\"text-align: justify;\">We need to focus on everything that we CAN do, and stop clinging on to excuses that won&rsquo;t let us move forward.</p>\r\n<p style=\"text-align: justify;\">Time is there for everyone: what makes the difference is how we use our time. We have time, so maybe what we don\'t do well is manage our priorities. If you think you don\'t have time, what you should do is review what you are spending your time on.</p>\r\n<p style=\"text-align: justify;\">It all comes down to a matter of choice. You decide what you are going to invest your time in and for that you need to be aware of what you are investing it in to really know if it is worth it or not.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we encourage you to make a commitment to plan and optimize your time, so you can download this organizer that we have designed for you. We are sure that if you put it into practice, you will be able to make more time to do what you enjoy the most.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\"><a class=\"btn btn-primary\" href=\"../../../../storage/files/uploads/personal-planner.pdf\">PLANNER</a></p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/1%20(4).png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/Disen%CC%83o%20sin%20ti%CC%81tulo-8.gif\" alt=\"\" width=\"420 \" height=\"520\" /></p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/Disen%CC%83o%20sin%20ti%CC%81tulo-7.gif\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>Nuture your soul with happy moments, your body will thank you for it</h2>\r\n<p style=\"text-align: justify;\">Now that you&rsquo;ve found the way of getting some time for yourself, for doing what you most enjoy doing, all you have to do is learn how to organize and optimize this free time to fit in all the things you love that bring you so much pleasure.</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we are going to ask you to tell us a little about your priorities when it comes to enjoyment. Tell us how you enjoy your free time. Share on the wall what you like to do most in your leisure time: playing with your kids? practicing your favorite sport? a good meal with friends? a trip to a new destination?... In this way we will get to know each other a little better!</p>\r\n</div>\r\n</div>','2022-11-16 10:19:41','2022-11-24 16:53:01'),(19,49,'es','Encuentra tiempo para ti','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p><strong><span style=\"color: #000000; font-size: 12pt;\">Dedicarnos tiempo a nosotros/as mismos/as incrementa nuestra confianza,&nbsp;<a style=\"color: #000000;\" href=\"https://yoelijocuidarme.es/2016/01/15/fortalece-tu-autoestima/\">aumenta nuestra autoestima</a>, nos ayuda a pensar con claridad y mejora nuestra relaci&oacute;n con el entorno, as&iacute; como con nuestro bienestar.</span></strong></p>\r\n<p><span style=\"font-size: 12pt;\">Es de vital importancia dedicar un tiempo diario a&nbsp;realizar algo que nos plazca. Leer, cocinar algo nuevo, acudir a tu clase de yoga, ejercitar una afici&oacute;n en casa, darte un masaje, realizar una meditaci&oacute;n&hellip; lo que sea que te reconforte y te recargue las pilas.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Preg&uacute;ntate: &ldquo;&iquest;Qu&eacute; he hecho por m&iacute; &uacute;ltimamente?&rdquo; Si no puedes encontrar una buena respuesta con rapidez, lo m&aacute;s probable es que sea debido a que ha pasado mucho tiempo desde que te tomaste un tiempo para centrarte en ti.</span></p>\r\n<p><span style=\"font-size: 12pt;\">As&iacute; que empieza por ser dedicarte tiempo de calidad, ahora que comienza un nuevo a&ntilde;o incorpora el buen h&aacute;bito de tomar un tiempo libre y date lo que necesitas.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\">&nbsp;</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Dedicarnos tiempo a nosotros mismos incrementa nuestra confianza,&nbsp;aumenta nuestra autoestima, nos ayuda a pensar con claridad, mejora nuestra relaci&oacute;n con el entorno y nuestro bienestar.</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">Suena el despertador y, seg&uacute;n pones los pies en el suelo, empiezas a funcionar, eso s&iacute;, a la carrera porque no hay tiempo. El desayuno, los ni&ntilde;os, el perro, el trabajo, la compra, la reuni&oacute;n que ten&iacute;as programada, la casa...</span></p>\r\n<p><span style=\"font-size: 12pt;\">Se ha acabado el d&iacute;a y no has tenido oportunidad de dedicar tiempo para ti o para hacer algo con lo que realmente disfrutes. &iquest;Te suena?</span></p>\r\n<p><span style=\"font-size: 12pt;\"><strong>Al igual que el sue&ntilde;o refresca la mente y el cuerpo, no tomar tiempo libre para ti convierte el d&iacute;a a d&iacute;a en una rutina agotadora.</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">Adem&aacute;s, es importante que sepas que la creatividad no se encuentra en la parte organizada y l&oacute;gica de tu cerebro izquierdo. La creatividad vive en el lado ca&oacute;tico y desordenado de tu cerebro derecho. Y lo mismo ocurre con la inspiraci&oacute;n.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Es muy probable que las mejores ideas o soluciones aparezcan en uno de esos momentos en los que est&eacute;s disfrutando de tu tiempo libre. Es incre&iacute;ble de lo que es capaz tu cerebro cuando le das rienda suelta.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Quien quiere hacer algo encuentra el medio, quien no quiere hacer nada encuentra excusas</h2>\r\n<p>Sabemos lo que est&aacute;s pensando. &ldquo;No tengo tiempo para hacer eso que tanto me gusta hacer&rdquo; una frase que nos decimos a diario y que nos ayuda a justificar nuestra mon&oacute;tona vida llena de tareas y obligaciones.</p>\r\n<p>Decir que no tienes tiempo&nbsp;rebaja tus niveles de autoexigencia y hace que&nbsp;te acomodes&nbsp;a una situaci&oacute;n que realmente no te gusta.</p>\r\n<p>Deber&iacute;amos&nbsp;enfocarnos en todo lo que s&iacute; podemos hacer&nbsp;y dejar de quedarnos aferrados/as a una&nbsp;excusa que no nos permite avanzar.</p>\r\n<p>El tiempo est&aacute; ah&iacute; para todos; lo que marca la diferencia es c&oacute;mo usamos nuestro tiempo. Tiempo tenemos, as&iacute; que quiz&aacute;s lo que no hacemos bien es gestionar nuestras prioridades. Si crees que no tienes tiempo, lo que tendr&iacute;as que hacer es revisar a qu&eacute; lo est&aacute;s dedicando.</p>\r\n<p>Todo se reduce a una cuesti&oacute;n de elecci&oacute;n. T&uacute; decides en qu&eacute; vas a invertir tu tiempo y para ello necesitas ser consciente de en qu&eacute; lo est&aacute;s invirtiendo para realmente saber si vale la pena o no.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy te animamos a que cojas el compromiso de planificarte y optimizar mejor tu tiempo, para ello, puedes descargarte este organizador que hemos dise&ntilde;ado para ti. Seguro que, si lo pones en pr&aacute;ctica, ser&aacute;s capaz de sacar m&aacute;s tiempo para hacer aquello con lo que m&aacute;s disfrutas.</p>\r\n<p><a class=\"btn btn-primary\" href=\"../../../../storage/files/uploads/organizador-personal.pdf\">ORGANIZADOR</a></p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/1%20(4).png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/Disen%CC%83o%20sin%20ti%CC%81tulo-8.gif\" alt=\"\" width=\"420 \" height=\"520\" /></p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/premio-spa.jpg\" alt=\"\" width=\"420\" height=\"420\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>Alimenta tu alma de momentos felices, tu cuerpo te lo agradecer&aacute;</h2>\r\n<p>Ahora que ya has encontrado la manera de conseguir un tiempo para ti y para hacer lo que m&aacute;s te gusta hacer, s&oacute;lo tienes que aprender a organizar y optimizar ese tiempo libre para realizar todas esas cosas que tanto te gustan y con las que tanto disfrutas.</p>\r\n<p>&iexcl;Adem&aacute;s hoy hay premio! Entre todos los que particip&eacute;is en el desaf&iacute;o de hoy sortearemos un masaje o un circuito de spa para 2 personas. Tienes todo el d&iacute;a de hoy para participar.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy vamos a pedirte que nos cuentes un poco sobre tus prioridades a la hora de disfrutar. Cu&eacute;ntanos c&oacute;mo disfrutas de tu tiempo libre. Compar-te en el muro lo que m&aacute;s te gusta hacer en tu tiempo de ocio &iquest;Jugar con tus hijos/as? &iquest;Practicar tu deporte favorito? &iquest;Una buena comida con amigos/as? &iquest;Un viaje a un nuevo destino?&iexcl;De esta forma nos cono-ceremos un poco m&aacute;s los unos a los otros!</p>\r\n</div>\r\n</div>','2022-11-16 10:19:41','2023-12-07 13:33:40'),(20,50,'en','Feel the rhythm of the music','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> Humans are born with the ability to tell the difference between noise and music. The brain has different pathways for processing the different parts of music, including tone, melody, rhythm and tempo. Indeed, listening to fast music can increase your pulse, breathing rate and blood pressure; while slow music tends to have the opposite effect. Some songs can even trigger off specific memories, evoking happiness, calm, or other emotions.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Music can arouse powerful emotions in people, such as joy, sadness or fear &ndash; some say that music even has the power to mobilise people. According to some researchers, music can even improve your health and wellbeing.</strong></span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Listening to music sparks off a wide variety of brain activities and stimuli which have a direct influence on important aspects of life such as mood, stress control, anxiety and fatigue.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Music can arouse powerful emotions in people, such as joy, sadness or fear &ndash; some say that music even has the power to mobilise people. According to some researchers, music can even improve your health and wellbeing.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">It is evident that music has a direct impact on our nervous system, engendering some kind of positive outcome. These are some of the effects music can have:</span></p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt;\">Alleviating problems related to stress and&nbsp;anxiety.</span></li>\r\n<li><span style=\"font-size: 12pt;\">Improving memory.</span></li>\r\n<li><span style=\"font-size: 12pt;\">Helping to withstand certain types of pain.</span></li>\r\n<li><span style=\"font-size: 12pt;\">Switching off from everyday problems.</span></li>\r\n<li><span style=\"font-size: 12pt;\">Relaxing mind and body.</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Music offers many physical, cognitive and motor benefits. </strong>It increases our ability to respond more rapidly to a variety of sensorial stimuli. It enhances our memory, thoughts, emotions, creativity and imagination.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> And apart from all that,<strong> it helps us to understand how we feel so we can reach out more easily to other people. </strong>So we might also say that it has a positive impact on social and emotional development.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>&ldquo;Dance like nobody&rsquo;s watching&rdquo;</h2>\r\n<p style=\"text-align: justify;\">Now you know about all the benefits that music offers, we encourage you to make a regular habit (if you don&rsquo;t already) of listening to music, and also to take up dancing, whether on your own or with a partner. Banish the fear of moving your body while listening to music! It doesn&rsquo;t matter if you think you have no sense of rhythm, just go with the flow and you&rsquo;ll soon see how good it makes you feel!</p>\r\n<p style=\"text-align: justify;\">Don&rsquo;t forget that dance is expression in movement. When dancing we communicate movements, feelings and even opinions. Dance encompasses rhythm, connection, mind-body synchrony and expressivity.</p>\r\n<p style=\"text-align: justify;\">So forget your prejudices and let yourself be swept away by the rhythm of the music; find the perfect time to let the beat of a song move your body.</p>\r\n<p style=\"text-align: justify;\">The truth is that when we dance we switch off from the worries and stresses of daily life for a while, connecting with new experiences.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we want to encourage you to make music a bigger part of your life. If you&rsquo;re already someone who can&rsquo;t conceive of life without music, you probably have a whole series of playlists; in this case, why not share one or more of your lists with your colleagues at work?</p>\r\n<p style=\"text-align: justify;\">And take this fun quiz to measure the extent of your musical knowledge!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-3.png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"ADIVINA LA CANCI&Oacute;N 2022\" src=\"https://view.genial.ly/6377f1ed6d7a2100161435c0\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/fotos-1080-x-810-11.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n<div class=\"col-md-12\">&nbsp;</div>\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Music is a remedy that can be used at any time</h2>\r\n<p style=\"text-align: justify;\">You&rsquo;ve already seen that. If you want to do something good for your mind, turn on the music player and sing along to some songs. Even better &ndash; sing and dance at the same time!</p>\r\n<p>Here are a few ways of activating the power of music.</p>\r\n<ul>\r\n<li>Bring music into your life and share it with your friends and family.</li>\r\n<li>Sing, dance or move to music to exercise, relieve stress, make social contacts and stimulate your mind.</li>\r\n<li>Listening to familiar music is comforting and evokes positive memories and connections.</li>\r\n<li>You can also try listening to music you&rsquo;re not familiar with. Unfamiliar melodies can stimulate the brain.</li>\r\n<li>Listen to music to motivate you to exercise. Music can provide a mental stimulus and encourages body movements.</li>\r\n<li>Sing or play an instrument to create music yourself.</li>\r\n<li>Take part in musical activities with other people.</li>\r\n</ul>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">And now share your favourite type of music or your favourite song on the wall. Do you play any instruments? Feel free to share a photo of you playing!</p>\r\n</div>\r\n</div>','2022-11-16 10:39:19','2022-12-07 09:40:49'),(21,50,'es','Siente el ritmo de la música','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Los seres humanos nacemos con la habilidad de notar la diferencia entre ruido y m&uacute;sica. El cerebro tiene diferentes v&iacute;as para procesar las diferentes partes de la m&uacute;sica, incluyendo el tono, la melod&iacute;a, el ritmo y el tempo. De hecho, la m&uacute;sica r&aacute;pida puede elevar la frecuencia cardiaca, la frecuencia respiratoria, y la presi&oacute;n arterial; mientras que la m&uacute;sica lenta tiende a tener el efecto contrario. Incluso determinadas canciones pueden traer alg&uacute;n recuerdo espec&iacute;fico, provocando felicidad, calma o alguna otra emoci&oacute;n.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> La m&uacute;sica puede evocar en las personas emociones fuertes, tales como alegr&iacute;a, tristeza, o miedo &ndash; algunos dir&aacute;n que la m&uacute;sica tiene el poder de mover a las personas. De acuerdo con algunos investigadores, la m&uacute;sica puede incluso tener el poder de mejorar la salud y el bienestar.</strong></span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Escuchar m&uacute;sica provoca una gran variedad de actividades y est&iacute;mulos cerebrales&nbsp;que influyen directamente en aspectos importantes de la vida como el estado de &aacute;nimo, el control del estr&eacute;s, la ansiedad o la fatiga.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">La m&uacute;sica puede evocar en las personas emociones fuertes, tales como alegr&iacute;a, tristeza, o miedo &ndash; algunos dir&aacute;n que la m&uacute;sica tiene el poder de mover a las personas. De acuerdo con algunos investigadores, la m&uacute;sica puede incluso tener el poder de mejorar la salud y el bienestar.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Est&aacute; claro que la m&uacute;sica interviene directamente en nuestro sistema nervioso, causando alg&uacute;n tipo de efecto positivo. Estos son algunos de los efectos que puede provocar: </span></p>\r\n<ul>\r\n<li><span style=\"font-size: 12pt;\">Aliviar problemas relacionados con el estr&eacute;s y la ansiedad.</span></li>\r\n<li><span style=\"font-size: 12pt;\">Mejorar la&nbsp;memoria.</span></li>\r\n<li><span style=\"font-size: 12pt;\">Soportar determinados dolores.</span></li>\r\n<li><span style=\"font-size: 12pt;\">Desconectar de los problemas cotidianos.</span></li>\r\n<li><span style=\"font-size: 12pt;\">Relajar la mente y el cuerpo.</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>La m&uacute;sica ofrece muchos beneficios tanto f&iacute;sicos, como cognitivos y motores.</strong>&nbsp;Aumenta nuestra capacidad de responder m&aacute;s r&aacute;pido ante diversos est&iacute;mulos sensoriales. Nos ayuda con nuestra memoria, pensamientos, emociones, creatividad e imaginaci&oacute;n.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Y </span><span style=\"font-size: 12pt;\">adem&aacute;s de todo ello, <strong>nos permite conocer c&oacute;mo nos sentimos para poder compartirlo m&aacute;s f&aacute;cilmente con los dem&aacute;s.</strong> Por tanto, se puede decir que, tambi&eacute;n repercute positivamente en el desarrollo social y afectivo.&nbsp;</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>&ldquo;Baila como si nadie te estuviera mirando&rdquo;</h2>\r\n<p style=\"text-align: justify;\">Ahora que ya sabes todos los beneficios que puede aportarte la m&uacute;sica, te animamos a que incorpores la costumbre (si no lo haces ya) de escuchar m&uacute;sica de manera regular, y tambi&eacute;na&nbsp; a que te animes a bailar, solo o acompa&ntilde;ado, &iexcl;Pierde el miedo a moverte mientras escuchas m&uacute;sica!, Da igual si eres de los que piensas que eres arr&iacute;tmico, simplemente d&eacute;jate llevar y ver&aacute;s qu&eacute; bien sienta.</p>\r\n<p style=\"text-align: justify;\">No olvides que el baile es expresi&oacute;n en movimiento. Bailando comunicamos movimientos, sensaciones e incluso opiniones. En el baile hay ritmo, conexi&oacute;n, sincron&iacute;a cuerpo-mente y expresi&oacute;n.</p>\r\n<p style=\"text-align: justify;\">Por ello olvida tus prejuicios y d&eacute;jate llevar por el ritmo de la m&uacute;sica, busca un momento id&oacute;neo para dejarte llevar a trav&eacute;s del ritmo que marque la canci&oacute;n.</p>\r\n<p style=\"text-align: justify;\">Lo cierto es que cuando bailamos desconectamos un rato de preocupaciones y agobios del d&iacute;a a d&iacute;a, para conectarnos con nuevas experiencias.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy queremos animarte a que la m&uacute;sica est&eacute; m&aacute;s presente en tu vida, si ya eres de los que no puedes vivir sin m&uacute;sica, puede que hasta tengas tus propias listas de m&uacute;sica, en ese caso &iquest;Por qu&eacute; no compartes alguna de tus listas con tus compa&ntilde;eros/as de trabajo?</p>\r\n<p style=\"text-align: justify;\">&iexcl;Adem&aacute;s realiza este divertido juego para medir hasta d&oacute;nde llegan tus conocimientos musicales!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-3.png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"ADIVINA LA CANCI&Oacute;N 2022\" src=\"https://view.genial.ly/6377f1ed6d7a2100161435c0\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>La m&uacute;sica es ese remedio que sirve para cualquier momento</h2>\r\n<p style=\"text-align: justify;\">Ya lo has visto. Si quieres hacer algo bueno para tu cerebro, enciende el reproductor de m&uacute;sica y canta algunas canciones. Mejor a&uacute;n, canta y baila al mismo tiempo.</p>\r\n<p style=\"text-align: justify;\">Aqu&iacute; tienes algunas maneras para activar el poder de la m&uacute;sica.</p>\r\n<ul>\r\n<li>Ponle m&uacute;sica a tu vida y comp&aacute;rtela con amigos/as y familiares.</li>\r\n<li>Baila, canta o mu&eacute;vete con la m&uacute;sica para hacer ejercicio, aliviar el estr&eacute;s, establecer v&iacute;nculos sociales y estimular el cerebro.</li>\r\n<li>Escucha m&uacute;sica conocida que te reconforte y evoque recuerdos y conexiones positivas.</li>\r\n<li>Tambi&eacute;n prueba escuchar m&uacute;sica que no conoces; las melod&iacute;as desconocidas pueden estimular el cerebro.</li>\r\n<li>Escucha m&uacute;sica para motivarte a hacer ejercicio. La m&uacute;sica puede proporcionar un est&iacute;mulo mental y ayudar a impulsarte a mover el cuerpo.</li>\r\n<li>Canta o toca un instrumento para crear m&uacute;sica t&uacute; mismo.</li>\r\n<li>Participa en actividades musicales con otras personas.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span class=\"\">&iexcl;Adem&aacute;s hoy tenemos premio! Entre todos los que particip&eacute;is en el desaf&iacute;o de hoy sortearemos una suscripci&oacute;n anual a Spotify Premium.&nbsp;</span></p>\r\n<div class=\"\">\r\n<div class=\"\"><strong><span class=\"\" style=\"color: #212529;\"><span class=\"\">Ten&eacute;is todo el d&iacute;a para participar. El ganador ser&aacute; anunciado ma&ntilde;ana en el apartado de &ldquo;premios&rdquo;.&nbsp;</span></span></strong></div>\r\n<div class=\"\">&nbsp;</div>\r\n</div>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Y ahora comparte en el muro cu&aacute;l es tu tipo de m&uacute;sica o tu canci&oacute;n favorita. &iquest;Tocas alg&uacute;n instrumento? Si&eacute;ntete libre de compartir una foto de tu &aacute;lbum o canci&oacute;n favorita, o una foto tuya tocando un instrumento.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/bailar.jpg\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/spotify.jpg\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n<!-- Columna Izda fin--><!-- este es el separador de 10px--></div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>','2022-11-16 10:39:19','2023-12-12 10:30:37'),(22,51,'en','Reduce your footprint','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The planet\'s resources are being depleted and a respectful and healthy model is urgently needed to ensure the future of next generations. Leading a sustainable lifestyle means achieving responsible consumption, <strong>it is about living based on a commitment to the environment and it can be achieved by introducing small actions in our daily life.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Each one of us eats, moves and consumes goods and services and many do so in a way that is not very responsible for the environment. The question is the following: Does the sustainable action of a few have any purpose? The answer is yes, every act counts. The changes done by a part of the population guarantee the efficiency of a sustainable life strategy.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The reputation of each serves as positive reinforcement in the others. Small individual changes will make a big global impact.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The planet\'s resources are being depleted and a respectful and healthy model is urgently needed to ensure the future of next generations. Leading a sustainable lifestyle means achieving responsible consumption, <strong>it is about living based on a commitment to the environment and it can be achieved by introducing small actions in our daily life.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">If we are connected with nature, we will understand that there are many things that we can improve to safeguard the natural resource. <strong>Sometimes we forget the need to take care and pamper our environment, to minimize our carbon footprint and also to be more respectful.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Achieving a sustainable and respectful lifestyle does not depend exclusively on individual factors, there are also collective and external factors on which it is more difficult to act, such as the legislation of each country or region, or the economic situation of the country, these are factors that can limit or encourage the adoption of a sustainable lifestyle.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Still, <strong>there is a long list of small actions that you can do individually.</strong> These will not only have a positive effect on our environment but will help as an example for many more people to start applying them in their daily lives.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Find out where you are</h2>\r\n<p style=\"text-align: justify;\">Today we want to encourage you to find out where you are in the race towards a sustainable lifestyle. A good way to find out is by analyzing your ecological footprint, whatever it is, we hope that by the end of this adventure, it will have been reduced.</p>\r\n<p style=\"text-align: justify;\">Remember that the ecological footprint measures the surface area necessary to produce the resources consumed by a citizen, as well as to absorb the waste generated.</p>\r\n<p style=\"text-align: justify;\">It is about incorporating, little by little, new habits that will help you to lead a more consistent and sustainable life. Apply the actions little by little, and you will see that as time goes by and the adventure advances you will be adopting the new habits in a simple and natural way.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Try to answer this TEST and find out what level of sustainability your lifestyle is at.</p>\r\n<p><a class=\"btn btn-primary\" href=\"https://iuk3zut73vv.typeform.com/to/RrH24IQt\">TEST</a></p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/bailar%20(1).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/prize-zero-waste.jpg\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>If you love your life, start by loving the planet\'s</h2>\r\n<p style=\"text-align: justify;\">The test may have given you food for thought, it may even be the first time you have asked yourself certain questions. Do you pay attention to the plastic in your shopping cart? Do you pay attention to the origin of your clothes? Do you take into account whether a product is in season when planning your weekly menu?</p>\r\n<p style=\"text-align: justify;\">And today there is a prize! among all of you who participate today we will raffle a kit to reduce&nbsp; plastic&nbsp; in your daily life.&nbsp;</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Be honest and share with your colleagues what profile you got in the TEST. Where do you think you prick the most? In your diet? In the way you move around? In your consumption?</p>\r\n<p style=\"text-align: justify;\">Don\'t you think it\'s time for a change? Feel free to upload a photo with that initiative or habit that you have incorporated to improve and take care of our planet. Together we will create a Wall full of good habits! The important thing is not what we are doing but what we are going to do from now on!</p>\r\n</div>\r\n</div>','2022-11-16 10:43:37','2022-12-10 21:13:29'),(23,51,'es','Reduce tu huella','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Los recursos del planeta se est&aacute;n agotando y urge un modelo respetuoso y saludable que asegure el futuro de nuevas generaciones. Llevar un estilo de vida sostenible es m&aacute;s que el logro de un consumo responsable, <strong>se trata de vivir en base a un compromiso con el medio ambiente y se puede alcanzar introduciendo peque&ntilde;as acciones en nuestro d&iacute;a a d&iacute;a.</strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">Cada uno de nosotros se alimenta, se mueve y consume bienes y servicios, y muchos lo hacen de forma poco responsable con el medio ambiente. La pregunta es la siguiente: &iquest;Sirve de algo la acci&oacute;n sostenible de unos pocos? La respuesta es s&iacute;, cada gesto cuenta. Los cambios consensuados por un grupo poblacional garantizan la eficiencia de una estrategia de vida sostenible.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">La reputaci&oacute;n de cada uno sirve de refuerzo positivo en los dem&aacute;s. Peque&ntilde;os cambios individuales conseguir&aacute;n un gran impacto global.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Los recursos del planeta se est&aacute;n agotando y urge un modelo respetuoso y saludable que asegure el futuro de nuevas generaciones. Llevar un estilo de vida sostenible es m&aacute;s que el logro de un consumo responsable,<strong> se trata de vivir en base a un compromiso con el medio ambiente y se puede alcanzar introduciendo peque&ntilde;as acciones en nuestro d&iacute;a a d&iacute;a.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Si estamos conectados con la naturaleza comprenderemos que hay muchas cosas que podemos mejorar para salvaguardar el recurso natural. <strong>A veces nos olvidamos de la necesidad de cuidar y mimar m&aacute;s nuestro entorno, de minimizar nuestra huella de carbono y en definitiva de ser m&aacute;s respetuosos.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Alcanzar un estilo de vida sostenible y respetuoso no depende exclusivamente de factores individuales, existen tambi&eacute;n factores colectivos y externos sobre los cu&aacute;les es m&aacute;s dif&iacute;cil actuar, como por ejemplo la legislaci&oacute;n de cada pa&iacute;s o regi&oacute;n, o la situaci&oacute;n econ&oacute;mica del pa&iacute;s, &eacute;stos son factores que pueden limitar o fomentar la adopci&oacute;n de un estilo de vida sostenible.</span></p>\r\n<p><span style=\"font-size: 12pt;\">A&uacute;n as&iacute;, <strong>existe una larga lista de peque&ntilde;as acciones que s&iacute; puedes hacer individualmente.</strong> &Eacute;stas no s&oacute;lo tendr&aacute;n un efecto positivo en nuestro entorno, sino que servir&aacute;n de ejemplo para que muchas m&aacute;s personas comiencen a aplicarlas en su d&iacute;a a d&iacute;a.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Descubre en qu&eacute; punto te encuentras</h2>\r\n<p>Hoy queremos animarte a que averig&uuml;es d&oacute;nde te encuentras en la carrera hacia un modelo de vida sostenible. Una manera adecuada de saberlo, puede ser analizando tu huella ecol&oacute;gica, sea cual sea &eacute;sta, esperamos que cuando finalice esta aventura, se haya visto disminuida.</p>\r\n<p style=\"text-align: justify;\"><strong>Recuerda que la huella ecol&oacute;gica mide la superficie necesaria para producir los recursos consumidos por un ciudadano, as&iacute; como para absorber los residuos que genera.</strong></p>\r\n<p>Se trata de ir incorporando, poco a poco, nuevos h&aacute;bitos que te ayuden a llevar una vida m&aacute;s consecuente y sostenible. Aplica las acciones poco a poco, y ver&aacute;s que a medida que pasa el tiempo y avanza la aventura estar&aacute;s adoptando los nuevos h&aacute;bitos de una manera sencilla y natural.</p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Atr&eacute;vete a realizar este TEST y descubre en qu&eacute; nivel de sostenibilidad se encuentra tu estilo de vida.</span></p>\r\n<p><a class=\"btn btn-primary\" href=\"https://iuk3zut73vv.typeform.com/to/AuSVR0wr\" target=\"_blank\" rel=\"noopener\">TEST</a></p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/bailar%20(1).png\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/1%20(1).jpg\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>Si amas tu vida empieza por amar la del planeta</h2>\r\n<p style=\"text-align: justify;\">Puede que el test te haya hecho reflexionar, puede que incluso sea la primera vez que te planteas ciertas cuestiones. &iquest;Te fijas en el pl&aacute;stico que hay en tu carrito de la compra? &iquest;Te fijas en el origen de tus prendas de vestir? &iquest;Tienes en cuenta si un producto es de temporada a la hora de planificar tu men&uacute; semanal?</p>\r\n<p style=\"text-align: justify;\">Adem&aacute;s hoy hay premio! entre todos los que particip&eacute;is hoy se sortear&aacute; un kit para reducir tu consumo de pl&aacute;stico en tu d&iacute;a a d&iacute;a.&nbsp;</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Se honesto y comparte con tus compa&ntilde;eros qu&eacute; perfil te ha salido en el TEST. &iquest;D&oacute;nde crees que pinchas m&aacute;s? &iquest;En la alimentaci&oacute;n? &iquest;En tu manera de desplazarte? &iquest;En tu consumo?</p>\r\n<p style=\"text-align: justify;\">&iquest;No crees que ha llegado la hora del cambio? Si&eacute;ntete libre de subir una foto con aquella iniciativa o h&aacute;bito que hayas incorporado para mejorar y cuidar de nuestro planeta. &iexcl;Entre todos vamos a crear un Muro lleno de buenos h&aacute;bito! &iexcl;Lo importante no es lo que estamos haciendo si no lo que vamos a hacer a partir de ahora!</p>\r\n</div>\r\n</div>','2022-11-16 10:43:37','2023-12-11 21:45:12'),(24,52,'en','Be grateful','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Being grateful is essential to appreciate life and enjoy it to the full. Being grateful for who we are, what we have achieved, what we have, the people around us, etc. It helps us to live in harmony with our environment and instils a high level of wellbeing.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">When <strong>you express&nbsp;gratitude</strong>, it means you are capable of valuing everything around you, such as nature, people or experiences, however small they may be.</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">People who express gratitude are fully alert to those small everyday details that escape the notice of many other people.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Science has shown that grateful people are happier, more attentive and creative, more comfortable in their own bodies, and follow a healthier lifestyle naturally and with less effort.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Putting gratitude into practice can positively transform the way you think about life, and can make you value what surrounds you more highly.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Having said that, our minds, which are constantly exposed to an avalanche of information, tend to focus on the negative rather than the positive. The reason for this is none other than our own survival instinct, as it helps us to avoid risks, heightens our alertness, and makes us watch out for unexpected things which might pose a danger to us.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">However, if we let these negative thoughts predominate, they can start taking control of our minds and affecting our expectations. The good news is that we can work on directing our own thoughts so they do not control our minds and our wellbeing.</span></p>\r\n</div>\r\n</div>','<div class=\"row\"><!-- Columna Izda inicio-->\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>\"Feeling gratitude and not expressing it is like wrapping a present and not giving it\" William Arthur Ward</h2>\r\n<p style=\"text-align: justify;\">Today our challenge to you is to be more aware and grateful of everything around you.</p>\r\n<p style=\"text-align: justify;\">We can stop the natural negative bias of our minds by redirecting them towards gratification and what can be achieved in positive terms, focusing on what we are grateful for. With this change of outlook, you can almost instantly change the direction of your life. You can revolutionise your world and everything you are able to create within it.</p>\r\n<p style=\"text-align: justify;\"><strong>Being grateful is an exercise that anchors us in the present and makes us appreciate things as they are: right here, right now.</strong></p>\r\n<p style=\"text-align: justify;\">There are many ways of practising gratitude in everyday life. For example, incorporating the habit of giving thanks for something every day when you get up, making it the first thing you do each day. You should also be appreciative of yourself: congratulate yourself every day for something you&rsquo;ve done well. At the end of the day, take stock of all the positive things and everything you should be thankful for in this day that is coming to an end.</p>\r\n<p style=\"text-align: justify;\">Equally important is learning to thank others. We all know people who do good things for us. It&rsquo;s very likely that these people would love to know that you value what they do for you, and will appreciate your letting them know.</p>\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p style=\"text-align: justify;\"><!-- este es el separador de 10px--></p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">So our challenge today is to think about what you&rsquo;re grateful for. Practice being thankful to someone close to you; why not send an email to that colleague to whom you are very grateful for their support or unconditional help?</p>\r\n</div>\r\n<!-- Columna Izda fin--> <!-- Columna Dch inicio-->\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/bailar-2%20(1).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/fotosgifs-calendario-7.png\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n<!-- Columna Izda fin--><!-- este es el separador de 10px-->\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\"><!-- este es el separador de 10px--></div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/29%20(2).png\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>It&rsquo;s not happiness that makes us grateful &ndash; being grateful is what makes us happy</h2>\r\n<p style=\"text-align: justify;\">We&rsquo;re sure that today&rsquo;s reflection has led you to realize how many people there are who you need to thank for something, and it may be that you have not expressed this gratitude to many of them clearly and directly. When you get down to it, you&rsquo;ll quickly discover how rewarding it is to practice gratitude.</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">For this same reason, we want you to practice it in public as well &ndash; share with the rest of your colleagues, on the wall, the names of the people you would like to thank, and why. Upload a photo of you together, if you like.</p>\r\n</div>\r\n</div>','2022-11-16 10:45:04','2022-11-30 08:01:28'),(25,52,'es','Practica el agradecimiento','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p><span style=\"font-size: 12pt;\">Ser agradecido/a es esencial para apreciar y disfrutar plenamente de la vida. Agradecer lo que somos, lo que hemos conseguido, lo que tenemos, las personas que nos rodean, etc., nos hace vivir en armon&iacute;a con nuestro entorno y con un alto grado de bienestar.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Cuando uno/a vive expresando&nbsp;gratitud&nbsp;es capaz de valorar todo lo que tiene a su alrededor, como la naturaleza, las personas o las experiencias, por peque&ntilde;as que sean.</span></p>\r\n<p><span style=\"font-size: 12pt;\"><strong><em>Quienes expresan gratitud&nbsp;</em></strong><strong><em>viven con atenci&oacute;n plena aquellos detalles del d&iacute;</em></strong><strong><em>a a d</em></strong><strong><em>&iacute;a&nbsp;que a muchas otras personas se les escapan.</em></strong></span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p><span style=\"font-size: 12pt;\">La ciencia ha demostrado que las personas agradecidas son m&aacute;s felices, atentas y creativas, tienen un mejor concepto de su propio cuerpo y siguen un&nbsp;estilo de vida m&aacute;s saludable, de forma natural y con un menor esfuerzo.</span></p>\r\n<p class=\"Cuerpo\" style=\"line-height: 115%;\"><span class=\"Ninguno\" style=\"font-size: 12pt;\"><strong><em>Poner en pr&aacute;ctica la gratitud puede transformar en positivo la forma de pensar sobre nuestra vida y hacer que valoremos m&aacute;s lo que nos rodea. </em></strong></span></p>\r\n<p><span style=\"font-size: 12pt;\">Sin embargo, si nos dejamos llevar por pensamientos negativos, &eacute;stos pueden comenzar a dominar nuestra mente, y a afectar a nuestras expectativas. La buena noticia es que podemos trabajar y dirigir nuestros propios pensamientos y que no sean ellos quienes nos dominen a nosotros/as y a nuestro bienestar.</span></p>\r\n</div>\r\n</div>','<div class=\"row\"><!-- Columna Izda inicio-->\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>\"Sentir gratitud y no expresarla es como envolver un regalo y no darlo\" William Arthur Ward</h2>\r\n<p>Hoy queremos retarte a que seas m&aacute;s consciente y agradecido/a de todo lo que tienes a tu alrededor.</p>\r\n<p>Podemos detener la tendencia negativa natural de nuestra mente mediante la reorientaci&oacute;n hacia la abundancia y lo que es positivamente posible, centr&aacute;ndonos en aquello de lo que estamos agradecidos/as. Con este cambio de visi&oacute;n, casi al instante, tu vida puede cambiar su trayectoria. Tu mundo puede revolucionarse y todo lo que puedas crear en &eacute;l.</p>\r\n<p><strong><em>Ser agradecidos/as es un ejercicio que nos ancla al presente, y nos hace apreciar las cosas tal y como son, aqu&iacute; y ahora.</em></strong></p>\r\n<p>Hay muchas formas de practicar la gratitud en el d&iacute;a a d&iacute;a. Por ejemplo: incorporando la costumbre de levantarte cada d&iacute;a dando gracias por algo, &iexcl;que sea lo primero que hagas en el d&iacute;a!; tambi&eacute;n agrad&eacute;cete algo a ti mismo/a, felic&iacute;tate cada d&iacute;a por algo que hayas hecho bien; y, al acabar la jornada, haz un balance de todo lo positivo y de todo lo que tienes que agradecerle a ese d&iacute;a que dejas atr&aacute;s.</p>\r\n<p>Igual de importante es aprender a ser agradecido con los dem&aacute;s. Todos/as tenemos personas que hacen cosas buenas por nosotros/as. Seguramente a esas personas les gustar&iacute;a darse cuenta de que valoras lo que hacen por ti y apreciar&aacute;n que se lo hagas saber.</p>\r\n<p style=\"text-align: justify;\"><!-- este es el separador de 10px--></p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">As&iacute; que hoy te retamos a que hagas esta reflexi&oacute;n. Practica el agradecimiento con alguien de tu entorno cercano. Podr&iacute;as enviar un email a aquel compa&ntilde;ero/a de trabajo al que le est&aacute;s muy agradecido/a por su apoyo o por su ayuda incondicional.</p>\r\n</div>\r\n<!-- Columna Izda fin--> <!-- Columna Dch inicio-->\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/bailar-2%20(1).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/fotosgifs-calendario-7.png\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n<!-- Columna Izda fin--><!-- este es el separador de 10px-->\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\"><!-- este es el separador de 10px--></div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/29%20(2).png\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>No es la felicidad lo que nos hace agradecidos, ser agradecidos es lo que nos hace felices</h2>\r\n<p>Seguro que esta reflexi&oacute;n de hoy te ha llevado a darte cuenta de la cantidad de personas de tu entorno a las que tienes algo que agradecer, y puede que a muchas de ellas no les hayas dado las gracias de una forma clara y directa. A la que te pongas manos a la obra, te dar&aacute;s cuenta r&aacute;pidamente de lo gratificante que resulta practicar el agradecimiento.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Por este mismo motivo queremos que tambi&eacute;n lo practiques en p&uacute;blico, comparte en el muro, con el resto de tus compa&ntilde;eros/as a qu&eacute; colega o colegas del trabajo tienes algo que agradecer y porqu&eacute;. Puedes subir, si la tienes, una foto juntos.</p>\r\n</div>\r\n</div>','2022-11-16 10:45:04','2023-12-07 13:18:20'),(26,53,'en','Never stop learning','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Each awakening is a new learning opportunity. It is said that humans are unconsciously immersed in a constant learning process; we are curious by nature, but sometimes we tend to let laziness pervade our habits and routines.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">However, it&rsquo;s important to never let go of the desire to acquire new knowledge; to ask questions, investigate, read, listen; to continue growing as an individual both personally and professionally.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">There are no excuses for anyone who really wants to learn: you can learn from every opportunity that arises in life, or even learn to create those opportunities.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Each awakening is a new learning opportunity. It is said that humans are unconsciously immersed in a constant learning process; we are curious by nature, but sometimes we tend to let laziness pervade our habits and routines.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Learn to move forward, to evolve. Learn to discard, so you don&rsquo;t go back to where you don&rsquo;t want to be; learn to discover goals, new challenges, new opportunities. Learn to be a better version of yourself every day.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Any excuse is valid for learning something new, and Christmas is definitely a good time to give some thought about what new things you&rsquo;re going to learn in the coming year. Don&rsquo;t you think?</span></p>\r\n</div>\r\n</div>','<div class=\"row\"><!-- Columna Izda inicio-->\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Learning is discovering that something is possible</h2>\r\n<p style=\"text-align: justify;\">There are infinite things that one can continue to learn throughout one\'s life, learning allows us to reinvent ourselves so that we can be ready when we need it most.</p>\r\n<p style=\"text-align: justify;\">When we leave an old year behind, one door closes and another opens; a new cycle begins which is usually full of good resolutions. Learning should most definitely be one of those resolutions. Learning has nothing to do with your age or the stage of life you&rsquo;ve reached.</p>\r\n<p style=\"text-align: justify;\">It is not necessary to propose great learning, but rather small advances that provide me with more security and knowledge in that subject that interests me so much and that also helps me to remain intellectually active.</p>\r\n<p style=\"text-align: justify;\">It&rsquo;s clear that knowledge has no boundaries, and you never know when something new you&rsquo;ve learned may come in useful, however unlikely that may seem. Even knowing more facts and anecdotes about Christmas can help to liven up Christmas lunches and dinners &ndash; you could even come up with your own Christmas Quiz!</p>\r\n<p style=\"text-align: justify;\">Today we want to challenge you to think about what new things you plan to learn in the coming year.</p>\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p style=\"text-align: justify;\"><!-- este es el separador de 10px--></p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">We also encourage you to take this fun questionnaire about Christmas traditions around the world. Do you know about any other customs apart from the ones followed here or in your native country?</p>\r\n</div>\r\n<!-- Columna Izda fin--> <!-- Columna Dch inicio-->\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/28.png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/29%20(1).png\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n<!-- Columna Izda fin--><!-- este es el separador de 10px-->\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\"><!-- este es el separador de 10px--></div>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"HOW MUCH DO YOU KNOW ABOUT CHRISTMAS?\" src=\"https://view.genial.ly/63873b3e4dc5c1001233f1bd\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/37.png\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>Knowledge has no boundaries</h2>\r\n<p style=\"text-align: justify;\">Sometimes we get so bogged down in routine we forget the importance of lifelong learning. &ldquo;I haven&rsquo;t got time&rdquo;, &ldquo;I&rsquo;m too busy&rdquo;, &ldquo;I&rsquo;ll try to do it next month&rdquo; &hellip; Sound familiar? And the years march on by&hellip;</p>\r\n<p style=\"text-align: justify;\">It&rsquo;s a question of focus; you need to prioritize what is truly worthwhile to your life. Prioritizing learning should be essential because it means you are committed to being a better version of yourself than you were yesterday, and that you aspire to add more value, whether this is to make a bigger impact in your business or your work, or simply for those around you.</p>\r\n<p style=\"text-align: justify;\">Define a plan to suit your needs, as everyone is different and learns differently. Turn any situation into a learning opportunity.</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we challenge you to share your learning ambitions for 2022 with your colleagues. Do you want to learn a new language? Do you want to start a new hobby? Do you want to broaden your knowledge of a specific subject? If you like, you can also upload an image to make the learning target you have set yourself for next year more visual and tangible.</p>\r\n<p style=\"text-align: justify;\">We&rsquo;re sure you will achieve whatever you set yourself, and don&rsquo;t forget that the act of sharing brings the goal you&rsquo;re pursuing a little bit closer.</p>\r\n</div>\r\n</div>','2022-11-16 10:56:10','2022-12-12 12:10:25'),(27,53,'es','Nunca dejes de aprender','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Cada despertar es un nuevo aprendizaje, se dice que los humanos inconscientemente estamos sumergidos en un aprendizaje constante, somos curiosos por naturaleza, pero a veces tendemos a dejar que la pereza invada nuestras costumbres y h&aacute;bitos.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Sin embargo, es importante que nunca dejemos de tener ganas de adquirir nuevos conocimientos, preguntar, investigar, leer, escuchar; para seguir creciendo como persona tanto en el &aacute;mbito personal, como en el profesional.</span></p>\r\n<p><span style=\"font-size: 12pt;\"><strong>Qui</strong><strong>en quiere aprender no encuentra excusas, aprende de cada oportunidad que se le plantea en la vida, o incluso aprende a crear esas oportunidades.</strong></span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p><span style=\"font-size: 12pt;\">Aprender para avanzar, evolucionar. Aprender para descartar, para no volver donde no quieres estar,&nbsp;aprender para descubrir nuevas metas, desaf&iacute;os y oportunidades. Aprender para cada dd&iacute;a ser una mejor versi&oacute;n de ti.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Cualquier excusa es buena para aprender algo nuevo, y la Navidad es sin duda un buen momento para reflexionar sobre qu&eacute; nuevos aprendizajes vas a incorporar en el a&ntilde;o que est&aacute; por llegar. &iquest;No crees?</span></p>\r\n</div>\r\n</div>','<div class=\"row\"><!-- Columna Izda inicio-->\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Aprender es descubrir que algo es posible</h2>\r\n<p>Hay infinitas cosas que uno puede seguir aprendiendo a lo largo de toda su vida, el aprendizaje nos permite reinventarnos para poder estar listos en el momento en el que m&aacute;s lo necesitemos.</p>\r\n<p>Cuando dejamos atr&aacute;s un a&ntilde;o, se cierra una puerta y se abre otra, empieza un nuevo ciclo, habitualmente &eacute;ste se llena de nuevos buenos prop&oacute;sitos. El aprendizaje, sin duda, deber&iacute;a ser uno esos buenos prop&oacute;sitos. Aprender sin importar la edad ni el momento vital en el que nos encontremos.</p>\r\n<p>No hace falta proponernos grandes aprendizajes sino peque&ntilde;os avances que nos aporten m&aacute;s seguridad y conocimiento en ese tema que tanto nos interesa y que adem&aacute;s nos ayude a mantenernos activos intelectualmente.</p>\r\n<p>Est&aacute; claro que el saber no ocupa lugar, adem&aacute;s nunca sabes en qu&eacute; momento podr&aacute; resultarte &uacute;til ese nuevo aprendizaje por absurdo que parezca. Incluso saber m&aacute;s cosas y curiosidades sobre la Navidad nos podr&aacute; servir para amenizar las comidas y cenas Navide&ntilde;as, &iexcl;hasta podr&iacute;as llegar a plantear tu propio concurso Navide&ntilde;o!</p>\r\n<p>As&iacute; que hoy, queremos retarte a que hagas esa reflexi&oacute;n acerca de los nuevos aprendizajes que piensas abordar en el a&ntilde;o que est&aacute; por llegar.</p>\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p style=\"text-align: justify;\"><!-- este es el separador de 10px--></p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Adem&aacute;s te animamos a que hagas este divertido cuestionario sobre las tradiciones navide&ntilde;as en el mundo. &iquest;Conoces otras costumbres m&aacute;s all&aacute; de las que se celebran aqu&iacute; o en tu lugar de origen? &iexcl;cada d&iacute;a podemos aprender algo nuevo!</p>\r\n</div>\r\n<!-- Columna Izda fin--> <!-- Columna Dch inicio-->\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/28.png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/29%20(1).png\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n<!-- Columna Izda fin--><!-- este es el separador de 10px-->\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\"><!-- este es el separador de 10px--></div>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"&iquest;CU&Aacute;NTO SABES DE LA NAVIDAD?\" src=\"https://view.genial.ly/6383acf219670a00199059c4\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/37.png\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>El saber no ocupa lugar</h2>\r\n<p>A veces, nos sumergimos en la rutina y nos olvidamos de la importancia de seguir aprendiendo a lo largo de toda nuestra vida. &ldquo;No tengo tiempo&rdquo;, &ldquo;Estoy muy ocupado&rdquo;, &ldquo;Lo intento el mes que viene&rdquo; &hellip; &iquest;Te suena? Y as&iacute; se nos pasan los a&ntilde;os.</p>\r\n<p>Pero si quieres ir hacia adelante, m&aacute;rcate un prop&oacute;sito y/o varios prop&oacute;sitos personales y profesionales, y planifica de qu&eacute; manera vas a conseguirlos. Lo tenemos muy f&aacute;cil con la plataforma Leonardo. Es cuesti&oacute;n de reservarse unos momentos para hacer los cursos que m&aacute;s necesites para tu d&iacute;a a d&iacute;a.</p>\r\n<p style=\"text-align: justify;\">Es una cuesti&oacute;n de enfoque, donde necesitas priorizar lo que verdaderamente vale la pena para tu vida. Priorizar el aprendizaje debe ser algo imprescindible porque significa que est&aacute;s comprometido contigo mismo a ser una mejor versi&oacute;n de ti de la que eras ayer y que quieres a&ntilde;adir m&aacute;s valor, ya sea para generar un mayor impacto en tu negocio, trabajo o simplemente en quienes est&aacute;n a tu alrededor.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">&iexcl;Hoy te desafiamos a que compartas con tus compa&ntilde;eros sobre qu&eacute; quieres enfocar tu aprendizaje en el 2023. &iquest;Quieres aprender un nuevo idioma? &iquest;Comenzar con una nueva afici&oacute;n? &iquest;Ampliar tus conocimientos sobre una materia en concreto? Si quieres tambi&eacute;n puedes subir una imagen que haga m&aacute;s visual y real el aprendizaje que te has marcado para el siguiente a&ntilde;o.</p>\r\n<p style=\"text-align: justify;\">Estamos seguros de que conseguir&aacute;s lo que te propongas, no olvides que el hecho de compartirlo te acerca un poco m&aacute;s al objetivo que te has marcado.</p>\r\n</div>\r\n</div>','2022-11-16 10:56:10','2023-12-08 08:23:32'),(28,54,'en','Make food your best medicine','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">According to Hippocrates &ndash; who many consider to be the father of medicine &ndash; the main preventive weapon against disease is a healthy diet. We&rsquo;ve all heard about the importance of following a healthy, balanced diet, but do we really know what that consists of?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Most people have no idea what they&rsquo;re eating or what nutrients are in their food. IN addition, many people don&rsquo;t know enough about their daily dietary needs, and this lack of information is often the main cause of an unbalanced diet, which frequently ends up triggering food-related disorders or health problems.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">A healthy, balanced diet should be a habit, not something we adopt temporarily to achieve a short-term goal.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">According to Hippocrates &ndash; who many consider to be the father of medicine &ndash; the main preventive weapon against disease is a healthy diet. We&rsquo;ve all heard about the importance of following a healthy, balanced diet, but do we really know what that consists of?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">When talking about a balanced diet, you should bear in mind that each individual is unique and therefore has to find a diet that meets their personal needs.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>It is worth pointing out that you need to eat a bit of everything but in moderation. The problem is often not the food itself but how frequently you eat that food; for example, chocolate and cream are fine in themselves, but only if eaten in moderation.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Some foods should be eaten every day, while others should only be eaten occasionally, and this is perfectly represented in the nutritional pyramid.</span></p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">A healthy diet consists of eating a variety of foodstuffs that provide the nutrients you need to keep healthy, make you feel good, and give you enough energy. These nutrients include proteins, carbohydrates, fats, water, vitamins and minerals.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Generally speaking, you don&rsquo;t need to make massive changes or take drastic measures to eat better. You can eat very healthily every day without following a strict, restrictive diet, just by changing a few of your habits.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">A good way of embarking on a healthy daily regime right now is applying these ten simple tips:</span></p>\r\n</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/fotos-1080-x-810-13.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Plan your meals.</strong> Advance planning by days or weeks is the best way of achieving a balanced diet. When you don&rsquo;t plan ahead, it&rsquo;s very easy to get carried away and eat the first thing you come across at home or buy pre-prepared food. With clear planning it&rsquo;s much easier to portion out your weekly food requirements and keep to the right daily regime.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Cook! </strong>Cooking is fundamental for a healthy diet because it means you control the cooking process and can use fresh ingredients. You should prioritize techniques such as saut&eacute;ing, steam cooking, oven baking and grilling, and leave fried foods for special occasions.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Lots of fruit and vegetables. </strong>Something that should never be lacking in your diet are at least five portions of fruit and vegetables per day (3 and 2 respectively). Vegetables should be served generously at mealtimes every day. With fruit, it&rsquo;s best to eat them whole with the skins on to absorb all their nutrients and fibre. At lunch and dinner, vegetables should make up half your plate.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Add more plant protein. </strong>Plant foods such as tubers, legumes, grains and nuts are especially rich in plant proteins. By combining the intake of legumes with grains, or grains with nuts, during the day, you get high quality protein. You should eat a minimum of three portions of legumes every week.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Eat wholegrains. </strong>A balanced daily diet should include grains, which are one of our main sources of carbohydrates. Carbohydrates provide most of the energy we need, and should account for between 50 and 60 percent of our daily calories. Within the grains category, wholegrains offer many more benefits than refined grains, as they retain all the bran fibre and are also richer in vitamins and minerals.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Fish, eggs and white meat. </strong>Foods derived from animals are our main source of protein and vitamin B12. We recommend you choose fish and eggs over meat, especially red meat. Three or four portions of fish per week (both oily and white) and 3-4 eggs per week are a good yardstick. When it comes to meat, it is better to eat white meat such as chicken, turkey and rabbit, with minimal fat.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Drink water! </strong>Neither sugary beverages nor alcohol offer any useful nutrients for our health. There is nothing better than water to hydrate the body. You should drink between 2 and 2.5 litres per day in the form of plain water, herbal teas, vegetable soups, broths, fruit juices, etc.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Limit foods with lots of fat, salt or sugar. </strong>Excessive consumption of saturated fats, sugar and/or salt can have a negative impact on your health. The best way of limiting these ingredients is by reading nutritional labels on food, which give the quantities of simple sugars, saturated fats, and salt.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Use olive oil and spices. </strong>Olive oil is a great source of health. It has numerous benefits, including regulating LDL cholesterol levels in the blood. This is why we recommend using virgin olive oil for both cooking and dressings. In addition, a technique to avoid using salt in excess is to add herbs and spices to your dishes to add flavour without raising sodium levels.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Variety is really important. </strong>A healthy, balanced daily diet is, above all, varied. The bigger the variety of foods, colours, flavours and textures in your dishes, the more nutritionally complete your diet will be. In addition, a varied diet is less monotonous and more enjoyable.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Eating well to feel good is hardly a complex or difficult goal. These ten tips make it much easier to start eating better, don&rsquo;t you think?</span></p>\r\n</div>\r\n<p class=\"txtdestacadow\"><span style=\"font-size: 12pt;\">Today we encourage you to reflect on these points. Which of them do you think you could improve? Also, play this fun game and create your own healthy dish.</span></p>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"LET YOUR FOOD BE YOUR BEST MEDICINE EN\" src=\"https://view.genial.ly/639051211cd57700144e245a\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">We&rsquo;ve already seen that a healthy, balanced diet should contain all the nutrients we need, in sufficient quantity and quality, to meet our body&rsquo;s requirements and maintain its equilibrium, depending on our age and circumstances.</p>\r\n<p style=\"text-align: justify;\">Meanwhile, the other fundamental rule when it comes to healthy eating is patience and organisation. If you rush and fail to plan properly, you&rsquo;ll end up resorting to any food at hand or eating pre-prepared or takeout food.</p>\r\n<p style=\"text-align: justify;\">It&rsquo;s not about making radical changes, or spending hours and hours in the kitchen or studying food labels in supermarkets. It&rsquo;s about spending 20 minutes a day planning an essential part of your life &ndash; food &ndash; upon which the foundations of good health are based.</p>\r\n<p style=\"text-align: justify;\">And today there is a prize! Among all those who participate in today\'s challenge, two lots of Robin Good products will be raffled. Products that generate job opportunities for people at risk of exclusion through the production of artisan, local and sustainable food.</p>\r\n<p style=\"text-align: justify;\">Will you be the winner?</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we would like you to share a recipe or the details of your favourite healthy dish. Let&rsquo;s see if between us all we can create a cookbook full of delicious, healthy ideas!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-6.png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<div style=\"clear: both; margin: 10px;\"><img src=\"../../../../storage/files/uploads/fotosgifs-calendario-12.png\" alt=\"\" width=\"420\" height=\"420\" /></div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-16 19:53:24','2022-12-12 11:23:58'),(29,54,'es','Que tu comida sea tu mejor medicina','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Como ya dijo Hip&oacute;crates, para muchos el padre de la medicina, la principal arma preventiva contra las enfermedades es llevar una buena alimentaci&oacute;n. Todos hemos o&iacute;do alguna vez la importancia de seguir una dieta sana y equilibrada, pero &iquest;sabemos realmente en qu&eacute; consiste?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">La mayor&iacute;a de las personas desconocen lo que comen y los nutrientes que llevan los alimentos que ingieren, son muchas tambi&eacute;n las personas que no tienen el conocimiento sobre c&oacute;mo deber&iacute;a ser su alimentaci&oacute;n diaria , es por esto que a menudo, esta desinformaci&oacute;n es la principal causa de una dieta desequilibrada, que frecuentemente acaba desencadenando en molestias o problemas de salud.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Una dieta sana y equilibrada se debe adquirir como h&aacute;bito, no como algo temporal para la consecuci&oacute;n de un objetivo a corto plazo.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Como ya dijo Hip&oacute;crates, para muchos el padre de la medicina, la principal arma preventiva contra las enfermedades es llevar una buena alimentaci&oacute;n. Todos hemos o&iacute;do alguna vez la importancia de seguir una dieta sana y equilibrada, pero &iquest;sabemos realmente en qu&eacute; consiste?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Cuando se habla de una dieta equilibrada hay que tener en cuenta que cada individuo es &uacute;nico, y por lo tanto, tiene que encontrar una dieta que se ajuste a sus necesidades personales.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Lo que s&iacute; es conveniente es indicar que hay que comer de todo pero en su justa medida, el problema muchas veces no se encuentra en el alimento en s&iacute;, sino en la frecuencia de consumo de este alimento, por ejemplo el chocolate o la nata son alimentos buenos pero su consumo debe ser moderado.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Hay alimentos que deben ser consumidos a diario y otros que solo es bueno llev&aacute;rnoslos a la boca de vez en cuando, esto se refleja perfectamente en la pir&aacute;mide nutricional.</span></p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Una alimentaci&oacute;n saludable consiste en ingerir una variedad de alimentos que te brinden los nutrientes que necesitas para mantenerte sano, sentirte bien y tener energ&iacute;a. Estos nutrientes incluyen las prote&iacute;nas, los carbohidratos, las grasas, el agua, las vitaminas y los minerales.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">En general, no hace falta una gran revoluci&oacute;n ni medidas dr&aacute;sticas para comer mejor. Podemos alimentarnos de forma saludable a&nbsp;diario,&nbsp;sin una&nbsp;dieta&nbsp;estricta y restrictiva, solo cambiando algunos h&aacute;bitos.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Una buena forma de empezar hoy mismo una&nbsp;dieta saludable diaria&nbsp;es aplicando estos 10 sencillos consejos:</span></p>\r\n</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/fotos-1080-x-810-13.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Planifica las comidas. </strong>La planificaci&oacute;n previa de la&nbsp;dieta por d&iacute;as&nbsp;o por semanas es la mejor manera de comer equilibrado. Cuando no tenemos nada pensado, es muy f&aacute;cil dejarse llevar y comer lo primero que encontramos en casa o comprar comida preparada. Con un men&uacute; claro es m&aacute;s f&aacute;cil distribuir las raciones semanales necesarias de cada alimento y lleva runa&nbsp;dieta diaria&nbsp;adecuada.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Cocinar. </strong>Cocinar es b&aacute;sico para una alimentaci&oacute;n saludable, porque controlamos el proceso de cocci&oacute;n y usamos ingredientes frescos. Debemos priorizar t&eacute;cnicas como salteados, cocciones al vapor, al horno y a la plancha y dejar las frituras para ocasiones especiales.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Mucha fruta y verdura. </strong>Lo que nunca puede faltar en la&nbsp;dieta para un d&iacute;a&nbsp;son 5 piezas de fruta y verdura (3 frutas y 2 raciones de verdura) como m&iacute;nimo. Los vegetales deben estar presentes en la mesa de forma generosa a diario. Las frutas es mejor comerlas enteras y con piel para aprovechar todos los nutrientes y fibra que ofrecen. En la comida y la cena, la verdura debe representar la mitad del plato.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Incorpora m&aacute;s prote&iacute;na vegetal. </strong>Alimentos vegetales como tub&eacute;rculos, legumbres, cereales y frutos secos, son especialmente ricos en prote&iacute;nas vegetales. Combinando durante el d&iacute;a la ingesta de legumbres con cereales o cereales con frutos secos, por ejemplo, se obtiene una prote&iacute;na de calidad. Es recomendable comer 3 raciones de legumbres a la semana, como m&iacute;nimo.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Consumir cereales integrales. </strong>Una&nbsp;dieta diaria&nbsp;balanceada&nbsp;debe incluir cereales, que son una de las principales fuentes de hidratos de carbono. Los hidratos de carbono proporcionan la mayor parte de la energ&iacute;a necesaria y deben representar entre el 50% y el 60% de las calor&iacute;as ingeridas. Dentro de los cereales, las versiones integrales ofrecen muchos m&aacute;s beneficios que los cereales refinados ya que tienen toda la fibra del salvado y adem&aacute;s son m&aacute;s ricos en vitaminas y minerales.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Pescados, huevos y carne blanca. </strong>Los alimentos de origen animal son la principal fuente de prote&iacute;nas y de vitamina B12. Se recomienda priorizar el pescado y los huevos por encima de la carne, especialmente de la roja. 3 o 4 raciones de pescado (azul y blanco) y entre 3 y 4 huevos a la semana son una buena proporci&oacute;n. En cuanto a la carne, es preferible consumir carne blanca, como pollo, pavo o conejo, sin grasa.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Beber agua. </strong>Ni las bebidas azucaradas ni el alcohol aportan nutrientes interesantes para nuestra salud. No hay nada mejor que el agua para hidratarnos. Deber&iacute;amos beber alrededor de 2 o 2 litros y medio de l&iacute;quido al d&iacute;a en forma de agua, infusiones, cremas de verduras, caldos, frutas...</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Limitar los alimentos con mucha grasa, sal o az&uacute;car. </strong>El consumo excesivo de grasas saturadas, az&uacute;car y/o sal puede tener efectos negativos para la salud. La mejor forma de limitar estos ingredientes es fijarnos en las etiquetas nutricionales que indican la cantidad de az&uacute;cares simples, grasas saturadas y sal.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Usar aceite de oliva y especias. </strong>El aceite de oliva es fuente de salud. Tiene m&uacute;ltiples beneficios, entre ellos que ayuda a regular los niveles de colesterol LDL en la sangre. Por eso, es recomendable usar el aceite de oliva virgen tanto para cocinar como para ali&ntilde;ar. Adem&aacute;s, una t&eacute;cnica para usar sal con moderaci&oacute;n es a&ntilde;adir a nuestros platos hierbas arom&aacute;ticas y especias que aportan sabor sin subir el nivel de sodio en la comida.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>La variedad s&iacute; que importa. </strong>Una&nbsp;dieta para cada d&iacute;a&nbsp;equilibrada y saludable es, por encima de todo, variada. Cuanta m&aacute;s variedad de alimentos, colores, sabores y texturas en nuestros platos, m&aacute;s completa nutricionalmente ser&aacute; nuestra alimentaci&oacute;n. Adem&aacute;s, una dieta variada es menos mon&oacute;tona y m&aacute;s placentera.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Comer bien para sentirse bien no es un objetivo complejo ni dif&iacute;cil. Con estos 10 consejos podemos empezar a alimentarnos mejor de forma sencilla, &iquest;Qu&eacute; opinas?</span></p>\r\n</div>\r\n<p class=\"txtdestacadow\"><span style=\"font-size: 12pt;\"> Hoy te animamos a que reflexiones sobre estos puntos &iquest;Cu&aacute;l de ellos crees que podr&iacute;as mejorar? Adem&aacute;s juega a este divertido puzzle.</span></p>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"QUE TU COMIDA SEA TU MEJOR MEDICINA\" src=\"https://view.genial.ly/6387968fb4e50f001a53b825\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">Ya hemos visto que una alimentaci&oacute;n sana y equilibrada, debe contener todos los nutrientes en cantidad y calidad suficientes para cubrir las exigencias y mantener el equilibrio del organismo, de acuerdo a nuestra edad y circunstancia vital.</p>\r\n<p style=\"text-align: justify;\">Por otro lado, la otra regla fundamental a la hora de llevar una nutrici&oacute;n saludable es la paciencia y la organizaci&oacute;n. Las prisas y la ausencia de planificaci&oacute;n har&aacute;n que recurramos a comer cualquier cosa o a los platos precocinados.</p>\r\n<p style=\"text-align: justify;\">No se trata de hacer un cambio radical, ni de pasar 8 horas encerrado en la cocina o en el supermercado analizando alimentos. Se trata de gastar 20 minutos todos los d&iacute;as en planificar una parte esencial de nuestra vida, que es la alimentaci&oacute;n y sobre la que se erigen los cimientos de nuestra salud.</p>\r\n<p style=\"text-align: justify;\">&iexcl;Adem&aacute;s hoy hay premio! Entre todos los que participen en el reto de hoy se sortear&aacute;n 4 licuadoras para que los ganadores puedan realizar introducir diferentes tipos de zumos saludable en su dieta.&nbsp;</p>\r\n<p style=\"text-align: justify;\">&iquest;Ser&aacute;s t&uacute; el ganador/a?</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy queremos animarte a que compartas tu receta o tu plato saludable preferido. &iexcl;A ver si entre todos creamos un recetario lleno de ideas sabrosas y saludables!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-6.png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<div style=\"clear: both; margin: 10px;\"><img src=\"../../../../storage/files/uploads/licuadora.jpg\" alt=\"\" width=\"420\" height=\"420\" /></div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-16 19:53:24','2023-12-21 21:42:54'),(30,54,'fr','','','','','','2022-11-16 19:53:24','2022-11-16 19:53:24'),(32,55,'en','Switch off for better connection','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">&rdquo;It&rsquo;s the most wonderful time of the year\", goes the popular refrain, but the fact is that Christmas is also a time when our stress levels go through the roof.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">For many people,<strong> Christmas can be a major source of stress, pressure and conflict. </strong>Some people can feel overwhelmed by all the excesses and expectations of the festive period, which can lead to feeling dejected and burdened.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">We are aware that Christmas involves a whole series of preparations, but what if we change the chip and focus on the positive aspects of everything that is to come?</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">It all depends on the power of the mind: the way we deal with the changes and situations we&rsquo;re presented with, and the way we plan and manage our time.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">For many people,&nbsp;<strong>Christmas can be a major source of stress, pressure and conflict.</strong>&nbsp;Some people can feel overwhelmed by all the excesses and expectations of the festive period, which can lead to feeling dejected and burdened.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The preparation of multiple Christmas meals, company dinners, dates with friends and family, decorating the house, visitors (both expected and unexpected), and buying and sending gifts during the festive season can make you feel as if you&rsquo;re trying to meet a work deadline with exaggerated levels of pressure.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">We need to stop, take a breather, and remember that Christmas is also a time for enjoying. Don&rsquo;t you think?</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">To help you slow down and learn to enjoy this time, we&rsquo;d like to offer some tips that we&rsquo;re sure will help to lower your stress levels.</p>\r\n<p style=\"text-align: justify;\">You&rsquo;ve almost certainly heard of the great benefits of meditation. That&rsquo;s right, the&nbsp;benefits of daily meditation&nbsp;are numerous and impressive. With regular meditation, you can begin a process of personal growth that will elevate your life, benefiting you in body, mind and spirit. You only need 20 minutes to reset your mind. The early morning is the perfect time to start the day full of energy and optimism. The important thing is to set a routine and not to feel overwhelmed by it.</p>\r\n<p style=\"text-align: justify;\">Here are five meditation options:</p>\r\n<p style=\"text-align: justify;\"><strong>Fixed point meditation: </strong>This entails focusing all your attention on one point, whether real or imaginary. After getting into a comfortable position, the mind should focus solely on that object: a candle, a picture, a photo or even a part of your body. As well as relaxing your body and mind, this practice also reduces anxiety and develops concentration.</p>\r\n<p style=\"text-align: justify;\"><strong> Meditating with mantras: </strong>Mantras&nbsp;are words or phrases that are systematically repeated as a tool to focus the mind. This meditation technique is very using for inducing internalization and achieving a higher level of concentration. Continuously reciting a mantra helps you concentrate and stops the mind from wandering. This practice helps to silence the endless chattering that floods a busy brain. Pacing your breathing to the intonation of mantras generates a heightened sense of peace and wellbeing.</p>\r\n<p style=\"text-align: justify;\"><strong>Active meditation:</strong> For the most agitated people, active meditation lets you combine stillness and silence with physical exercise to release tension through movement. Moving, dancing and shaking the body form the first phase of this meditation, which facilitates physical relaxation and helps to foster a feeling of fun and enjoyment.</p>\r\n<p style=\"text-align: justify;\"><strong>Breathing meditation:</strong> The person focuses on the journey made by the breath, from entering the nose and moving through the body. This is a great tool for releasing tension and reducing stress. In a calmer and more relaxed setting it is easier to fall asleep and combat insomnia.</p>\r\n<p style=\"text-align: justify;\"><strong>Guided meditation: </strong>This is a method of relaxation and internalization led by a mediator. The voice of the mediator is responsible for steering the session and guiding the mind to focus on the present moment.</p>\r\n<p style=\"text-align: justify;\">What do you think? Which one appeals to you? Do you fancy the idea of including meditation in your daily routine? It will not only help to lower your Christmas stress levels, but also to lead a fuller and healthier life.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we want to encourage you to think about how you can incorporate meditation or mindfulness in your daily routine. To get familiar with the technique, you can start with this visualisation, or guided imagination, meditation.</p>\r\n<iframe style=\"border-radius: 12px;\" src=\"https://open.spotify.com/embed/playlist/1xuJ6bhS8axXJev5ZRl8GL?utm_source=generator\" width=\"100%\" height=\"80\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\" loading=\"lazy\"></iframe></div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/2%20(9).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/1%20(3).png\" alt=\"\" width=\"420\" height=\"520\" /></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Visualize and keep control of your mind</h2>\r\n<p style=\"text-align: justify;\">Visualisation is a very useful tool for gaining greater control over your mind, body and emotions, as well as to help you instil the changes you want to make to your behaviour.</p>\r\n<p style=\"text-align: justify;\">It can be used to relieve muscle tension, as a concentration technique to control and minimise pain, to enhance the success of many cognitive techniques, to improve memory, to develop self-confidence, and to instil a positive attitude, among many other benefits.</p>\r\n<p style=\"text-align: justify;\">It entails nothing more than learning to relax and vividly imagine different things or situations as realistically as possible, including all the details you can possibly think of, while exerting control over your emotions, feelings and attitudes.</p>\r\n<p style=\"text-align: justify;\">And today there are prizes. Among all of you who participate in today\'s challenge we will raffle a fantastic pack of 4 relaxing candles, ideal to start practicing relaxation!</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">What do you think? Do you think you might be able to practise it on a regular basis? Today we encourage you to share the places where you feel calmer and more connected with yourself. Is it somewhere in your home, or outside, or in a natural setting? Tell us all about it!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/premio-velas-en.jpg\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-17 07:42:55','2022-12-05 19:35:36'),(33,55,'es','Aprende a desconectar','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">&ldquo;Es la &eacute;poca m&aacute;s maravillosa del a&ntilde;o\", solemos decir, pero las Navidades &nbsp;tambi&eacute;n representan un momento en que los niveles de estr&eacute;s se ponen por las nubes.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Para muchos de nosotros,<strong>&nbsp;la Navidad puede ser una fuente importante de estr&eacute;s, presi&oacute;n y conflicto.&nbsp;</strong>Algunas personas pueden sentirse abrumadas por los excesos y las expectativas que suponen estas fiestas, lo que causa a veces momentos de des&aacute;nimo y de agobio.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Somos conscientes de que las Navidades llevan impl&iacute;citos toda una serie de preparativos, pero &iquest;Y si cambiamos el chip y nos focalizamos en positivizar todo lo que est&aacute; por llegar?</span></p>\r\n<p class=\"txtdestacadow\"><span style=\"font-size: 12pt;\">Todo est&aacute; en nuestra mente, en nuestra manera de afrontar los cambios y las situaciones que se nos presentan as&iacute; como en la forma de planificar y gestionar nuestro tiempo.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">La preparaci&oacute;n de todos los acontecimientos y \"deberes\" navide&ntilde;os puede hacernos sentir que tenemos que cumplir con una fecha l&iacute;mite de entrega de trabajos con un nivel de presi&oacute;n exacerbado.&nbsp; Si a esto le sumamos que a finales de a&ntilde;o tambi&eacute;n suele ser momento de una mayor carga de trabajo, estamos en la situaci&oacute;n perfecta para que se desencadene un pico de estr&eacute;s.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Conviene parar, respirar y pensar que las Navidades son tambi&eacute;n un momento para disfrutar. </strong>&iquest;No crees?</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">Para ayudarte a bajar revoluciones y conseguir aprender a disfrutar de estos d&iacute;as te damos algunas claves que estamos seguros te ayudar&aacute;n a bajar el nivel de estr&eacute;s.</p>\r\n<p style=\"text-align: justify;\">Seguramente a estas alturas ya hayas o&iacute;do hablar de los grandes beneficios de practicar la meditaci&oacute;n. Los beneficios de la meditaci&oacute;n diaria son numerosos e impresionantes. Al practicar la meditaci&oacute;n con regularidad inicias un proceso de crecimiento personal que eleva tu vida, benefici&aacute;ndote en cuerpo, mente y esp&iacute;ritu.</p>\r\n<p style=\"text-align: justify;\">S&oacute;lo necesitas menos de 20 minutos para resetear tu mente. Las primeras horas de la ma&ntilde;ana son perfectas para comenzar el d&iacute;a lleno de energ&iacute;a y optimismo. Lo importante ser&aacute; que fijes una rutina y empezar poco a poco.</p>\r\n<p style=\"text-align: justify;\">Aqu&iacute; tienes tienes 5 tips.</p>\r\n<p style=\"text-align: justify;\"><strong>Atenci&oacute;n plena en un punto:</strong> consiste en concentrar toda la atenci&oacute;n en un &uacute;nico punto, pudiendo ser este real o imaginario. Tras adquirir una postura c&oacute;moda, la mente tiene que estar &uacute;nicamente focalizada en ese objeto: una vela, un cuadro, una fotograf&iacute;a o incluso una parte del propio cuerpo. Las distracciones de la mente, habituales en los principiantes, han de ser evadidas para volver a situar toda la atenci&oacute;n en el objeto o punto. Esta pr&aacute;ctica, adem&aacute;s de relajar mente y cuerpo, reduce la ansiedad y facilita la concentraci&oacute;n.</p>\r\n<p style=\"text-align: justify;\"><strong>Meditaci&oacute;n con mantras:</strong> los mantras son palabras o frases que se repiten de manera sistem&aacute;tica como herramienta para enfocar la mente. Esta t&eacute;cnica de meditaci&oacute;n es muy &uacute;til para inducir la interiorizaci&oacute;n y lograr un mayor estado de concentraci&oacute;n. Recitar continuamente un mantra ayuda a la concentraci&oacute;n y evita que el cerebro divague. Esta pr&aacute;ctica ayuda a silenciar los pensamientos que inundan un cerebro ajetreado.&nbsp;</p>\r\n<p style=\"text-align: justify;\"><strong>Meditaci&oacute;n activa:</strong> para las personas m&aacute;s nerviosas, la meditaci&oacute;n activa permite combinar la quietud y el silencio con ejercicios f&iacute;sicos para liberar tensiones a trav&eacute;s del movimiento. Agitarse, bailar y sacudirse constituye la primera fase de la meditaci&oacute;n, donde se contribuye a la relajaci&oacute;n f&iacute;sica y a fomentar el sentido de la diversi&oacute;n y el placer.</p>\r\n<p style=\"text-align: justify;\"><strong>Meditaci&oacute;n de la respiraci&oacute;n:</strong> La persona se concentra en el recorrido que realiza el aire, desde la nariz y a trav&eacute;s de su organismo. Es una herramienta para liberar tensiones y reducir estr&eacute;s. En un ambiente m&aacute;s relajado y calmado, ser&aacute; a su vez mas f&aacute;cil conciliar el sue&ntilde;o y combatir los problemas de insomnio.</p>\r\n<p style=\"text-align: justify;\"><strong>Meditaci&oacute;n guiada:</strong> se trata de un m&eacute;todo de relajaci&oacute;n e interiorizaci&oacute;n en el que las riendas las lleva un mediador. La voz de los mediadores ser&aacute; la encargada de conducir la sesi&oacute;n y orientarla a centrar la mente en el momento presente.</p>\r\n<p style=\"text-align: justify;\">&iquest;Qu&eacute; te ha parecido? &iquest;Con cu&aacute;l te quedas? &iquest;Te animas a incluir la meditaci&oacute;n en tu rutina diaria? No s&oacute;lo te ayudar&aacute; a bajar los niveles de estr&eacute;s navide&ntilde;os, sino tambi&eacute;n a vivir una vida m&aacute;s plena y saludable.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy queremos animarte a que reflexiones acerca de c&oacute;mo podr&iacute;as incorporar la meditaci&oacute;n o el mindfulness en tu rutina diaria, y para que entres en contacto con esta t&eacute;cnica, puedes empezar con esta meditaci&oacute;n de visualizaci&oacute;n o meditaci&oacute;n guiada.</p>\r\n<div style=\"width: 100%;\"><iframe style=\"border-radius: 12px;\" src=\"https://open.spotify.com/embed/playlist/1xuJ6bhS8axXJev5ZRl8GL?utm_source=generator\" width=\"100%\" height=\"80\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\" loading=\"lazy\"></iframe></div>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/2%20(9).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/1%20(3).png\" alt=\"\" width=\"420\" height=\"520\" /></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Visualiza y mant&eacute;n el control de tu mente</h2>\r\n<p style=\"text-align: justify;\">La visualizaci&oacute;n es una herramienta muy &uacute;til para conseguir un mayor control de la mente, de las emociones y del cuerpo, as&iacute; como para efectuar los cambios deseados en el comportamiento.</p>\r\n<p style=\"text-align: justify;\">Puede usarse para aliviar la tensi&oacute;n muscular, como t&eacute;cnica de concentraci&oacute;n para controlar y eliminar el dolor, para potenciar el &eacute;xito de muchas t&eacute;cnicas cognitivas, para mejorar la memoria, desarrollar la confianza en uno mismo o hasta para aumentar la actitud positiva, entre otras bondades.</p>\r\n<p style=\"text-align: justify;\">No es otra cosa que aprender a relajarse e imaginar v&iacute;vidamente diferentes cosas o situaciones de la forma m&aacute;s realista posible y aportando todos los detalles que podamos incluir, a la vez que generamos el control de nuestras emociones, sensaciones y comportamientos.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">&iquest;Qu&eacute; opinas? &iquest;Crees que ser&aacute;s capaz de practicarla con cierta frecuencia? Hoy te animamos a que compartas en qu&eacute; lugar te sientes m&aacute;s tranquilo/a y m&aacute;s conectado/a contigo mismo. &iquest;Un lugar de tu hogar, un lugar del exterior, o del entorno natural? &iexcl;Cu&eacute;ntanoslo!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/4%20(4).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-17 07:42:55','2023-12-04 08:34:12'),(34,55,'fr','','','','','','2022-11-17 07:42:55','2022-11-17 07:42:55'),(35,56,'en','Put your house in order','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Christmas offer a great opportunity to put your home in order. When we go up into the attic in search of all the Christmas decorations, it sometimes makes us realize how much clutter and junk we keep year after year, and often we only take advantage of the opportunity to clear some space for the incoming presents, especially when there are kids in the house.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Bear in mind that your house is going to be in a state of upheaval during the festive season. If you don&rsquo;t want to be overwhelmed by the chaos and stress, the best thing is to start putting things in order now before your guests and all the new objects start to arrive. By planning and simplifying, you&rsquo;ll avoid being overcome by chaos.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">One thing&rsquo;s for sure, and that is that people like order &ndash; it&rsquo;s calming, it&rsquo;s balancing, it makes our daily lives easier and it makes us feel better.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> Christmas offer a great opportunity to put your home in order. When we go up into the attic in search of all the Christmas decorations, it sometimes makes us realize how much clutter and junk we keep year after year, and often we only take advantage of the opportunity to clear some space for the incoming presents, especially when there are kids in the house.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The order, or chaos, of your surroundings has a big impact on your wellbeing, your concentration and your efficiency.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Internal order or disorder is projected outwards.</strong> Numerous studies have shown that order&nbsp; favours productivity, improves performance, makes tasks easier, makes people more willing, and also provides a sense of control, security and balance. Putting something in order generally means taking a step towards wellbeing.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Seeing a tidy room is so much more pleasant than a messy space, but the most magical thing is the benefits that this brings us on a mental level. By simplifying our lives, it makes us feel&nbsp;calmer and happier and it improves our relationships with the other inhabitants of the house.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Being organized also saves money, since it avoids making duplicate purchases of things you couldn&rsquo;t see for all the mess. <strong>But the biggest benefit tidiness brings is much more time to enjoy the things that really matter to us.</strong></span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Get rid of what you don&rsquo;t need</h2>\r\n<p style=\"text-align: justify;\">Knowing how to tidy up is important, but it&rsquo;s not everything. You can spend hours or days picking things up and putting them away and still be dissatisfied. The key is to get rid of everything that doesn&rsquo;t inspire a sense of joy. The tidiness expert Marie Kondo recommends that you only keep the things that &ldquo;speak to your heart&rdquo;. Throwing away those unnecessary objects that you&rsquo;ve thoughtlessly accumulated is a new way of improving your mood and getting rid of chaos.</p>\r\n<p style=\"text-align: justify;\"><strong>Everything you decide to discard can be sold, donated, or gifted to someone who can give it a useful life. </strong>Getting rid of things you haven&rsquo;t used for a long time will help to free up space and keep your home more organized and less cluttered.</p>\r\n<p style=\"text-align: justify;\">Spend a judicious amount of time making an initial selection of the objects, kitchen or bathroom accessories, clothing and shoes that have really not been used for a long time.</p>\r\n<p style=\"text-align: justify;\">Although it can be difficult to throw certain things out, as soon as you&rsquo;ve made a first selection you can analyse it to see if you really need those objects or not, and then make a final decision.</p>\r\n<p style=\"text-align: justify;\"><strong>Keep the 80/20 rule in mind, </strong>one of the most important guidelines for organizing a messy home, according to which we only use 20 percent of the things we possess. This is a good starting point that will help you realize that you&rsquo;re surrounded by things you don&rsquo;t really need.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today, the challenge is for you to accept the proposal to keep your home and your workspace tidier in 2022. If this kind of organization is new to you, you can download these tips that we&rsquo;ve prepared. If you don&rsquo;t know how tidy &ndash; or not &ndash; you are, take this fun quiz to measure where you come on the tidiness scale.</p>\r\n<p><a class=\"btn btn-primary\" href=\"https://iuk3zut73vv.typeform.com/to/G0P4Cgsk\">TEST</a></p>\r\n<p><a class=\"btn btn-primary\" href=\"../../../../storage/files/uploads/tips-orden-bueno.pdf\">TIPS</a></p>\r\n<p style=\"text-align: justify;\">Start with one room or even just one drawer &ndash; the important thing is to get started. You&rsquo;ll soon see how addictive it becomes!</p>\r\n<div style=\"width: 100%;\">&nbsp;</div>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/10%20(1).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/disen%CC%83o-sin-ti%CC%81tulo-4.png\" alt=\"\" width=\"420\" height=\"520\" /></p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/disen%CC%83o-sin-ti%CC%81tulo-2%20(1).png\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>Surround yourself with the things that make you happy</h2>\r\n<p style=\"text-align: justify;\">It doesn&rsquo;t matter if you work from home or have a corner where you like to sit and read or sew, the important thing is that you create a space that fosters concentration. To do, bear in mind that it should be spacious, quiet, and have enough light; if this can be daylight, even better.</p>\r\n<p style=\"text-align: justify;\">The decoration, the tidiness and cleanliness, the colours and the ambiences we create all influence our thoughts and the production of hormones and neurotransmitters in the brain, making it possible to radically improve your emotional wellbeing.</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">How that you&rsquo;ve started on this tidying project, we&rsquo;d like you to share with us the aspect that you find most difficult to keep under control (you can get some ideas from the individual challenge tips). You can also share a picture of the place in your house that you&rsquo;re proudest of in terms of tidiness.</p>\r\n</div>\r\n</div>','2022-11-17 07:43:40','2022-11-30 08:36:11'),(36,56,'es','Ordena tu entorno','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">La Navidad es una oportunidad para poner en orden nuestro hogar, acudimos al desv&aacute;n en b&uacute;squeda de todos los adornos navide&ntilde;os. En ocasiones esto hace que nos demos cuenta de la cantidad de trastos y de objetos que guardamos a&ntilde;o tras a&ntilde;o, adem&aacute;s muchas veces solemos aprovechar para hacer algo de espacio para los regalos que vendr&aacute;n, especialmente en las casas donde hay ni&ntilde;os.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Ten en cuenta que tu casa va a vivir un gran ajetreo durante las fiestas. Si no quieres verte sobrepasado por el caos y el estr&eacute;s, mejor comienza por poner orden antes de recibir visitas y nuevos objetos. Planifica, simplifica y evitar&aacute;s que el caos te desborde.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Hay una cosa cierta y es que, el orden nos gusta, nos transmite paz, nos equilibra, nos hace el d&iacute;a a d&iacute;a m&aacute;s f&aacute;cil y hace que nos sintamos mejor.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size: 12pt;\">El orden o el caos de tu entorno tienen mucho que ver con tu bienestar, tu concentraci&oacute;n o tu eficiencia.</span></strong></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">El orden o el desorden interno se proyectan hacia afuera. Numerosos estudios afirman que el orden&nbsp;favorece la productividad, mejora el rendimiento, facilita la ejecuci&oacute;n de tareas, nos hace ser m&aacute;s voluntariosos y tambi&eacute;n aporta sensaci&oacute;n de control, seguridad y equilibrio.</span></p>\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size: 12pt;\">En general poner algo de orden en tu entorno es dar un paso hacia el bienestar.</span></strong></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Ver una estancia ordenada es mucho m&aacute;s agradable que un espacio desordenado, pero lo m&aacute;gico de todo esto son los beneficios que nos reporta a nivel mental. Al simplificarnos la vida, nos hace sentirnos&nbsp;m&aacute;s tranquilos, m&aacute;s felices&nbsp;y tener mejor relaci&oacute;n con el resto de habitantes de la casa.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Ser organizado ahorra tambi&eacute;n dinero, ya que evita, por ejemplo, duplicar compras de productos que no ve&iacute;amos a causa del desorden. </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Pero el mayor beneficio que nos aporta el orden es que nos regala much&iacute;simo tiempo para disfrutar de las cosas que realmente nos importan.</strong></span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Deshazte de aquello que NO necesitas</h2>\r\n<p style=\"text-align: justify;\">Saber ordenar es importante, pero no lo es todo. Podemos pasar horas o d&iacute;as recogiendo y no estar satisfechos. La clave est&aacute; en deshacerte de todo lo que no te inspire alegr&iacute;a. La experta en orden Marie Kondo recomienda guardar &uacute;nicamente las cosas que &ldquo;hablan a tu coraz&oacute;n&rdquo;. Tirar todos esos objetos que no son necesarios y que acumulamos sin sentido es una nueva forma de mejorar nuestro estado de &aacute;nimo y deshacernos del caos.</p>\r\n<p style=\"text-align: justify;\">Todo aquello que decidas desechar, puedes venderlo, donarlo o regalarlo a alguien que le puede dar una utilidad real.<strong> Deshacerte, de un modo u otro, de aquello que hace tiempo que no usas, te servir&aacute; para liberar espacio y mantener tu casa m&aacute;s organizada y despejada.</strong></p>\r\n<p style=\"text-align: justify;\">Dedica un tiempo prudencial a&nbsp;llevar a cabo una primera selecci&oacute;n de aquellas piezas, accesorios de cocina o ba&ntilde;o, ropa o zapatos que realmente hace tiempo que no tienen utilidad.</p>\r\n<p style=\"text-align: justify;\">Aunque puede costar deshacerse de seg&uacute;n qu&eacute; cosas, en cuanto hayas realizado una primera selecci&oacute;n, podr&aacute;s analizar si realmente necesitas estos objetos o no y as&iacute; tomar la decisi&oacute;n definitiva.</p>\r\n<p style=\"text-align: justify;\"><strong>Ten en cuenta&nbsp;la regla 80/20,</strong> una de las m&aacute;s importantes para conseguir c&oacute;mo organizar una casa desordenada, en la que se indica que tan solo utilizamos un 20% de las cosas que tenemos.&nbsp;Es un buen punto de partida que te servir&aacute; para darte cuenta de que estamos rodeados de cosas que seguramente no necesitamos.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy te retamos a que aceptes el prop&oacute;sito de mantener tu casa y tu espacio de trabajo m&aacute;s ordenado para el 2024. Si eres principiante en esto del orden, puedes descargarte estos consejos que hemos preparado. Tambi&eacute;n puedes realizar este divertido test para medir en qu&eacute; nivel te encuentras en lo que a orden se refiere.</p>\r\n<p><a class=\"btn btn-primary\" href=\"https://form.typeform.com/to/samY0YNs\">TEST</a></p>\r\n<p><a class=\"btn btn-primary\" href=\"../../../../storage/files/uploads/consejos-sobre-orden.pdf\">CONSEJOS</a></p>\r\n<p style=\"text-align: justify;\">Empieza por una estancia o si lo prefieres por un caj&oacute;n, lo importante es empezar. &iexcl;Ver&aacute;s como te resulta adictivo!</p>\r\n<div style=\"width: 100%;\">&nbsp;</div>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/10%20(1).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/disen%CC%83o-sin-ti%CC%81tulo-4.png\" alt=\"\" width=\"420\" height=\"520\" /></p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/disen%CC%83o-sin-ti%CC%81tulo-2%20(1).png\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>Rod&eacute;ate de cosas que te hagan feliz</h2>\r\n<p style=\"text-align: justify;\">Da igual si trabajas en casa o tienes un rinc&oacute;n en el que te gusta sentarte a leer o a coser, lo importante es que crees&nbsp;un espacio que favorezca la concentraci&oacute;n. Para ello debes tener en cuenta que debe ser amplio, alejado del ruido y con suficiente luz; si es natural, mejor. No te olvides de rodearte de objetos que te hagan sentir bien, que te evoquen buenos recuerdos y que te ayuden a conectar con un estado de bienestar emocional.</p>\r\n<p style=\"text-align: justify;\">La decoraci&oacute;n, el orden y la limpieza, los colores y los ambientes que creamos influyen en nuestros pensamientos y en la producci&oacute;n de hormonas y neurotransmisores en el cerebro, haciendo posible que&nbsp;aumente nuestro bienestar emocional radicalmente.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Ahora que te has iniciado en esto del orden nos gustar&iacute;a que compartieras con nosotros aquel espacio o lugar que te cuesta m&aacute;s mantener en orden. (puedes coger ideas de los consejos del reto individual). Tambi&eacute;n puedes compartir una imagen del lugar de tu casa del que te sientas m&aacute;s orgulloso/a en lo que a orden se refiere.</p>\r\n</div>\r\n</div>','2022-11-17 07:43:40','2023-12-11 19:17:24'),(37,56,'fr','','','','','','2022-11-17 07:43:40','2022-11-17 07:43:40'),(41,58,'en','Exercise your creativity!','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">When you watch children play, it&rsquo;s surprising how creative they are and how far their imagination takes them. Creativity flows naturally when we are young, but it seems that as we grow older we lose that innate gift.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The good news is that creativity can be stimulated so that it doesn&rsquo;t disappear with the years.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Being creative opens up the ability to innovate, to generate new ideas and concepts, and is also a method or channel of expression.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Creativity helps to express abstract thoughts, solve problems, and streamline social relationships. In addition, more creative people are more flexible and sensitive and tend to express themselves better.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">When you watch children play, it&rsquo;s surprising how creative they are and how far their imagination takes them. Creativity flows naturally when we are young, but it seems that as we grow older we lose that innate gift.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">All of us have the ability to be creative deep inside ourselves. However, sometimes the passing years dampen spontaneity and turn off creative energy.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Creativity offers us ideas and solutions that help us to adapt to a constantly changing environment and enable us to escape from routine and our comfort zones.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">It is a way of educating our minds and understanding reality from different perspectives. That&rsquo;s why it&rsquo;s important to develop your creativity and keep it alive every day for a better quality of life.</span></p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>&ldquo;Creativity is intelligence having fun!&rdquo; Albert Einstein</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">It has been shown that creative people have a series of non-innate characteristics that enable them to develop ingeniously. These are aspects that anyone can develop, so all you need to do is put them into practice and maintain them if you really want to arouse your most creative side.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Here are some techniques for fostering creativity:</span></p>\r\n</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/fotos-1080-x-810-12.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Observe and investigate: </strong>The first technique to develop creativity is learning. Knowledge is the fuel that powers the imagination.Use your natural curiosity and explore a particular subject in depth<strong>.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Combine knowledge:&nbsp;</strong>Creativity essentially emerges from a connection of ideas. Given that our thoughts are interlocking, it is important to take an interest in other sectors, other professions, etc. These set off triggers in our minds.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Exercise your imagination: </strong>This helps to transform knowledge into new ideas. Studying a second language, painting a picture, writing a book &ndash; in short, learning a new skill &ndash; are some of the things that also help to empower your imagination.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Take your time: </strong>We need time to reflect, to play with our ideas and to make crazy associations.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Alternate method and chaos: </strong>To streamline the creative process, you need to follow certain rules, a certain systemization. But take care, because too many rules can inhibit and constrict the creative process, so swinging between these two extremes can be a healthy combination. It might be difficult to assimilate, but order also emerges from chaos.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Get out of your comfort zone: </strong>Your education, society and your own life experiences have configured your mind. Your mental model is neither unique nor the best. Accepting this is the first step to re-educating your mind and being able to look at the world through different eyes.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Devote time to what you enjoy: </strong>Creativity has a lot to do with the passion you put into what you&rsquo;re doing. Devoting some of your time to doing what you really enjoy will facilitate your creative process.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Don&rsquo;t be frightened of failure: </strong>Creativity is closely associated with experimentation, and to experiment you need to cast aside your fears. Creativity is fed by our ability to surprise ourselves, to get excited, and to plunge like children into the world of the unknown. These are all aspects that feed back into each other, so it&rsquo;s necessary to practice all of them to help your creative side emerge more easily.</span></p>\r\n</div>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Today we encourage you to think about your creative process: are you consciously exercising your creativity, or have you let it fall by the wayside? You&rsquo;ve already seen that it&rsquo;s something you can work on, regardless of your age or the point in life you&rsquo;ve reached. Take the plunge and release all the creativity you have inside you!</span></p>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-4.png\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>We are all creative</h2>\r\n<p style=\"text-align: justify;\">Even though you might not believe it, we are all creative. Creativity is innate in all of us; it springs from our minds, it liberates us, and it also helps us, on many occasions, to find the solution to a problem.</p>\r\n<p style=\"text-align: justify;\">Sometimes we mistakenly think that creativity is only found in people who are accomplished in artistic or manual activities such as design and crafts; however, creativity forms part of our day-to-day lives &ndash; in the way you dress, cook, decorate your home; in the way you express yourself or deal with problems, among many other aspects.</p>\r\n<p style=\"text-align: justify;\"><strong>Everyone, without exception,&nbsp;has the ability to be creative, </strong>yet it is also true that<strong>&nbsp;not everyone has the same capacity to create&nbsp;</strong>or imagine; it is also true that some people are more creative or more able to innovate in one area than another.</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today our challenge is to share on the wall which areas you think you are more creative in. Cooking? Working? Playing with your kids? The way you relate to your environment? There are endless areas in which you can develop your creativity. Tell us which one is yours!</p>\r\n</div>\r\n</div>','2022-11-17 07:46:00','2022-11-28 10:51:23'),(42,58,'es','Ejercita tu creatividad','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Viendo a los ni&ntilde;os/as jugar nos sorprende lo creativos que son y lo lejos que puede llegar su imaginaci&oacute;n. La creatividad fluye de un modo natural cuando somos ni&ntilde;os, sin embargo parece que a medida que nos vamos haciendo mayores perdemos ese don innato.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">La buena noticia es que la creatividad se puede estimular para que con el paso de los a&ntilde;os no vaya desapareciendo.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> El hecho de ser creativo brinda capacidad de innovaci&oacute;n, capacidad para generar nuevas ideas y conceptos, es tambi&eacute;n un m&eacute;todo o canal de expresi&oacute;n.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">La creatividad ayuda a expresar los pensamientos abstractos, resolver problemas y facilita las relaciones sociales. Adem&aacute;s las personas m&aacute;s creativas se expresan mejor, son m&aacute;s flexibles y sensibles.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Viendo a los ni&ntilde;os/as jugar nos sorprende lo creativos que son y lo lejos que puede llegar su imaginaci&oacute;n. La creatividad fluye de un modo natural cuando somos ni&ntilde;os, sin embargo parece que a medida que nos vamos haciendo mayores perdemos ese don innato.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Todos tenemos la habilidad de ser creativos en nosotros mismos. Sin embargo, en ocasiones, el paso del tiempo nos apaga esa espontaneidad, esa fuerza sensacional.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> La creatividad nos aporta soluciones e ideas que permiten adaptarnos a un entorno de continuo cambio y nos permite salir de la rutina y de nuestras zonas de confort.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Es una manera para educar a nuestra mente y comprender la realidad desde distintas perspectivas. Por ello, es importante conseguir desarrollarla y mantenerla despierta en nuestro d&iacute;a a d&iacute;a para una mayor calidad de vida.</span></p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>\"La creatividad es la inteligencia divirti&eacute;ndose\" Albert Einstein</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Se ha demostrado que las personas creativas poseen una serie de rasgos no innatos que les permiten desarrollarse de una manera ingeniosa. Se trata de aspectos que se pueden desarrollar en cualquier persona, por lo que bastar&aacute; con ponerlas en pr&aacute;ctica y mantenerlas, si realmente queremos desarrollar nuestra faceta m&aacute;s creativa.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> A continuaci&oacute;n exponemos t&eacute;cnicas para fomentar la creatividad:</span></p>\r\n</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/fotos-1080-x-810-12.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Observa e investiga: </strong>La primera t&eacute;cnica pera el desarrollo de la creatividad es aprender. El conocimiento es el combustible para el desarrollo de la imaginaci&oacute;n. Aprovecha tu curiosidad natural y&nbsp;profundiza en el conocimiento de una determinada materia.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Mezcla conocimientos:&nbsp;</strong>La creatividad surge fundamentalmente de conectar ideas. Dado que nuestro pensamiento es convergente, es importante interesarnos por otros sectores, otras profesiones, culturas, etc ya que ser&aacute;n provocaciones para nuestro cerebro.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Ejercita tu imaginaci&oacute;n:</strong> Permite transformar los conocimientos en nuevas ideas. Estudiar un segundo idioma, pintar un cuadro, escribir un libro o, en definitiva, aprender una nueva habilidad son algunas de las cosas que tambi&eacute;n van a facilitar que potenciemos nuestra imaginaci&oacute;n.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>T&oacute;mate tu tiempo: </strong>Necesitamos tiempo para reflexionar, para jugar con las ideas y para hacer asociaciones locas.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Alterna m&eacute;todo y caos: </strong>Para agilizar el proceso creativo hace falta seguir unas reglas, una cierta sistematizaci&oacute;n. Pero ten en cuenta que un exceso de reglas puede inhibir y encorsetar el proceso creativo por lo que pivotar entre ambos extremos puede ser una sana combinaci&oacute;n. Aunque sea dif&iacute;cil de asimilar, del caos tambi&eacute;n surge el orden.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Sal de tu marco de referencia: </strong>La educaci&oacute;n, la sociedad y nuestras propias experiencias vitales han configurado nuestra mente. Nuestro modelo mental no es &uacute;nico ni el mejor. Asumir esto es el primer paso para reeducar nuestra mente y poder enfocar el mundo con otros ojos.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Dedica tiempo a lo que te gusta: </strong>La creatividad tiene mucho que ver con la pasi&oacute;n que ponemos en lo que hacemos. Dedicar parte de nuestro tiempo a hacer aquello con lo que realmente disfrutamos ayudar&aacute; a nuestro proceso creativo.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>No tengas miedo al fracaso: </strong>La creatividad tiene mucho que ver con la experimentaci&oacute;n y para experimentar hace falta superar nuestros miedos. La creatividad se alimenta de nuestra capacidad para sorprendernos, &nbsp;entusiasmarnos y adentrarnos como ni&ntilde;os en el mundo de lo desconocido. Se trata de aspectos que se retroalimentan entre ellos por lo que resulta necesaria la pr&aacute;ctica de todos ellos para que nuestra faceta creativa pueda surgir m&aacute;s f&aacute;cilmente.</span></p>\r\n</div>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> Hoy te animamos a que reflexiones sobre tu proceso creativo &iquest;realmente ejercitas tu creatividad conscientemente o por el contrario la tienes un poco estancada? Ya has visto que es algo que se puede trabajar independientemente de la edad y el momento vital en el que te encuentres. &iexcl;An&iacute;mate a ejercitar la creatividad que llevas dentro! </span></p>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-4.png\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>Todos somos creativos</h2>\r\n<p style=\"text-align: justify;\">Aunque no lo creas, todos somos creativos. La creatividad es parte de nosotros, surge en nuestro cerebro, nos libera y tambi&eacute;n nos ayuda muchas veces a encontrar la soluci&oacute;n a un problema.</p>\r\n<p style=\"text-align: justify;\">A veces, nos limitamos a pensar que la creatividad se encuentra &uacute;nicamente en aquellos que destacan en actividades art&iacute;sticas, de dise&ntilde;o o manuales. Sin embargo la creatividad forma parte de nuestro d&iacute;a a d&iacute;a, est&aacute; en tu manera de vestirte, de cocinar, de ambientar tu hogar, en tu manera de expresarte o de enfrentarte a los problemas entre muchas otras cosas.</p>\r\n<p style=\"text-align: justify;\"><strong>Todos&nbsp;sin excepci&oacute;n&nbsp;tenemos la capacidad de ser creativos</strong>, sin embargo, es cierto tambi&eacute;n que&nbsp;<strong>no todo el mundo tiene la misma capacidad de crear</strong> o de imaginar, tambi&eacute;n es cierto que hay personas capaces de innovar o de ser m&aacute;s creativos en un &aacute;mbito que en otro.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy te desafiamos a que compartas en el muro en que aspectos consideras que eres creativo. &iquest;Cocinando? &iquest;Trabajando? &iquest;Jugando con tu hijos/as? &iquest;En tu manera de relacionarte con tu entorno? Hay infinidad de &aacute;mbitos en los que podemos desarrollar nuestra creatividad. &iexcl;Cu&eacute;ntanos cu&aacute;l es el tuyo!</p>\r\n</div>\r\n</div>','2022-11-17 07:46:00','2023-12-05 13:03:39'),(43,58,'fr','','','','','','2022-11-17 07:46:00','2022-11-17 07:46:00'),(44,59,'en','Smile whenever you can','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Laughter is contagious, liberating, and releases stress, but it has also been scientifically proven that its benefits for human health and wellbeing are key to many aspects of our lives.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Laughter exercises the face muscles but does not cause wrinkles or expression lines. Did you know that when we laugh we move 400 muscles in the body, and that 100 laughs is equivalent to ten minutes of aerobic exercise or fifteen minutes of cycling? In addition, happiness is reflected in your physical state, and you look much better.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Laughter can and should be practised in the same way that we exercise our muscles and train our brains.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><strong>Laughter is contagious, liberating, de-stressing, but, in addition, it has been scientifically proven that its benefits for the health and well-being of people are key in many facets of our lives. </strong>It allows us to experience relief and joy. It also helps us to feel lighter and to spread that feeling and above all that positive ENERGY to others.</p>\r\n<p style=\"text-align: justify;\">As a result, it helps to improve your social relationships, along with a number of physical benefits such as sleeping better, lowering blood pressure and relieving aching muscles.</p>\r\n<p style=\"text-align: justify;\">Now you know that laughter helps to keep you in good health, what are you waiting for? Get laughing!</p>\r\n</div>\r\n</div>','<div class=\"row\"><!-- Columna Izda inicio-->\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Laughter, a sport that must be exercised</h2>\r\n<p style=\"text-align: justify;\">Today we propose that you smile more at the people you interact with on daily basis. In return, we promise you will feel much better.</p>\r\n<p style=\"text-align: justify;\">Laughter is actually more like a mood, a positive attitude, and can therefore be trained to make it a habit.</p>\r\n<p style=\"text-align: justify;\">The exercise of laughter is often related to presence, to what you&rsquo;re doing in that precise moment, and closely connected with mindfulness.</p>\r\n<p style=\"text-align: justify;\">Laughter can be practised through a series of exercises (body language, games, techniques for laughing naturally, etc.) in order to stimulate those belly laughs that alleviate stress, improve your health, and put you in a better mood.</p>\r\n<p style=\"text-align: justify;\">There are many ways of provoking laughter, from tickling to acting in an amusing way, but all of them activate oxytocin, known as the hormone of happiness, and reduce cortisol.</p>\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p style=\"text-align: justify;\"><!-- este es el separador de 10px--></p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we are going to ask you to laugh a little more. Why don\'t you make a colleague at work laugh? Surely you know how to get a smile out of him or her! And to exercise your laughter a little, we encourage you to watch this video with some of the funniest scenes from the legendary series \"Friends\", they are sure to make your day!</p>\r\n</div>\r\n<!-- Columna Izda fin--> <!-- Columna Dch inicio-->\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/cuadradas-concienciar%20(2).png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/pregunta-6-2.jpg\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n<!-- Columna Izda fin--><!-- este es el separador de 10px-->\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\"><!-- este es el separador de 10px--></div>\r\n</div>\r\n<div class=\"col-md-6\"><a class=\"btn btn-primary\" href=\"https://www.youtube.com/watch?v=EbRHq4bdxl0\" target=\"_blank\" rel=\"noopener noreferrer\">Watch video</a></div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>It was worth it if it made you laugh</h2>\r\n<p style=\"text-align: justify;\">You&rsquo;ve almost certainly experienced a really bad day or had some problem nagging at you and then suddenly someone makes you laugh, taking you out of the situation you were in and making you look at your problems from another perspective. Without realizing it, in just a few minutes your mood has changed!</p>\r\n<p style=\"text-align: justify;\">Moreover, a study in Norway showed that people with a good sense of humour live longer than those without a lot of laughter in their lives.</p>\r\n<p style=\"text-align: justify;\">So now you know. Don&rsquo;t forget to laugh every day of your life!</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Share that movie that you still find hilarious no matter how many times you watch it, and if you find it difficult to choose one, we\'ll let you choose the 3 movies that you think are the funniest in history.</p>\r\n<p style=\"text-align: justify;\">We could create our own list of the funniest-ever movies based on everyone&rsquo;s suggestions. What do you think?</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-5.png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-17 07:46:30','2022-12-16 08:44:56'),(45,59,'es','Ríe siempre que puedas','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> La risa es contagiosa, liberadora, desestresante, pero adem&aacute;s, se ha demostrado cient&iacute;ficamente que sus beneficios para la salud y el bienestar de las personas son claves en muchas facetas de nuestra vida.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">La risa ejercita los m&uacute;sculos de la cara, no arruga ni causa l&iacute;neas de expresi&oacute;n. &iquest;Sab&iacute;as que cuando nos re&iacute;mos movemos 400 m&uacute;sculos del cuerpo, y que 100 carcajadas equivalen a hacer 10 minutos de ejercicio aer&oacute;bico o 15 minutos en bicicleta? Adem&aacute;s, cuando estamos contentos, se refleja en el estado f&iacute;sico y nuestra apariencia es mucho mejor.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">La risa puede y debe ejercitarse de la misma manera que ejercitamos nuestros m&uacute;sculos y nuestro cerebro.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><strong>La risa es contagiosa, liberadora, desestresante, pero, adem&aacute;s, se ha demostrado cient&iacute;ficamente que sus&nbsp;beneficios para la salud y el bienestar&nbsp;de las personas son claves en muchas facetas de nuestra vida. </strong>Permite experimentar alivio y alegr&iacute;a. Tambi&eacute;n ayuda a sentirnos m&aacute;s ligeros y a contagiar a otros esa sensaci&oacute;n y sobre todo esa ENERG&Iacute;A positiva.</p>\r\n<p style=\"text-align: justify;\">Como resultado nos ayuda mejorar nuestras relaciones sociales y a dormir mejor as&iacute; como toda una serie de beneficios f&iacute;sicos como por ejemplo disminuir la tensi&oacute;n arterial o aliviar dolores musculares.</p>\r\n<p style=\"text-align: justify;\">Ahora que sabes que la risa puede ayudarte a mantener una buena salud, &iquest;qu&eacute; esperas para ejercitarla? &iexcl;A re&iacute;r se ha dicho!</p>\r\n</div>\r\n</div>','<div class=\"row\"><!-- Columna Izda inicio-->\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>La risa, un deporte que hay que ejercitar</h2>\r\n<p style=\"text-align: justify;\">Nuestro prop&oacute;sito de hoy es que sonr&iacute;as m&aacute;s hacia las personas con las que interact&uacute;as a diario. A cambio te prometemos que te sentir&aacute;s mucho mejor.</p>\r\n<p style=\"text-align: justify;\">La risa es m&aacute;s bien un estado de &aacute;nimo, como la actitud positiva, y por tanto se puede entrenar para conseguir convertirla en un h&aacute;bito.</p>\r\n<p style=\"text-align: justify;\">El ejercicio de la risa est&aacute; muchas veces relacionado con la presencia, con estar a lo que estoy haciendo en ese preciso momento, &iacute;ntimamente relacionado con el mindfulness.</p>\r\n<p style=\"text-align: justify;\">La risa puede ejercitarse mediante una serie de ejercicios&nbsp;(expresi&oacute;n corporal, juegos, t&eacute;cnicas para re&iacute;r de manera natural...) con el objetivo de conseguir carcajadas y as&iacute; liberar tensiones, mejorar nuestra salud y nuestro estado de &aacute;nimo.</p>\r\n<p style=\"text-align: justify;\">Hay muchas formas de provocar risa, desde las cosquillas hasta actuar de forma graciosa, pero con todas se activa la oxitocina, conocida como hormona de la felicidad, y se reduce el cortisol.</p>\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p style=\"text-align: justify;\"><!-- este es el separador de 10px--></p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy te vamos a pedir r&iacute;as un poco m&aacute;s. &iquest;Por qu&eacute; no haces re&iacute;r a alg&uacute;n compa&ntilde;ero de trabajo? &iexcl;Seguro que sabes c&oacute;mo sacarle una sonrisa! Adem&aacute;s para ejercitar un poco esa risa, te animamos a que veas este v&iacute;deo con algunas de las escenas m&aacute;s divertidas de la m&iacute;tica serie \"Friends\" &iexcl;Seguro que te alegran el d&iacute;a!</p>\r\n</div>\r\n<!-- Columna Izda fin--> <!-- Columna Dch inicio-->\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/cuadradas-concienciar%20(2).png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/pregunta-6-2.jpg\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n<!-- Columna Izda fin--><!-- este es el separador de 10px-->\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\"><!-- este es el separador de 10px--></div>\r\n</div>\r\n<div class=\"col-md-6\"><a class=\"btn btn-primary\" href=\"https://www.youtube.com/watch?v=TrJhUgHrGPo\" target=\"_blank\" rel=\"noopener noreferrer\">Ver v&iacute;deo</a></div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Vali&oacute; la pena si te hizo re&iacute;r</h2>\r\n<p style=\"text-align: justify;\">Te habr&aacute; pasado muchas veces que has tenido un mal d&iacute;a o alg&uacute;n problema que te tiene preocupado y de repente alguien te hace re&iacute;r, te saca de esa situaci&oacute;n en la que te hab&iacute;as metido, y pasas a ver esos problemas desde otra perspectiva. Sin darte cuenta, en tan solo unos minutos, &iexcl;tu estado de &aacute;nimo hab&iacute;a cambiado!</p>\r\n<p style=\"text-align: justify;\">Adem&aacute;s un estudio en Noruega mostr&oacute; que las personas con un fuerte sentido del humor viv&iacute;an m&aacute;s tiempo que aquellas que no re&iacute;an tanto humor en su vida.</p>\r\n<p style=\"text-align: justify;\">As&iacute; que ya sabes, &iexcl;no olvides practicar la risa cada d&iacute;a de tu vida! Hoy queremos retarte a que compartas unas carcajadas con tus compa&ntilde;eros/as.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Comparte esa pel&iacute;cula que por muchas veces que la veas te siga pareciendo tronchante. Si escoger una te resulta dif&iacute;cil, te dejamos que nos pongas las 3 pel&iacute;culas que para ti son las m&aacute;s divertidas de la historia.</p>\r\n<p style=\"text-align: justify;\">Podr&iacute;amos crear nuestro propio listado de las pel&iacute;culas m&aacute;s divertidas a partir de los comentarios de todos. &iquest;Qu&eacute; te parece?</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-5.png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-17 07:46:30','2023-12-05 13:19:34'),(46,59,'fr','','','','','','2022-11-17 07:46:30','2022-11-17 07:46:30'),(47,60,'en','Connect with nature','<p style=\"text-align: justify;\"><strong><span style=\"font-size: 12pt;\">Getting in touch with nature is an almost vital necessity for human beings.</span></strong></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Everyone, children, youth and adults, enjoy nature in any of its manifestations: through the wind that runs in the mountains, the rays of the sun on a beach, the fresh aroma of plants in the field, among others.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The silence of the forest, the sound of the sea, the infinity of the mountains, the brightness of a starry sky, are cures from a sensory impact that tempers the spirit, heals the body and calms the mind.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Few things are more healing than a visit to a remote place in nature. Our physical and mental health needs this connection.</span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">Everyone, children, youth and adults, enjoy nature in any of its manifestations: through the wind that runs in the mountains, the rays of the sun on a beach, the fresh aroma of plants in the field, among others.</p>\r\n<p style=\"text-align: justify;\">Surely you are aware that spending time in the natural environment suits you, but you should know that it has an explanation. Connecting with nature brings us many real benefits.</p>\r\n<ul>\r\n<li style=\"text-align: justify;\"><strong>Physical benefits: </strong>It helps us oxygenate our body and reduce cortisol. With this we strengthen our immune system and all conditions related to stress. We reduce headaches and muscle tension. Likewise, exposure to nature and natural light helps us regulate our biological cycles and improve the quality of our sleep.</li>\r\n<li style=\"text-align: justify;\"><strong>Mental benefits: </strong>As a consequence of the above, it helps relieve anxiety, discomfort, sadness and depression. It also improves our memory and our open-mindedness. In addition to improving our creativity and artistic ability.</li>\r\n<li style=\"text-align: justify;\"><strong>Emotional benefits: </strong>Enjoying nature improves our mood. It gives us a feeling of calm and calm. It also gives us a feeling of freedom, strength and health that positively affects our self-esteem.</li>\r\n<li style=\"text-align: justify;\"><strong>Spiritual benefits: </strong>Connecting with nature allows us to better appreciate our surroundings. Wondering about our natural environment makes us more grateful, something essential to learn to lead a more fulfilling life.</li>\r\n</ul>\r\n<p>It is convenient to keep this in mind and look for moments of full connection with the natural environment.</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>Nature inspires our mind and heals our body</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">We do not always have the possibility to get away from the city for hours or days. However, there are many ways to seek connection with nature in our day to day, even for a few minutes. Here are some suggestions:</span></p>\r\n</div>\r\n<div class=\"col-md-12\" style=\"text-align: justify;\"><img src=\"../../../../storage/files/uploads/fotos-1080-x-810-15.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\" style=\"text-align: justify;\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Look through the window. </strong>Look out the window several times a day. Observe the sky, the clouds, the sun, the birds that may be flying and the plants that you see. Feel the temperature, the air, the rays of the sun on your face or the raindrops. Try to listen to the sounds of nature among the noises of the city. Watch the grass or leaves sway in the wind.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Walk through nature. </strong>A walk through the countryside, the forest, the mountains, the beach or a park allows you to connect with nature, from time to time prioritize this plan in your free time. Try to park your thoughts and pay attention to your surroundings. Contemplate the different shades of the earth and the plants and trees. Open your senses to sensations, smells, and sounds. If you can, even walk barefoot for a bit. Experience the temperature, humidity level and texture of the soil.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Immerse yourself in nature. </strong>Whether in a park, a forest, a mountain or a beach, stop for a while. Sit back and immerse yourself in your surroundings. Soak up visual, auditory, olfactory and tactile sensations. It inspires the characteristic smells of the season: the smell of earth, plants and trees, sand and sea, etc. Sharpen your ears to hear the animals around you: birds, insects, squirrels or whatever. Look everywhere. Then focus on something specific and look at it very carefully: the grass, a plant, a flower or a tree. Take time to contemplate and appreciate it.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Practice sports outdoors. </strong>It is another way to connect with nature. You can go for a run, bike ride, or rollerblade. But you can also join groups that practice crossfit, yoga, taichi etc. outdoors. You can also go hiking, mountaineering, swimming, diving or horse riding, for example, even if it is on time.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Bring out your creative side. </strong>Do you like to draw or paint? Then go outside and sit down to capture your surroundings on paper. If you prefer photography, appreciate nature by immortalizing the landscape with your mobile or camera. Other ideas could be to collect leaves or chestnuts to make crafts with your children. Or go out to the forest to look for berries or mushrooms and then cook a tasty dish or prepare a delicious cake.</span></p>\r\n</div>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">There are many types of nature: are you more beach or mountain, exotic landscapes or countryside? We encourage you to play this fun game to find your ideal place in nature.</span></p>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"CONNECT WITH NA\" src=\"https://view.genial.ly/639255683cc14f001999f695\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">A large number of studies have shown that spending time in nature improves physical health, mental well-being, and happiness.</p>\r\n<p style=\"text-align: justify;\">On the other hand, some of the most amazing experiences of our life occur when we are immersed in nature. For this reason, it is also so important that we get involved in preserving nature, not only for ourselves, but also for future generations and for all that remains for them to live.</p>\r\n<p style=\"text-align: justify;\">Reconnecting with nature is not a whim, but a vital necessity for anyone who wants to feel good about themselves both physically, psychologically and emotionally.</p>\r\n<p style=\"text-align: justify;\">And today there is a prize, among all those who participate in today\'s challenge we will raffle a getaway for two in a rural tourism, to enjoy and connect with nature. Will you be the winner?</p>\r\n<h4>CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we challenge you to share your favorite corner of nature, that place where you forget all your worries and where you feel totally connected with it. You can share a photo and the name of the place.</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/fotosgifs-calendario-13.png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img src=\"../../../../storage/files/uploads/fotosgifs-calendario-17.png\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n</div>','2022-11-17 07:47:05','2022-12-12 11:58:26'),(48,60,'es','Conecta con la naturaleza','<p style=\"text-align: justify;\"><strong><span style=\"font-size: 12pt;\">Entrar en contacto con la naturaleza es una necesidad casi vital para los seres humanos.</span></strong></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Todos, ni&ntilde;os, j&oacute;venes y adultos, disfrutamos de la naturaleza en cualquiera de sus manifestaciones: a trav&eacute;s del viento que corre en las monta&ntilde;as, los rayos del sol en una playa, el aroma fresco de las plantas en el campo, entre otras.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> El silencio del bosque, el rumor del mar, la infinidad de las monta&ntilde;as, el brillo de un cielo estrellado, son curas desde un impacto sensorial que&nbsp;templa el esp&iacute;ritu, sana el cuerpo y apacigua la mente.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Pocas cosas son m&aacute;s sanadoras que la visita a un lugar remoto en la naturaleza. Nuestra salud f&iacute;sica y mental necesita de esta conexi&oacute;n.</span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">Todos, ni&ntilde;os, j&oacute;venes y adultos, disfrutamos de la naturaleza en cualquiera de sus manifestaciones: a trav&eacute;s del viento que corre en las monta&ntilde;as, los rayos del sol en una playa, el aroma fresco de las plantas en el campo, entre otras.</p>\r\n<p style=\"text-align: justify;\">Seguramente seas consciente de que pasar tiempo en el entorno natural te sienta bien, pero debes saber que tiene una explicaci&oacute;n. Conectar con la naturaleza nos aporta muchos beneficios reales.</p>\r\n<ul>\r\n<li style=\"text-align: justify;\"><strong>Beneficios f&iacute;sicos:</strong> Nos ayuda a oxigenar nuestro cuerpo y a reducir el cortisol. Con ello reforzamos nuestro sistema inmunitario y todas las afecciones relacionadas con el estr&eacute;s. Reducimos dolores de cabeza y tensiones musculares. As&iacute; mismo la exposici&oacute;n a la naturaleza y la luz natural nos ayuda a regular nuestros ciclos biol&oacute;gicos y a mejorar la calidad de nuestro sue&ntilde;o.</li>\r\n<li style=\"text-align: justify;\"><strong>Beneficios mentales:</strong> Como consecuencia de lo anterior, ayuda a aliviar la ansiedad, malestar, tristeza y depresi&oacute;n. Adem&aacute;s mejora nuestra memoria y nuestra amplitud de miras, nuestra creatividad y capacidad art&iacute;stica.</li>\r\n<li style=\"text-align: justify;\"><strong>Beneficios emocionales:</strong> Disfrutar de la naturaleza mejora nuestro estado de &aacute;nimo. Nos produce una sensaci&oacute;n de sosiego y calma. Tambi&eacute;n nos da una sensaci&oacute;n de libertad, fortaleza y salud que redunda positivamente en nuestra&nbsp;autoestima.</li>\r\n<li style=\"text-align: justify;\"><strong>Beneficios espirituales:</strong> Conectar con la naturaleza nos permite apreciar mejor nuestro entorno. Maravillarnos de nuestro entorno natural nos hace ser m&aacute;s agradecidos, algo esencial para aprender a llevar una vida m&aacute;s plena.</li>\r\n</ul>\r\n<p>Conviene tenerlo presente y buscar momentos de conexi&oacute;n plena con el entorno natural.</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>La naturaleza inspira nuestra mente y sana nuestro cuerpo</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">No siempre tenemos la posibilidad de alejarnos de la ciudad durante horas o d&iacute;as. Sin embargo, hay muchas maneras de buscar la conexi&oacute;n con la naturaleza en nuestro d&iacute;a a d&iacute;a, aunque sea por unos pocos minutos. Aqu&iacute; tienes algunas propuestas:</span></p>\r\n</div>\r\n<div class=\"col-md-12\" style=\"text-align: justify;\"><img src=\"../../../../storage/files/uploads/fotos-1080-x-810-15.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\" style=\"text-align: justify;\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Mira por la ventana.</strong> Mira varias veces al d&iacute;a por la ventana. Observa el cielo, las nubes, el sol, los p&aacute;jaros que pueda haber volando y las plantas que veas. Siente la temperatura, el aire, los rayos de sol en tu cara o las gotas de lluvia. Intenta escuchar los sonidos de la naturaleza entre los ruidos de la ciudad.&nbsp;</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Pasea por la naturaleza. </strong>Un paseo por el campo, el bosque, la monta&ntilde;a, la playa o un parque te permite conectar con la naturaleza, de vez en cuando prioriza este plan en tu tiempo libre. Intenta aparcar tus pensamientos y prestar atenci&oacute;n a tu entorno. Contempla las diferentes tonalidades de la tierra y de las plantas y &aacute;rboles. Abre tus sentidos a las sensaciones, olores y sonidos. Si puedes, incluso camina un rato descalzo. Experimenta la temperatura, nivel de humedad y textura del suelo.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Sum&eacute;rgete en la naturaleza. </strong>Sea en un parque, un bosque, una monta&ntilde;a o una playa, detente un rato. Si&eacute;ntate y sum&eacute;rgete en lo que te rodea. Impr&eacute;gnate de las sensaciones visuales, auditivas, olfativas y t&aacute;ctiles. Inspira los olores caracter&iacute;sticos de la estaci&oacute;n: el olor a tierra, a plantas y &aacute;rboles, a arena y mar, etc&eacute;tera. Agudiza el o&iacute;do para escuchar los animales que te rodean: p&aacute;jaros, insectos, ardillas o lo que sea. Mira hacia todos los lados. Luego c&eacute;ntrate en algo en concreto y obs&eacute;rvalo con mucha atenci&oacute;n: la hierba, una planta, una flor o un &aacute;rbol. T&oacute;mate tiempo para contemplar y apreciarlo.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Practica deporte al aire libre. </strong>Es otra manera de conectar con la naturaleza. Puedes salir a correr, montar en bicicleta o patinar. Pero tambi&eacute;n te puedes apuntar a grupos que practican crossfit, yoga, taichi&nbsp; al aire libre. Tambi&eacute;n puedes practicar senderismo, monta&ntilde;ismo, nataci&oacute;n, buceo o montar a caballo por ejemplo aunque sea puntualmente.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Saca tu lado creativo. </strong>&iquest;Te gusta dibujar o pintar? Entonces sal al exterior y si&eacute;ntate a plasmar tu entorno sobre papel. Si prefieres la fotograf&iacute;a, aprecia la naturaleza inmortalizando el paisaje con tu m&oacute;vil o c&aacute;mara. Otras ideas pueden ser recolectar hojas o casta&ntilde;as para hacer manualidades con tus hijos. O salir al bosque a buscar bayas o setas para despu&eacute;s cocinar un sabroso plato o preparar un pastel delicioso.</span></p>\r\n</div>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> Hay mucho tipos de naturaleza. &iquest;Eres m&aacute;s de playa o de monta&ntilde;a? &iquest;De paisajes ex&oacute;ticos o de campo? Te animamos a que realices este divertido juego para llegar a tu lugar ideal de la naturaleza.</span></p>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"CONECTA CON LA NATURALEZA\" src=\"https://view.genial.ly/6389195dcb423d001918d455\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">Un gran n&uacute;mero de estudios ha demostrado que pasar tiempo en la naturaleza mejora la salud f&iacute;sica, el bienestar mental y la felicidad.</p>\r\n<p style=\"text-align: justify;\">Por otro lado, algunas de las experiencias m&aacute;s asombrosas de nuestra vida ocurren cuando estamos inmersos en la naturaleza. Por ello es tan importante que nos involucremos en preservar la naturaleza, no solo por nosotros, sino tambi&eacute;n por las generaciones futuras y por todo lo que les queda por vivir.</p>\r\n<p style=\"text-align: justify;\">Volver a conectar con la naturaleza no es un capricho, sino una necesidad vital para cualquier persona que desea sentirse bien consigo misma tanto a nivel f&iacute;sico, como psicol&oacute;gico y emocional.</p>\r\n<p style=\"text-align: justify;\">&iexcl;Hoy ha premio! Entre todos los que particip&eacute;is en el desaf&iacute;o de hoy sortearemos una escapada de turismo rural para dos personas, para poder disfrutar y conectar de la naturaleza. &iquest;Ser&aacute;s t&uacute; el ganador? Tienes todo el d&iacute;a para participar.&nbsp;</p>\r\n<h4>DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy te desafiamos a que compartas tu rinc&oacute;n favorito de la naturaleza, aquel lugar en el que te olvidas de todas tus preocupaciones y en el que te sientes totalmente conectado con ella. Puedes compartir una foto y el nombre del lugar.</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/fotosgifs-calendario-13.png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img src=\"../../../../storage/files/uploads/turismo-rural-premio.jpg\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n</div>','2022-11-17 07:47:05','2023-12-04 15:21:01'),(49,60,'fr','','','','','','2022-11-17 07:47:05','2022-11-17 07:47:05'),(50,61,'en','Read everyday','<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">For many people, reading is a regular habit and a simple pleasure. They may not be aware that the benefits of reading and its impact on personal development are quite astonishing, and are endorsed by science.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Reading lets us escape the stresses of everyday life, in addition to which <strong>recent studies have even concluded that&nbsp;reading books can increase our life expectancy.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">This may seem to be an exaggeration, but what is undeniable is the feeling of escape, disengagement and freedom you feel when deeply immersed in a book.</span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">Reading lets us escape the stresses of everyday life, in addition to which <strong>recent studies have even concluded that&nbsp;reading books can increase our life expectancy.</strong></p>\r\n<p style=\"text-align: justify;\">Not only that, but reading liberates us, in addition to dispelling boredom, making us smarter, encouraging personal and professional development, promoting conversation and relationships, and unleashing emotions. It is a great way of maintaining a healthy, inquiring mind and providing an antidote to loneliness.</p>\r\n<p style=\"text-align: justify;\"><strong>In this respect, reading is like taking your brain to the gym. </strong>In this particular gym, the brain finds various machines and exercises to strengthen it and make it develop a variety of surprising skills. Indeed, different types of scientific studies have shown the benefits of this mental training.</p>\r\n<p style=\"text-align: justify;\">Unfortunately, reading often takes a back seat to other tasks or recreational options. How many times have you meant to pick up a book and decided to scroll through your smartphone first? And then, without realizing it, any time you had for reading has vanished.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Reading a book can be considered one of life\'s greatest pleasures.</p>\r\n<p style=\"text-align: justify;\">Today we would like you to make the following reflection. Are you reading enough? If not, it\'s a good resolution to incorporate in this coming year, don\'t you think?</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Reading opens the doors to knowledge and gives wings to inspiration and imagination</h2>\r\n<p style=\"text-align: justify;\">In addition to feed the imagination and encourage concentration, reading helps to improve some social skills, such as empathy. An avid fast reader learns to identify with the characters in the stories he or she reads and is therefore more willing to open up to other lives.</p>\r\n<p style=\"text-align: justify;\">But not only are readers more empathetic, they are also better speakers. Far from the solitary and introverted image with which the reader is identified, the truth is that readers develop their communication skills. By enriching their vocabulary and improving their syntax and grammar, they learn to speak properly and fairly.</p>\r\n<p style=\"text-align: justify;\">With all this information we hope to encourage you to make reading more present in your life. In order to achieve this, we suggest that you set yourself an ambitious but achievable goal. How about reading a book a month? It would be a good idea to start organizing and informing yourself about which books you will put on the list.</p>\r\n<p style=\"text-align: justify;\">Some people find it more stimulating to listen to a story instead of reading it, and some even say that it allows them to reach a higher level of connection and concentration.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we encourage you to reflect on how to incorporate reading into your routine (if you don\'t already) and we also encourage you to listen to this audio of the story \"The Spirit of Christmas Past\" by Charles Dickens to familiarize yourself with the practice of reading through listening.</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-8.png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/learn.png\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n</div>\r\n<p><iframe style=\"border-radius: 12px;\" src=\"https://open.spotify.com/embed/show/5BOc1U7tKiNyIMrtDlrkRZ?utm_source=generator&amp;theme=0\" width=\"100%\" height=\"352\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\" loading=\"lazy\"></iframe></p>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">Do not forget that the good reader is the one who does not vocalize and is able to grasp three or more words with a single glance, and therefore can grasp the meaning of the words based on the context.</p>\r\n<p style=\"text-align: justify;\">The fast reader can read very quickly without compromising the perfect interpretation of the words and comprehension of the text, and this is a skill that can be learned and trained.</p>\r\n<p style=\"text-align: justify;\">There is no doubt that one way to improve your reading speed is to practice. If you have accepted the resolution we have proposed for today, in the coming year you are going to practice reading considerably. Do you already know which books you are going to read?</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">We suggest that you share on the wall some of your favorite books, indicate the title, the author and if you want to explain something else, such as why you liked it so much, this way you can inspire some of your colleagues to create their own list.</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/77.png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-17 07:47:48','2022-12-09 10:16:53'),(51,61,'es','Lee cada día','<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Para muchas personas la lectura es un h&aacute;bito y un acto de mero placer. Quiz&aacute;s no sean conscientes de que los beneficios de leer y su impacto en el desarrollo de sus vidas son m&aacute;s que sorprendentes adem&aacute;s de respaldados por la ciencia.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">La lectura nos permite escapar de las tensiones cotidianas, pero adem&aacute;s cada vez m&aacute;s investigaciones est&aacute;n descubriendo algunos beneficios muy reales para la salud y el bienestar. <strong>Estudios recientes han concluido incluso que&nbsp;leer libros puede aumentar nuestra vida &uacute;til.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Puede que parezca exagerada esta sentencia, lo que resulta innegable es la sensaci&oacute;n de evasi&oacute;n, desconexi&oacute;n y libertad que se siente cuando uno est&aacute; totalmente inmerso en la lectura.</span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">La lectura nos permite escapar de las tensiones cotidianas, pero adem&aacute;s cada vez m&aacute;s investigaciones est&aacute;n descubriendo algunos beneficios muy reales para la salud y el bienestar. <strong>Estudios recientes han concluido incluso que&nbsp;leer libros puede aumentar nuestra vida &uacute;til.</strong></p>\r\n<p>Y no solamente eso, sino que la lectura nos hace libres, adem&aacute;s de combatir el aburrimiento, nos hace m&aacute;s inteligentes, fomenta el desarrollo personal y profesional, favorece la conversaci&oacute;n y las relaciones, libera emociones; es el ejercicio para mantener un cerebro sano y animado, adem&aacute;s de ser un ant&iacute;doto contra la soledad.</p>\r\n<p>As&iacute; es,<strong> leer es como llevar nuestro cerebro a un gimnasio. </strong>All&iacute; el cerebro encuentra diversas m&aacute;quinas y ejercicios que lo fortalecen y hace que desarrolle una variedad de habilidades sorprendentes.&nbsp;De hecho, la ciencia ha probado a trav&eacute;s de diferentes tipos de estudios los beneficios de este entrenamiento mental.</p>\r\n<p style=\"text-align: justify;\">Lamentablemente la lectura es muchas veces sustituida por otras tareas u opciones de entretenimiento. &iquest;Cu&aacute;ntas veces has querido coger un libro y has dicho voy a ojear primero un poco el m&oacute;vil? Y sin darte cuenta, el tiempo que ten&iacute;as para la lectura se esfum&oacute;.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Leer un libro puede considerarse como uno de los mayores actos placenteros de la vida.</p>\r\n<p style=\"text-align: justify;\">Hoy nos gustar&iacute;a que hicieras la siguiente reflexi&oacute;n. &iquest;Est&aacute;s leyendo suficiente? Sino es as&iacute;, es un buen prop&oacute;sito para incorporar en este a&ntilde;o que est&aacute; por llegar. &iquest;No crees?</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Leer abre las puertas del conocimiento y da alas a la inspiraci&oacute;n e imaginaci&oacute;n</h2>\r\n<p style=\"text-align: justify;\">Adem&aacute;s de alimentar la&nbsp;imaginaci&oacute;n&nbsp;y favorecer la concentraci&oacute;n, la lectura ayuda a mejorar algunas habilidades sociales, como la empat&iacute;a. Un &aacute;vido lector r&aacute;pido aprende a identificarse con los&nbsp;personajes&nbsp;de las historias que lee y por tanto est&aacute; m&aacute;s dispuesto a abrirse a otras vidas.</p>\r\n<p style=\"text-align: justify;\">Pero no s&oacute;lo es m&aacute;s emp&aacute;tico quien lee, sino tambi&eacute;n mejor&nbsp;orador. Lejos de la imagen solitaria e introvertida con la que se identifica al lector, lo cierto es que las personas lectoras desarrollan m&aacute;s sus habilidades comunicativas. Al enriquecer el vocabulario y mejorar la sintaxis y la gram&aacute;tica; aprenden a hablar adecuada y justamente.</p>\r\n<p style=\"text-align: justify;\">Con toda esta informaci&oacute;n esperamos haberte animado a que la lectura est&eacute; m&aacute;s presente en tu vida. Para poder cumplirlo, te proponemos que te marques un objetivo ambicioso pero alcanzable &iquest;Qu&eacute; tal si te propones leer un libro al mes? Para ello estar&iacute;a bien que comiences a organizarte e informarte sobre qu&eacute; libros pondr&aacute;s en la lista.</p>\r\n<p style=\"text-align: justify;\">Tambi&eacute;n puedes pasarte a los audiolibros, es una buena alternativa. Hay quienes les resulta m&aacute;s estimulante escuchar una historia en lugar de leerla, incluso hay quienes dicen que les permite alcanzar un mayor nivel de conexi&oacute;n y concentraci&oacute;n.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy te animamos a que reflexiones acerca de c&oacute;mo incorporar la lectura en tu rutina (si es que no lo haces ya) y adem&aacute;s te animamos a que escuches este audio del cuento de &ldquo;El esp&iacute;ritu de las navidades pasadas&rdquo; de Charles Dickens para que te familiarices tambi&eacute;n con practicar la lectura a trav&eacute;s de la escucha.</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-8.png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/learn.png\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n</div>\r\n<p><iframe style=\"border-radius: 12px;\" src=\"https://open.spotify.com/embed/episode/2iildjvaXqBvWojk3dyuay?utm_source=generator&amp;theme=0\" width=\"100%\" height=\"352\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\" loading=\"lazy\"></iframe></p>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">No olvides que el buen lector es el que, no vocaliza y es capaz de captar tres o m&aacute;s palabras con un s&oacute;lo golpe de vista, y que por tanto puede captar el significado de las palabras apoy&aacute;ndose en el contexto.</p>\r\n<p style=\"text-align: justify;\">El lector r&aacute;pido puede leer con gran rapidez sin que peligre la perfecta interpretaci&oacute;n de las palabras y la comprensi&oacute;n del texto y &eacute;sta es una capacidad que se puede aprender y entrenar.</p>\r\n<p style=\"text-align: justify;\">Sin duda una manera de mejorar la velocidad de lectura es practicando. Si has aceptado el prop&oacute;sito que te hemos propuesto para hoy en el a&ntilde;o que viene vas a practicar considerablemente la lectura. &iquest;Sabes ya qu&eacute; libros vas a leer?</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Te proponemos que compartas en el muro alguno de tus libros favoritos, indica el t&iacute;tulo, el autor y si quieres explica algo m&aacute;s, como por ejemplo porqu&eacute; te gust&oacute; tanto, de esta manera podr&aacute;s inspirar a alguno/a de tus compa&ntilde;eros/as a crear su propia lista.</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/77.png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-17 07:47:48','2023-12-11 21:49:18'),(52,61,'fr','','','','','','2022-11-17 07:47:48','2022-11-17 07:47:48'),(53,62,'en','Discover who you are','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size: 12pt;\">Self-knowledge is the key and essential tool when we talk about achieving our goals, purposes and materializing personal desires.</span></strong></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Many of us face continuous changes in our personal and professional lives. In our search for wellness and internal growth, we can rethink many things. Especially those that allow us to know ourselves and orient ourselves towards what satisfies us and what we do best.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Knowing the objectives we have and the tools to achieve them is the first step to achieve what we set out to do.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Many of us face continuous changes in our personal and professional lives. In our search for wellness and internal growth, we can rethink many things. Especially those that allow us to know ourselves and orient ourselves towards what satisfies us and what we do best.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Self-knowledge is a vital process for every human being, as it is a key element to promote our own well-being and personal growth. </strong>For example, it allows us to recognize what we are doing well and what aspects we can improve; it also helps us to recognize what we want and go for it.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>It is also key to increasing our personal self-esteem, </strong>as it helps us to clearly appreciate our strengths and act with authenticity. Those who know themselves, consider themselves a priority and act according to their true selves.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Self-knowledge helps us to recognize the limiting beliefs that we have internalized from society, question them and change them for affirmations that favor our personal development.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/fotos-1080-x-810-18.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n<div class=\"col-md-12\">&nbsp;</div>\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>\"Of all possible knowledge, the most wise and useful is to know yourself\" -William Shakespeare-</h2>\r\n<p style=\"text-align: justify;\">On many occasions, answering the question \"who am I? can be extremely difficult. We feel that we know ourselves and know everything about ourselves, but the truth is that we rarely stop to think and reflect on ourselves and connect with our true selves.</p>\r\n<p style=\"text-align: justify;\">We are rarely taught the importance of self-knowledge and what techniques to use to know ourselves better. That is why, below, we leave you 6 tools to achieve self-knowledge:</p>\r\n<p style=\"text-align: justify;\"><strong>1. Who I am. </strong>This exercise allows you to see who you are at this moment, the present moment, and who you want to become. Write on a sheet of paper who you are, on another one who you want to become and on the last one how you are going to do it. This will help you to bring to consciousness important aspects of our self that often go unrecognized.</p>\r\n<p style=\"text-align: justify;\"><strong>2. The life line. </strong>This tool consists of drawing a horizontal line that represents your life. Once created, the first thing you should do is to mark the middle point that will represent \"the now\". Then, in the left section, begin to include the different situations and experiences you have lived in the past. In this way, you will be aware of those things that are relevant in your life. Then, complete the future part in the right section of the line, pointing out your nearest and farthest goals in time. At the end of this task, reflect on what you have experienced and how you plan to achieve and attain the goals you have set for your future.</p>\r\n<p style=\"text-align: justify;\"><strong>3. Keep an emotion diary. </strong>Listening to our emotions can provide us with many details about ourselves. Knowing which emotions are the most recurrent in your daily life or their origin, being aware of your own emotional state can provide you with greater self-knowledge in any area of your life you wish.</p>\r\n<p style=\"text-align: justify;\"><strong>4. Practice mindfulness. </strong>This practice improves attention, decision making, motivation, emotion management and memory, very useful aspects when we talk about self-knowledge. But beyond all this, regular practice provides a space of connection with ourselves that, with the pace of life we lead, is often difficult to find.</p>\r\n<p style=\"text-align: justify;\"><strong>5. Letters to yourself. </strong>Letters to yourself are also an excellent tool to get to know yourself better. They promote a deep internal dialogue that allows you to connect with your own existence, your most genuine desires and with other aspects of yourself that you have not dared to externalize. If you prefer, you can write them down from time to time and, at a certain point, reread them. In this way, you will be able to observe your evolution as a person and continue projecting yourself.</p>\r\n<p style=\"text-align: justify;\"><strong>6. Travel alone. </strong>Generally, routine invites us to prioritize daily chores and connection with others. So we leave aside spaces to be alone and connect with ourselves. Therefore, traveling alone is an opportunity to enjoy our own company and reflect on our own existence.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Now we encourage you to reflect on these tips, also to put into practice some of these tools. Draw the line of your life, start a diary of emotions... adopt the initiative with which you feel more comfortable. Also play this fun game to find out which personality best suits yours.</p>\r\n</div>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"DESCUBRE QUI&Eacute;N ERES\" src=\"https://view.genial.ly/639214c8261e8a00190c2fad\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Self-knowledge takes time</h2>\r\n<p style=\"text-align: justify;\">Finally, we would like to emphasize that self-knowledge requires time, patience and perseverance. We cannot expect to know everything about ourselves in a few days. In fact, there are many unconscious realities that influence our way of being, and to become aware of them requires a lot of introspection.</p>\r\n<p style=\"text-align: justify;\">We are beings that are constantly changing, each time new fears, beliefs, motivations and concerns that force us to review and reflect in order to understand appear. Knowing oneself is an art that never ends, but it bears much fruit as long as we do not abandon it.</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we challenge you to share with your peers that trait of your personality that you are most proud of. Are you a Passionate? Creative? Fun?... Don\'t be shy, tell us about it!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-9.png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-17 07:51:37','2022-12-16 09:52:32'),(54,62,'es','Descubre quién eres','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size: 12pt;\">El autoconocimiento es la herramienta clave y esencial cuando hablamos de conseguir nuestras metas, prop&oacute;sitos y materializar los deseos personales.</span></strong></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Somos muchos los que nos enfrentamos a cambios continuos en nuestra vida personal y profesional. Dentro de nuestra b&uacute;squeda de bienestar y crecimiento interior, podemos replantearnos muchas cosas.&nbsp;Sobre todo aquellas que nos permiten conocernos a nosotros mismos y orientarnos hacia lo que nos satisface y mejor sabemos hacer.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Conocer los objetivos que tenemos y las herramientas para conseguirlos es el primer paso para lograr lo que nos propongamos.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Somos muchos los que nos enfrentamos a cambios continuos en nuestra vida personal y profesional. Dentro de nuestra b&uacute;squeda de bienestar y crecimiento interior, podemos replantearnos muchas cosas.&nbsp;Sobre todo aquellas que nos permiten conocernos a nosotros mismos y orientarnos hacia lo que nos satisface y mejor sabemos hacer.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>El autoconocimiento es un proceso vital para todo ser humano, pues es un elemento clave para propiciar nuestro propio bienestar y crecimiento personal.</strong> Por ejemplo, nos permite reconocer qu&eacute; estamos haciendo bien y qu&eacute; aspectos podemos mejorar; as&iacute; como tambi&eacute;n nos ayuda a reconocer lo que queremos e ir por ello.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Asimismo, es clave para potenciar la autoestima,</strong> pues nos ayuda a apreciar claramente nuestras fortalezas y a actuar con autenticidad. Aquel que se conoce a s&iacute; mismo, se considera una prioridad y act&uacute;an en funci&oacute;n de su verdadero yo.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Por su parte, el autoconocimiento nos ayuda a reconocer las creencias limitantes que hemos interiorizado de la sociedad, cuestionarlas y cambiarlas por afirmaciones que favorezcan nuestro desarrollo personal. </span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/fotos-1080-x-810-18.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n<div class=\"col-md-12\">&nbsp;</div>\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>&ldquo;De todos los conocimientos posibles, el m&aacute;s sabio y &uacute;til es conocerse a s&iacute; mismo&rdquo;&nbsp;-William Shakespeare-</h2>\r\n<p style=\"text-align: justify;\">En muchas ocasiones, responder a la pregunta &iquest;qui&eacute;n soy? puede resultar sumamente dif&iacute;cil. Sentimos que nos conocemos y sabemos todo acerca de nosotros, pero lo cierto es que muy pocas veces nos detenemos a pensar y reflexionar sobre nosotros mismos, y conectar con nuestro verdadero yo.</p>\r\n<p style=\"text-align: justify;\">Y es que rara vez nos ense&ntilde;an la importancia del autoconocimiento y qu&eacute; t&eacute;cnicas utilizar para conocernos mejor. Es por ello que, a continuaci&oacute;n, te dejamos 6 herramientas para alcanzar el autoconocimiento:</p>\r\n<p style=\"text-align: justify;\"><strong>1. Qui&eacute;n soy.</strong> Este ejercicio te permite ver qui&eacute;n eres en este momento, el momento actual, y qui&eacute;n quieres llegar a ser. Plasma en una hoja qui&eacute;n eres, en otra qui&eacute;n deseas llegar a ser y en la &uacute;ltima c&oacute;mo vas a hacerlo. Esto te servir&aacute; para traer a la conciencia aspectos importantes de nuestro yo que muchas veces pasan desapercibidas.</p>\r\n<p style=\"text-align: justify;\"><strong>2. La l&iacute;nea de la vida.</strong> Esta herramienta consiste en dibujar una l&iacute;nea horizontal que represente tu vida. Una vez creada, lo primero que deber&aacute;s hacer es marcar el punto medio que representar&aacute; &ldquo;el ahora&ldquo;. Seguidamente, en la secci&oacute;n izquierda, comienza a incluir las diferentes situaciones y experiencias que hayas vivido en el pasado. As&iacute;, podr&aacute;s ser consciente de aquellas cosas que relevantes en tu vida. Posteriormente, complementa la parte del futuro en la secci&oacute;n derecha de la l&iacute;nea, se&ntilde;alando tus objetivos m&aacute;s cercanos y m&aacute;s alejados en el tiempo. Al finalizar esta tarea, reflexiona sobre lo que has vivido y sobre c&oacute;mo te planteas conseguir y alcanzar los objetivos marcados en tu futuro.</p>\r\n<p style=\"text-align: justify;\"><strong>3. Tener un diario de emociones.</strong> Escuchar nuestras emociones puede aportarnos muchos detalles sobre nosotros mismos. Conocer cu&aacute;les son las emociones que m&aacute;s se repiten en tu d&iacute;a a d&iacute;a o su origen; ser consciente de tu propio estado emocional puede facilitarte un mayor autoconocimiento en cualquier parcela de tu vida que desees.</p>\r\n<p style=\"text-align: justify;\"><strong>4. Practica el mindfulness.</strong> Esta pr&aacute;ctica mejora la atenci&oacute;n, la toma de decisiones, la motivaci&oacute;n, la gesti&oacute;n de las emociones y la memoria, aspectos muy &uacute;tiles cuando hablamos de autoconocimiento. Pero, m&aacute;s all&aacute; de todo esto, la pr&aacute;ctica regular propicia un espacio de conexi&oacute;n con nosotros mismos que, con el ritmo de vida que llevamos, muchas veces es dif&iacute;cil encontrar.</p>\r\n<p style=\"text-align: justify;\"><strong>5. Cartas a ti mismo.</strong> Las cartas a ti mismo tambi&eacute;n son una excelente herramienta para conocerte mejor. Pues propician un di&aacute;logo interno profundo que te permite conectar con tu propia existencia, tus deseos m&aacute;s genuinos y con los dem&aacute;s aspectos de ti mismo que no te has atrevido a exteriorizar. Si as&iacute; lo prefieres, puedes escribir estas cada cierto tiempo y, llegado a un punto, releerlas. As&iacute;, podr&aacute;s observar tu evoluci&oacute;n c&oacute;mo persona y seguir proyect&aacute;ndote.</p>\r\n<p style=\"text-align: justify;\"><strong>6. Viaja en solitario.</strong> Por lo general, la rutina nos invita a priorizar las labores diarias y la conexi&oacute;n con los otros. De manera que vamos dejando de lado espacios para estar a solas y conectar con nosotros mismos. Por ello, viajar solo es una oportunidad para disfrutar de nuestra propia compa&ntilde;&iacute;a y reflexionar sobre nuestra propia existencia.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Ahora te animamos a que reflexiones sobre estos consejos, tambi&eacute;n a qu&eacute; pongas en pr&aacute;ctica alguna de estas herramientas. Traza la l&iacute;nea de tu vida, comienza diario de emociones&hellip; adopta esa iniciativa con la que te sientas m&aacute;s c&oacute;modo. Adem&aacute;s realiza este divertido juego para saber qu&eacute; personalidad se adapta m&aacute;s a la tuya.</p>\r\n</div>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"DESCUBRE QUI&Eacute;N ERES ****EN****\" src=\"https://view.genial.ly/639b792876bdb10011ec4a48\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>El autoconocimiento requiere tiempo</h2>\r\n<p style=\"text-align: justify;\">Para finalizar, queremos resaltar que el autoconocimiento requiere tiempo, paciencia y constancia. No podemos pretender que en unos pocos d&iacute;as ya sepamos todo sobre nosotros. De hecho, hay muchas realidades inconscientes que influyen en nuestra forma de ser, y para darnos cuenta de ellas hace falta mucha introspecci&oacute;n.</p>\r\n<p style=\"text-align: justify;\">Somos seres que est&aacute;n en constante cambio, cada vez aparecen nuevos miedos, creencias , motivaciones e inquietudes que nos obligan a revisarnos y reflexionar para podernos comprender. Por lo que conocerse a uno mismo es un arte que no termina nunca, pero que da muchos frutos en la medida que no lo abandonamos.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy te retamos a que compartas con tus compa&ntilde;eros/as aquel rasgo de tu personalidad del que te sientas m&aacute;s orgulloso. Eres una persona &iquest;apasionada? &iquest;Creativa? &iquest;Divertida?&hellip; &iexcl;Cu&eacute;ntanoslo! Y para que vayamos conoci&eacute;ndonos un poco mejor antes de la fiesta de Navidad, &iexcl;Hazte un selfie con tus gafas corporativas y s&uacute;bela al muro!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/gafas-rayban-2.jpg\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-17 07:51:37','2023-12-14 21:10:37'),(55,62,'fr','','','','','','2022-11-17 07:51:37','2022-11-17 07:51:37'),(56,63,'en','Send good wishes from the heart','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">This is the time of year when we constantly hear people and ourselves wishing a happy new year left and right. It\'s a wonderful thing, but it can become mechanical if we don\'t focus on our intention to really be that happiness for others.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Paying attention to expressing those wishes in an honest way is a completely different experience, and will not only make you (and often the other person) feel better in the moment, but you will also be creating the building blocks for a happy and resilient brain in the long run.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Something as simple as wanting other people to be happy can have a big impact on our own happiness.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">This is the time of year when we constantly hear people and ourselves wishing a happy new year left and right. It\'s a wonderful thing, but it can become mechanical if we don\'t focus on our intention to really be that happiness for others.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Throughout our day we send many wishes, many of them mechanically, such as when you greet or say goodbye to someone or when you say \"bon appetit\" to a person who is enjoying their meal.</span></p>\r\n<p><span style=\"font-size: 12pt;\">You should keep this in mind:</span></p>\r\n<ul>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Wishing others well increases levels of empathy, connection and happiness while reducing anxiety.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The prefrontal cortex, associated with social behavior, is activated.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">By shifting your attention to others, you begin to reduce excessive preoccupation with yourself.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Wishing others well is an act of generosity, which in turn brings a number of positive effects.</span></li>\r\n</ul>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Love is the condition in which another person\'s happiness is essential to you.\"-Robert A. Heinlein-</h2>\r\n<p style=\"text-align: justify;\"><strong>The simple fact of projecting positive thoughts improves our brain chemistry, changes our internal dialogue </strong>and forces us to make that mental effort to open up a little more to others.</p>\r\n<p style=\"text-align: justify;\"><strong>Wishing others well and celebrating the triumphs of others is an exercise in wellness. It has nothing to do with ethical, moral, religious or spiritual principles.</strong> In reality, behind this expressed desire there is a psychological basis as valid as it is interesting, as explained by scientific studies.</p>\r\n<p style=\"text-align: justify;\">A study conducted by the University of Iowa with people suffering from anxiety and stress showed precisely this positive effect of thoughts. This group of people was trained to go for a 20-minute walk every day, during which psychologists asked them to try to experience <strong>kindness, calmness and well-being by simply wishing happiness to everyone they met along the way.</strong></p>\r\n<p style=\"text-align: justify;\">In this way, the simple fact of projecting on others an expressed desire for wellbeing and positivity, in turn, reverted to one\'s own wellbeing. The mind reduced the burden of worries and obsessive thoughts, <strong>the inner calm and the fact of focusing on a feeling of affection generated comfort and satisfaction.</strong></p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we encourage you to reflect on what you wish for others on a daily basis. Perform this same exercise, for a few minutes every day try to wish happiness to all those people you come across, consciously and fully.</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/fotosgifs-calendario-15.png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/51.png\" alt=\"\" width=\"420\" height=\"520\" /></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>To wish the good without looking at who</h2>\r\n<p style=\"text-align: justify;\">Today we want you to stop for a moment and learn to really feel the desires you express in your day-to-day life.</p>\r\n<p style=\"text-align: justify;\">Wishing for others to be happy, regardless of whether those who cross paths with them are complete strangers, increases our empathy and feelings of social connection. Suddenly, you will notice how you notice others\' faces more and how you open your external view.</p>\r\n<p style=\"text-align: justify;\">To wish good to others, to relax, to accept that each one is as he is and to wish him to be as happy as he can within his possibilities, takes away weights, sanitizes the mind and avoids useless hostilities.</p>\r\n<p style=\"text-align: justify;\">Therefore, that famous saying \'do good without looking at whom\', can also be rephrased as \'wish happiness without looking at whom\'. Because the simple fact of projecting positive thoughts improves our brain chemistry, changes the internal dialogue and forces us to make that mental effort to open up a little more to others.</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Let\'s put this simple health and human connection tip into practice. Today we encourage you to share the good wishes you want to share or wish your coworkers for 2023!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/bailar%20(3).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-17 07:52:33','2022-12-19 11:25:44'),(57,63,'es','Lanza buenos deseos','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Esta es la &eacute;poca en la que constantemente escuchamos a la gente y a nosotros mismos deseando un feliz a&ntilde;o a diestro y siniestro. Es algo maravilloso, pero puede volverse mec&aacute;nico si no nos centramos en nuestra intenci&oacute;n de realmente desear esa felicidad para los dem&aacute;s.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Prestar atenci&oacute;n al expresar esos deseos de una forma honesta es una experiencia completamente diferente, y no solo te har&aacute; sentir a ti (y a menudo a la otra persona) mejor en el momento, sino que tambi&eacute;n estar&aacute;s creando los componentes b&aacute;sicos para tener un cerebro feliz y resiliente a largo plazo.</span></p>\r\n<p>&nbsp;</p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Algo tan simple como desear que otras personas sean felices puede tener un gran impacto en nuestra propia felicidad.</span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Esta es la &eacute;poca en la que constantemente escuchamos a la gente y a nosotros mismos deseando un feliz a&ntilde;o a diestro y siniestro. Es algo maravilloso, pero puede volverse mec&aacute;nico si no nos centramos en nuestra intenci&oacute;n de realmente desear esa felicidad para los dem&aacute;s.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">A lo largo de nuestro d&iacute;a enviamos muchos deseos, muchos de ellos de forma mec&aacute;nica, como cu&aacute;ndo saludas&nbsp;o te despides de alguien o cuando dices &iexcl;que aproveche! a una persona que est&aacute; disfrutando de su comida.</span></p>\r\n<p><span style=\"font-size: 12pt;\"> Conviene que tengas esto en cuenta:</span></p>\r\n<ul>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Desear bien a los dem&aacute;s aumenta los niveles de empat&iacute;a, conexi&oacute;n y felicidad a la vez que reduce la ansiedad.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Se activa la corteza prefrontal, asociada con el comportamiento social.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Al cambiar tu atenci&oacute;n hacia los dem&aacute;s, comienzas a reducir la preocupaci&oacute;n excesiva contigo mismo.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Desearle bien a los dem&aacute;s es un acto de generosidad, que a su vez trae una serie de efectos positivos.</span></li>\r\n</ul>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>&ldquo;El amor es la condici&oacute;n en que la felicidad de otra persona es esencial para ti&rdquo;-Robert A. Heinlein-</h2>\r\n<p style=\"text-align: justify;\"><strong>El simple hecho de proyectar pensamientos positivos mejora nuestra qu&iacute;mica cerebral, cambia el di&aacute;logo interno</strong> y nos obliga a hacer ese esfuerzo mental con el que abrirnos un poco m&aacute;s a los dem&aacute;s.</p>\r\n<p style=\"text-align: justify;\"><strong>Desear el bienestar ajeno y celebrar los triunfos de los dem&aacute;s es un ejercicio de bienestar.</strong> No tiene nada que ver con principios &eacute;ticos, morales, religiosos o espirituales. En realidad, detr&aacute;s de este deseo expreso hay una base psicol&oacute;gica tan v&aacute;lida como interesante que nos explican los estudios cient&iacute;ficos.</p>\r\n<p style=\"text-align: justify;\">Un estudio realizado por la Universidad de Iowa con personas que sufr&iacute;an de ansiedad y de estr&eacute;s, demostr&oacute; precisamente este efecto positivo de los pensamientos. Este grupo de personas fue entrenado para salir a caminar cada d&iacute;a durante 20 minutos, a lo largo de esta caminata los psic&oacute;logos les pidieron que intentaran experimentar bondad, calma y bienestar. <strong>Para ello&nbsp;se les pidi&oacute; simplemente que desearan felicidad a todas aquellas personas con las que se cruzaran por el camino.</strong></p>\r\n<p style=\"text-align: justify;\">As&iacute;, el simple hecho de proyectar en los otros un deseo expreso de bienestar y positividad revert&iacute;a a su vez en su propio bienestar. La mente reduc&iacute;a la carga de preocupaciones y pensamientos obsesivos. <strong>La calma interna y el hecho de focalizarse en un sentimiento de afecto, generaba confort y satisfacci&oacute;n.</strong></p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy te animamos a que reflexiones acerca de lo que les deseas a los dem&aacute;s a diario. Realiza este mismo ejercicio, durante unos minutos cada d&iacute;a intenta desear felicidad a todas aquellas personas con las que te cruces, de manera consciente y plena.</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/fotosgifs-calendario-15.png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/51.png\" alt=\"\" width=\"420\" height=\"520\" /></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Desear el bien sin mirar a quien</h2>\r\n<p style=\"text-align: justify;\">Hoy queremos que te pares por un instante y aprendas a sentir realmente los deseos que expresas en tu d&iacute;a a d&iacute;a.</p>\r\n<p style=\"text-align: justify;\">Desear que los dem&aacute;s sean felices, sin importar que quienes se cruzaran ante ellos fuera unos completos desconocidos, aumenta nuestra empat&iacute;a y los sentimientos de conexi&oacute;n social. De pronto,&nbsp;ver&aacute;s como te fijas m&aacute;s en los rostros ajenos y c&oacute;mo abres tu mirada exterior.</p>\r\n<p style=\"text-align: justify;\">Desear el bien a los dem&aacute;s, relaja, aceptar que cada cual es como es y desearle que sea todo lo feliz que pueda dentro de sus posibilidades, nos quita pesos, higieniza la mente y evita hostilidades in&uacute;tiles.</p>\r\n<p style=\"text-align: justify;\">Por tanto, ese famoso refr&aacute;n de &lsquo;haz el bien sin mirar a quien&lsquo;, tambi&eacute;n puede reformularse como &lsquo;desea felicidad sin mirar a quien&rsquo;. Porque el simple hecho de proyectar pensamientos positivos mejora nuestra qu&iacute;mica cerebral, cambia el di&aacute;logo interno y nos obliga a hacer ese esfuerzo mental con el que abrirnos un poco m&aacute;s a los dem&aacute;s.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Pongamos en pr&aacute;ctica este sencillo consejo de salud y conexi&oacute;n humana. &iexcl;Hoy te animamos a que compartas los buenos deseos que quieres compartir o desear a tus compa&ntilde;eros/as de trabajo para el 2024!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/bailar%20(3).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-17 07:52:33','2023-12-20 08:35:16'),(58,63,'fr','','','','','','2022-11-17 07:52:33','2022-11-17 07:52:33'),(59,27,'es','Busca la manera de ayudar a los demás','<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>La Navidad</strong>&nbsp;es la &eacute;poca del a&ntilde;o m&aacute;s familiar, unos d&iacute;as muy especiales en los que nos hinchamos a comer y recibimos regalos por doquier. Por fin llegan las comidas de empresa, las reuniones de amigos, Pap&aacute; Noel y los Reyes Magos, el amigo invisible, los polvorones y los villancicos. Sin embargo,&nbsp;<strong>no todos tienen la suerte de poder disfrutar estas fechas tan se&ntilde;aladas como deber&iacute;an</strong>. Por ello, la Navidad nos invita a mirar m&aacute;s all&aacute; de debajo del &aacute;rbol y a sacar nuestra generosidad.</span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">La solidaridad es, realmente, la base de la sociedad, teniendo en cuenta que cuid&aacute;ndonos unos a otros podemos sobrevivir. Sin embargo, muchas veces suele pasar desapercibida o no ocupar tanto espacio en nuestras vidas debido a todas las ocupaciones y temas a resolver que solemos tener.</p>\r\n<p style=\"text-align: justify;\">Hay muchas maneras de ser solidario, pero, &iquest;por qu&eacute; es necesario ser solidario?</p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><strong>Aporta ventajas emocionales:</strong>&nbsp;Ayudar a los dem&aacute;s implica un beneficio para las personas. Aumenta la&nbsp;empat&iacute;a,&nbsp;la&nbsp;positividad&nbsp;y la&nbsp;sociabilidad.</li>\r\n<li style=\"text-align: justify;\"><strong>Luchas por una causa:</strong>&nbsp;Seguir una causa e involucrarte en su consecuci&oacute;n har&aacute; que vivas m&aacute;s de cerca esa realidad y logres aportar tu grano de arena en aquello en lo que crees.</li>\r\n<li style=\"text-align: justify;\"><strong>Das algo de vuelta a la sociedad:</strong>&nbsp;Revierte tus conocimientos y experiencias en ense&ntilde;ar o dar algo, de esa forma estar&aacute;s contribuyendo a devolver lo que otros te han dado de manera altruista.</li>\r\n</ol>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>La acci&oacute;n m&aacute;s peque&ntilde;a vale m&aacute;s que la intenci&oacute;n m&aacute;s grande</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">No existe una &uacute;nica manera de ser solidario, de hecho, hay infinidad de opciones, pero lo m&aacute;s importante es que esta est&eacute; impl&iacute;cita en nuestra manera de actuar y de pensar. Cada d&iacute;a tomamos decisiones que pueden suponer un acto m&aacute;s o menos solidario en funci&oacute;n del camino que escojamos. </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Aqu&iacute; tienes algunas ideas e iniciativas para contribuir y llevar alegr&iacute;a a aquellos que m&aacute;s lo necesitan en estas fechas tan importantes:</span></p>\r\n</div>\r\n<div class=\"col-md-12\" style=\"text-align: justify;\"><img src=\"../../../../storage/files/uploads/3%20(7).png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\" style=\"text-align: justify;\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Dona aquello que no utilices:</strong> Repasa tu casa de arriba abajo. Libros, ropa, juguetes&hellip;eso s&iacute;, revisa que est&eacute;n en buen estado y que vayan a hacer un buen uso en la persona que lo reciba.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Ofrece tu tiempo a quien lo necesite: </strong>M&aacute;s valioso que tu dinero, es tu tiempo, &iquest;no crees? Hay muchas asociaciones y ONGs que te agradecer&aacute;n un ratito de tu ayuda estas Navidades. Incluso puedes apuntarte a una organizaci&oacute;n en la que puedas ofrecer ayuda durante todo el a&ntilde;o y no solo en Navidad.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Contribuye a la causa de alguna ONG: </strong>Hay infinidad de ONGs, busca espec&iacute;ficamente aquella que se centra en lo que t&uacute; quieras aportar tu granito de arena.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Convi&eacute;rtete en un chef gourmet</strong>:&nbsp;Ve al supermercado y compra aquellos alimentos que se necesitan para hacer un buen men&uacute; de Navidad, despu&eacute;s tienes dos opciones: llev&aacute;rselo a quien consideres que lo necesita o preparar un men&uacute; de Navidad con todo tu cari&ntilde;o y llev&aacute;rselo a esa persona o familia que sepas que lo pueda necesitar. A veces los peque&ntilde;os gestos son los que marcan la diferencia.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Tarde de visitas: </strong>En la Navidad hay mucha gente que est&aacute; sola o se siente a&uacute;n m&aacute;s sola. Coge tu lista de contactos y ve a pasar una tarde con aquellas personas que sabes que necesitan un poco de compa&ntilde;&iacute;a o llama a ese amigo que sabes que no podr&aacute; pasar la Navidad con familia e inv&iacute;tale a compartir ese d&iacute;a tan especial contigo.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Juguetes solidarios: </strong>El juego es un derecho fundamental de la infancia. Jugando los ni&ntilde;os aprenden a construir el mundo del ma&ntilde;ana, un mundo mejor. Hay muchas entidades que recogen juguetes nuevos y se encargan de entregarlos a aquellas familias sin recursos para que llegue la ilusi&oacute;n de la Navidad a los m&aacute;s peque&ntilde;os.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Practica la solidaridad tambi&eacute;n en el trabajo:</strong> La solidaridad puede y debe aplicarse en nuestro d&iacute;a a d&iacute;a y por tanto tambi&eacute;n en nuestro trabajo, aqu&iacute; tienes algunos consejos para ponerla en pr&aacute;ctica:</span></p>\r\n<ul>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Desarrolla una actitud de mente abierta.</strong> Esto significa estar dispuestos a aceptar las diferencias en nuestras formas de trabajar, relacionarnos, entender el negocio, etc. As&iacute; ser&aacute; m&aacute;s f&aacute;cil que tengamos una mayor predisposici&oacute;n a apoyar a otros.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Comparte informaci&oacute;n con tus compa&ntilde;eros/as.</strong> Si el equipo comparte informaci&oacute;n, elevamos las posibilidades de ser m&aacute;s certeros en nuestras decisiones de negocio. Y a su vez, compartir informaci&oacute;n genera confianza y compromiso.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Aseg&uacute;rate de que tu comunicaci&oacute;n con los otros sea clara.</strong>&nbsp;Observa, escucha y, desde la empat&iacute;a, comprende qu&eacute; es lo que necesitan los otros de ti para lograr los objetivos del equipo. Cuando no est&eacute;is de acuerdo, trabaja tu relaci&oacute;n desde el respeto y la cooperaci&oacute;n.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Celebra y al&eacute;grate de los &eacute;xitos&nbsp;</strong>de tus compa&ntilde;eros de equipo de forma genuina.</span></li>\r\n</ul>\r\n</div>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Y para terminar te animamos a que reflexiones sobre este aspecto. Adem&aacute;s, te retamos a que realices este test y midas tu nivel de solidaridad, en que situaci&oacute;n te encuentras actualmente. Recuerda que el objetivo de los test es siempre el de hacernos reflexionar acerca de aquello que todav&iacute;a podemos mejorar.</span></p>\r\n<p><a class=\"btn btn-primary\" href=\"https://form.typeform.com/to/WOVB1bfU\">TEST</a></p>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Ayudar a otros es como ayudarte a ti mismo- Henry Flager</h2>\r\n<p style=\"text-align: justify;\">La Navidad est&aacute; relacionada con una serie de valores como la bondad, la amistad, la generosidad y la solidaridad, entre muchos otros. Esta &eacute;poca del a&ntilde;o es perfecta para hacer balance sobre el a&ntilde;o que est&aacute; a punto de terminar, as&iacute; como para plantearse nuevos prop&oacute;sitos de cara a a los pr&oacute;ximos 365 d&iacute;as.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy te desafiamos a que compartas con tus compa&ntilde;eros/as cu&aacute;l va a ser tu acto solidario de estas Navidades o del pr&oacute;ximo a&ntilde;o. Tambi&eacute;n puedes compartir una foto de la iniciativa que decidas adoptar. &iexcl;No olvides que la solidaridad es muy contagiosa y seguro que das buenas ideas a todos tus compa&ntilde;eros/as!</p>\r\n<p style=\"text-align: justify;\">&iexcl;Buen trabajo! &iexcl;Cada desaf&iacute;o superado nos acerca un poco m&aacute;s a nuestro objetivo final!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/fotosgifs-calendario.jpg\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-17 10:22:28','2023-12-11 19:42:35'),(60,26,'es','Deja que la Navidad invada tu hogar','<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Decorar es algo m&aacute;s que crear ambientes bonitos. Al elegir las formas, colores y sonidos que te rodean influyes sobre el cerebro de las personas que viven en tu casa. Puedes hacer que se sientan m&aacute;s seguras, protegidas y relajadas. O puedes estimular sus mentes para que alcancen todo su potencial creativo e intelectual. </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">El hogar, al fin y al cabo, es nuestro reducto en el mundo, y los objetos, muebles y elementos ornamentales que lo decoran uno de los rasgos que m&aacute;s dicen de nuestra personalidad.&nbsp; Lo cierto es que como tantas cosas en la vida, todo reside en los peque&ntilde;os detalles, por lo que m&aacute;s all&aacute; de mantener una limpieza adecuada de nuestros espacios &iacute;ntimos, tambi&eacute;n hay que atender a c&oacute;mo est&aacute; colocada cada cosa y el car&aacute;cter que le imprime a la estancia en general.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Para tener la cabeza \'bien amueblada\', no solo basta con cuidarnos f&iacute;sica y mentalmente, sino tambi&eacute;n tener bien dispuesto nuestro espacio habitable y zona de confort.</span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\"><strong>Decorar es algo m&aacute;s que crear ambientes bonitos. </strong>Al elegir las formas, colores y sonidos que te rodean influyes sobre el cerebro de las personas que viven en tu casa. Puedes hacer que se sientan m&aacute;s seguras, protegidas y relajadas. O puedes estimular sus mentes para que alcancen todo su potencial creativo e intelectual.</p>\r\n<p>Hoy te animamos a que reflexiones acerca de tu hogar. Sobre todo en un momento en el que seguramente est&eacute;s decorando o ambientando la casa con decoraci&oacute;n navide&ntilde;a, de hecho es un momento id&oacute;neo para reorganizar las cosas &iquest;No crees?</p>\r\n<p style=\"text-align: justify;\">No es una cuesti&oacute;n de metros cuadrados ni de si hace tiempo o no que est&aacute;s en tu actual residencia, es cierto que lo ideal es hacerse ciertas reflexiones cuando est&aacute;s a punto de realizar una obra o una reforma, pero a&uacute;n as&iacute;, existen muchas cosas que puedes hacer para convertirla en un espacio m&aacute;s acogedor y con m&aacute;s energ&iacute;a.</p>\r\n<p style=\"text-align: justify;\">Hoy te animamos a que le des una vuelta a ciertos aspectos de la decoraci&oacute;n y disposici&oacute;n de tu hogar.</p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>El espacio puede modificar tu mente</h2>\r\n<p><span style=\"font-size: 12pt;\">En unos d&iacute;as comienza un nuevo a&ntilde;o, se pone el contador a cero y volveremos a pasar muchas horas y muchos momentos en nuestro hogar, vale la pena dejarlo a nuestro gusto para que el tiempo que pasemos en &eacute;l sea lo m&aacute;s acogedor y agradable posible. &iquest;No crees?</span></p>\r\n<p><span style=\"font-size: 12pt;\">Queremos animarte a que reflexiones acerca de lo que podr&iacute;as hacer en tu hogar para convertirlo en un lugar a&uacute;n mejor, elabora una lista de aquello que querr&iacute;as mejorar:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Aqu&iacute; tienes algunas ideas&hellip;</span></p>\r\n</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/fotos-1080-x-810-2.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<ul>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> Cambiar la pintura de alguna estancia</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">A&ntilde;adir o cambiar un papel pintado</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> A&ntilde;adir o cambiar la iluminaci&oacute;n</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Incorporar algunos elementos decorativos como cestos, velas, una planta, un espejo&hellip;</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Vaciar la casa de cosas que no usas</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Cambiar alg&uacute;n mueble o redecorarlo</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Organizar mejor los armarios</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Cambiar los textiles, colchas, alfombras, cojines o cortinas</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Aprovechar alg&uacute;n espacio muerto y convertirlo en un espacio &uacute;til</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Ordenar alg&uacute;n espacio o una estanter&iacute;a demasiado llena</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> Cambiar o incorporar un nuevo aroma a tu hogar</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> Dedica unos d&iacute;as que est&eacute;s tranquilo/a en casa para ponerte m&uacute;sica, unas velas y pasear por la casa viendo qu&eacute; cosas o cambios podr&iacute;as hacer para encontrarte m&aacute;s a gusto en ella. No se trata de tirar las paredes abajo, a veces es cuesti&oacute;n de a&ntilde;adir unas velas, una alfombra o unos cojines nuevos. Los cambios si se hacen de manera adecuada pueden hacer que vuelva a fluir la energ&iacute;a en un lugar que parec&iacute;a que se hab&iacute;a quedado estancada. </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Te animamos a que hagas una lista de todo aquello que te gustar&iacute;a hacer a lo largo del a&ntilde;o que viene y poco a poco lo vayas cumpliendo en la medida en la que tu tiempo y tu econom&iacute;a te lo permitan.</strong></span></p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Y volviendo a la decoraci&oacute;n navide&ntilde;a, &iexcl;Divi&eacute;rtete con este juego y crea tu &aacute;rbol de Navidad!</p>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" src=\"https://view.genial.ly/6373bcd1153a0a001a554357\" width=\"1200px\" height=\"675px\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">&iquest;Has comenzado ya con la decoraci&oacute;n navide&ntilde;a? &iquest;Eres de los que colocan 4 detalles navide&ntilde;os o de los que decoran cada rinc&oacute;n de tu casa? &iquest;Te dejas llevar por lo que decidan tus hijos o por los adornos que has ido heredando a&ntilde;o tras a&ntilde;o o de los que marcas un estilo y eres fiel a &eacute;l? &iquest;Un estilo m&aacute;s tradicional o quiz&aacute;s m&aacute;s n&oacute;rdico o minimalista? &iquest;Eres de los que decoras la casa de una manera m&aacute;s sostenible o no tienes tan en cuenta la sostenibilidad en esta &eacute;poca del a&ntilde;o?</p>\r\n<p style=\"text-align: justify;\">Una cosa est&aacute; clara y es que una imagen vale m&aacute;s que mil palabras. &iquest;No crees?</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Comparte con tus compa&ntilde;eros/as una foto de tu casa ambientada de la Navidad. De esta manera seguro que sabemos mucho de tu manera de celebrar la Navidad, de tus gustos y costumbres. Si&eacute;ntete libre de explicarnos lo que quieras acerca de la foto. &iexcl;Seguro que sirves de inspiraci&oacute;n para alguno de tus compa&ntilde;eros/as!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><strong><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-2.png\" alt=\"\" width=\"420\" height=\"520\" /></strong>\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-18 07:31:45','2023-11-27 15:35:46'),(61,31,'es','Sigue jugando sin importar la edad que tengas','<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> El juego es una fuente de relajaci&oacute;n y estimulaci&oacute;n tanto para el cerebro como para el cuerpo, tanto para ni&ntilde;os como para adultos. Es una forma segura y divertida que permite desarrollar la imaginaci&oacute;n y la creatividad, as&iacute; como la capacidad de resolver problemas. <strong>Potencia el aprendizaje, ayuda a aliviar el estr&eacute;s y nos conecta con los dem&aacute;s y con el mundo que nos rodea.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Aunque el juego nos hace sentir m&aacute;s vivos, a menudo los adultos nos olvidamos de ello y no le prestamos atenci&oacute;n porque tenemos muchas cosas que hacer. Pero jugar no es un lujo, sino una necesidad. </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">De hecho,&nbsp;el juego es tan importante para nuestra salud f&iacute;sica y mental, como dormir lo suficiente, comer bien o hacer ejercicio. </span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">El juego es una fuente de relajaci&oacute;n y estimulaci&oacute;n tanto para el cerebro como para el cuerpo, tanto para ni&ntilde;os como para adultos. Es una forma segura y divertida que permite desarrollar la imaginaci&oacute;n y la creatividad as&iacute; como la capacidad de resolver problemas. <strong>Potencia el aprendizaje, ayuda a aliviar el estr&eacute;s y nos conecta con los dem&aacute;s y con el mundo que nos rodea.</strong></p>\r\n<p style=\"text-align: justify;\">Hemos heredado la creencia, seguramente de la sociedad industrializada, donde se supone que un individuo tiene valor por lo que hace, lo que produce; entonces cualquier actividad sin otro objetivo que el de divertir y distraer se considera una p&eacute;rdida de tiempo.&nbsp;Desde esta perspectiva, una persona realmente productiva y ocupada no tiene tiempo que desperdiciar en juegos de ni&ntilde;os.</p>\r\n<p style=\"text-align: justify;\"><em><strong>Sin embargo, jugar puede ayudarnos a sentirnos m&aacute;s cerca de los dem&aacute;s, a aliviar el estr&eacute;s, a conectarnos con los dem&aacute;s y con el mundo que nos rodea, tambi&eacute;n en el ambiente laboral, haciendo nuestro trabajo m&aacute;s productivo, placentero y cercano.</strong></em></p>\r\n<p style=\"text-align: justify;\">Deber&iacute;amos ser capaces de romper con antiguas creencias, darnos cuenta de todo lo que el juego puede hacer por nosotros y por nuestro propio bienestar. &iquest;Qu&eacute; opinas?</p>\r\n<p style=\"text-align: justify;\">Preg&uacute;ntate: &ldquo;&iquest;Cu&aacute;ndo fue la &uacute;ltima vez que te divertiste de verdad jugando a algo?&rdquo; Si no puedes encontrar una buena respuesta con rapidez, lo m&aacute;s probable es que sea debido a que ha pasado mucho tiempo desde que te tomaste un tiempo para ello.</p>\r\n</div>\r\n</div>','<div class=\"row\"><!-- Columna Izda inicio-->\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>\"No dejamos de jugar porque nos hacemos mayores. Nos hacemos mayores porque dejamos de jugar\" George Bernard</h2>\r\n<p style=\"text-align: justify;\">La oferta de juegos es infinita partiendo de la base de que hay muchos tipos de juegos. &iquest;Te has parado a pensar alguna vez qu&eacute; tipo de juego es el que m&aacute;s diversi&oacute;n y emoci&oacute;n te aporta? Seguramente guarde relaci&oacute;n con el tipo de jugador que eres.</p>\r\n<p style=\"text-align: justify;\">A principios de los 2.000 el ingl&eacute;s Richard Bartle estableci&oacute; una clasificaci&oacute;n de jugadores partiendo de dos ejes: La preferencia entre relacionarse con otros jugadores o hacerlo con el mundo del juego (eje relaci&oacute;n) y la preferencia entre acci&oacute;n o interacci&oacute;n (eje de competencia).</p>\r\n<p style=\"text-align: justify;\">Teniendo en cuenta este criterio estableci&oacute; 4 perfiles de jugadores. Los triunfadores, socializadores, killers o exploradores. Conoce un poco m&aacute;s lo que define a cada jugador para saber cu&aacute;l se acerca m&aacute;s a tu actitud frente al juego.</p>\r\n<p style=\"text-align: justify;\">Triunfadores: Prefieren relacionarse con el mundo del juego y la acci&oacute;n. Lo hacen cumpliendo objetivos y superando logros concretos. Son jugadores independientes y enfocados al &eacute;xito y a obtener un estatus dentro de la comunidad de luego.</p>\r\n<p style=\"text-align: justify;\">Exploradores: Les gusta relacionarse con el mundo del juego pero se enfocan a observar el propio juego, a descubrir los secretos y las maneras de ir mejorando. Son jugadores individualistas enfocados a la mejora y al aprendizaje continuo.</p>\r\n<p style=\"text-align: justify;\">Socializadores: Son jugadores que disfrutan de la interacci&oacute;n con otros miembros del juego y no tanto del propio juego en s&iacute;. Son buenos jugadores en equipo y les gusta colaborar y aportar as&iacute; como crear v&iacute;nculos con el resto de jugadores.</p>\r\n<p style=\"text-align: justify;\">Killers: Estos tambi&eacute;n disfrutan de la interacci&oacute;n con otros jugadores, pero al estar enfocados en la acci&oacute;n, su objetivo es la competici&oacute;n y no la colaboraci&oacute;n.</p>\r\n<p style=\"text-align: justify;\">Muchas veces la manera en la que nos comportamos a la hora de jugar guarda similitud con nuestra actitud a la hora de desarrollar nuestra actividad profesional.</p>\r\n<p style=\"text-align: justify;\"><!-- este es el separador de 10px--></p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Adem&aacute;s hoy te&nbsp; animamos a que realices este juego para averiguar los tipos de juegos que m&aacute;s encajan seg&uacute;n&nbsp; tu perfil de jugador.&nbsp;</p>\r\n</div>\r\n<!-- Columna Izda fin--> <!-- Columna Dch inicio-->\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/4%20(5).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/5%20(4).png\" alt=\"\" width=\"420\" height=\"520\" /></p>\r\n</div>\r\n<!-- Columna Izda fin--><!-- este es el separador de 10px--></div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"SIGUE JUGANDO **EN**\" src=\"https://view.genial.ly/637e67bb8341150012d04036\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Haz que la vida sea un juego que quieras volver a jugar</h2>\r\n<p style=\"text-align: justify;\">Ahora que ya sabes todos los beneficios que nos aporta el juego y cu&aacute;l es tu perfil de jugador. &iquest;Te has parado a pensar alguna vez qu&eacute; tipo de juego es el que m&aacute;s diversi&oacute;n y emoci&oacute;n te aporta? La oferta es infinita y muy variada.</p>\r\n<p style=\"text-align: justify;\">&iquest;Disfrutas jugando al aire libre o practicando alguna competici&oacute;n deportiva? Quiz&aacute;s seas de los que prefiere jugar en un ambiente m&aacute;s tranquilo fortaleciendo el pensamiento l&oacute;gico. Puede que lo que te haga disfrutar sean los juegos de estrategia. juegos cl&aacute;sicos o videojuegos. Como ves las opciones son muchas.&nbsp;</p>\r\n<p style=\"text-align: justify;\"><span class=\"\">&iexcl;Adem&aacute;s hoy tenemos premio! Entre todos los que particip&eacute;is en el desaf&iacute;o de hoy sortearemos este cl&aacute;sico juego de mesa.&nbsp;</span></p>\r\n<div class=\"\">\r\n<div class=\"\"><strong><span class=\"\" style=\"color: #212529;\"><span class=\"\">Ten&eacute;is todo el d&iacute;a para participar. El ganador ser&aacute; anunciado ma&ntilde;ana en el apartado de &ldquo;premios&rdquo;.&nbsp;</span></span></strong></div>\r\n<div class=\"\"><span class=\"\" style=\"color: #212529;\">&nbsp;</span></div>\r\n<div class=\"\"><span class=\"\" style=\"color: #212529;\">&iexcl;Mucha suerte!</span></div>\r\n</div>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy te animamos a que compartas con todos tus compa&ntilde;eros/as, tu juego o tu tipo de juegos preferido. Puedes acompa&ntilde;ar tus comentarios con fotos que lo hagan a&uacute;n m&aacute;s real.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n</div>\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/fotos-calendario-navidad.png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/monopoli.jpg\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n<!-- Columna Izda fin--><!-- este es el separador de 10px--></div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>','2022-11-18 07:34:37','2023-12-04 14:45:07'),(62,36,'es','Sueña en grande','<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Todos en esta vida tenemos sue&ntilde;os que nos gustar&iacute;a cumplir, ya sean peque&ntilde;os o grandes, pero constantemente deseamos algo que no tenemos y queremos conseguir.</span></p>\r\n<p><span style=\"font-size: 12pt;\">Tener identificados los sue&ntilde;os nos ayuda a enfocarnos m&aacute;s en lo que queremos. Son el combustible para hacernos llegar m&aacute;s lejos. Si te permites so&ntilde;ar sin l&iacute;mites,, tus posibilidades aumentan, ya que si centras toda tu energ&iacute;a, tiempo y dedicaci&oacute;n en conseguir tus sue&ntilde;os, esa energ&iacute;a estar&aacute; de vuelta y vas a conseguir todo lo que te propongas.</span></p>\r\n<p><span style=\"font-size: 12pt;\">El hecho de so&ntilde;ar en grande y de ser perseverante con tus sue&ntilde;os te ayudar&aacute; a que todas esas metas se hagan realidad. Tambi&eacute;n es importante tener un plan de acci&oacute;n que te indique por d&oacute;nde debes ir y qu&eacute; tienes que hacer para ir consiguiendo todas tus metas.</span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Todos en esta vida tenemos sue&ntilde;os que nos gustar&iacute;a cumplir, ya sean peque&ntilde;os o grandes sue&ntilde;os, pero constantemente deseamos algo que no tenemos y queremos conseguir.</span></p>\r\n<p>Pero, &iquest;qu&eacute; beneficios aporta el hecho de permitirnos so&ntilde;ar en grande e ir a por nuestros sue&ntilde;os?&nbsp; Los beneficios que aporta son incontables, pero a continuaci&oacute;n os dejamos algunos &nbsp;de los m&aacute;s importantes:</p>\r\n<ol style=\"text-align: justify;\">\r\n<li><strong>Aumenta la sensaci&oacute;n de realizaci&oacute;n personal.</strong> El hecho de ir consiguiendo objetivos, por peque&ntilde;os que sean, nos hace sentir orgullosos de nosotros mismos y nuestra autoestima aumenta.&nbsp;</li>\r\n<li><strong>Sensaci&oacute;n de motivaci&oacute;n y de energ&iacute;a renovada.</strong> Tener claros tus objetivos y d&oacute;nde quieres llegar, te va a permitir estar motivado/a en tu d&iacute;a a d&iacute;a, y tomar decisiones acordes con tu objetivo.&nbsp;</li>\r\n<li><strong>Tendr&aacute;s un punto de enfoque. </strong>Definir bien tus objetivos te permitir&aacute; tener un enfoque claro y poner orden en tu vida. Te permitir&aacute; ir con una direcci&oacute;n clara en tu d&iacute;a a d&iacute;a y a no ir sin rumbo.</li>\r\n<li><strong>Te ayuda a salir de tu zona de confort.</strong> El hecho de so&ntilde;ar en grande te permite tener la capacidad de querer conseguir muchas cosas, ya que no hay l&iacute;mites y te hace salir de tu rutina y del miedo a lo desconocido.</li>\r\n</ol>\r\n<p>Pon en pr&aacute;ctica el hecho de so&ntilde;ar en grande, y comprueba t&uacute; mismo los beneficios que te aporta. &iexcl;Te motivamos a que apuntes lo m&aacute;s alto posible!</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>&ldquo;Haz de tu vida un sue&ntilde;o, y de tu sue&ntilde;o una realidad.&rdquo; Antoine de Saint - Exup&eacute;ry</h2>\r\n<p style=\"text-align: justify;\">T&uacute; eres el encargado de tu propia vida, y de crear la realidad que vives, es por eso, que tienes que atreverte a hacer volar tu imaginaci&oacute;n y a desatar tus mayores aspiraciones, d&aacute;ndote la oportunidad de que se conviertan en realidad.</p>\r\n<p>So&ntilde;ando en grande podr&aacute;s lograr muchas m&aacute;s oportunidades y crear la vida que deseas. Cualquier persona posee la capacidad para convertir sus sue&ntilde;os en una realidad y las posibilidades de alcanzar grandes cosas en la vida, son muy altas. As&iacute; que, &iexcl;ya sabes!</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy te proponemos que hagas una lista de los sue&ntilde;os que quieres conseguir. Enumera todos los detalles acerca de estos sue&ntilde;os, como si ya los hubieras conseguido, analiza c&oacute;mo te sientes etc. Esto te va a permitir definirlos y ser m&aacute;s consciente de ellos, &iexcl;e ir a por todas!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/10%20(3).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<p>Para vivir a lo grande hay que so&ntilde;ar en grande. &iexcl;Y esto solo depende de ti!</p>\r\n<p>Como bien hemos explicado anteriormente, es importante que tengas definidos tus sue&ntilde;os y d&oacute;nde quieres llegar, ya que conocer la direcci&oacute;n de tu vida te permitir&aacute; no perder nunca de vista tus sue&ntilde;os.</p>\r\n<p style=\"text-align: justify;\">Aparte de beneficiarte en muchos aspectos de tu vida, tambi&eacute;n es importante saber que los sue&ntilde;os son un motivo para levantarse y continuar en los d&iacute;as grises, ya que te dan la fuerza para afrontar las circunstancias adversas.</p>\r\n<p style=\"text-align: justify;\">As&iacute; que ya sabes, &iexcl;no pierdas de vista tus sue&ntilde;os, son los que te har&aacute;n llegar lejos!</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p>Hoy queremos retarte a que compartas con tus compa&ntilde;eros alg&uacute;n sue&ntilde;o que ya hayas conseguido y c&oacute;mo lo hiciste, o alguno que tienes pendiente de conseguir. Tambi&eacute;n puedes explicarles c&oacute;mo te sentiste cuando lo conseguiste, c&oacute;mo te sientes con tus nuevas metas&hellip; &iquest;Motivado/a? &iquest;Nervioso/a? &iquest;Orgulloso/a?</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/9%20(1).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-18 08:09:20','2023-11-30 12:05:12'),(63,25,'en','Welcome, December!','<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Christmas is always a time for reflection, either because we are leaving behind a year full of learning and experiences, or because we are starting a new year that is yet to be defined.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>This is the best time to devote some time and energy to searching for the most positive things&nbsp;</strong>in life, and looking for the best in ourselves and the people around us.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Christmas is an opportunity to redirect our thoughts towards optimism, hope and anticipation, so they provide us with sufficient motivation to achieve the goals that benefit our physical and mental health and wellbeing.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Today we want to <strong>welcome you to this original advent calendar</strong>. Its intention is to be with you throughout the month of December with a range of fun challenges, tips, games and activities to inspire you to work on your emotional wellbeing, both individually and as a team.</span></p>\r\n<p style=\"text-align: justify;\"><strong><em><span style=\"font-size: 12pt;\">We&rsquo;re confident that in addition to providing a few moments of fun it will also help you to think, to reflect, and to incorporate new habits and customs that will bring you lots of positive energy for the coming year.</span></em></strong></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">Today we want to <strong>welcome you to this original advent calendar</strong>. Its intention is to be with you throughout the month of December with a range of fun challenges, tips, games and activities to inspire you to work on your emotional wellbeing, both individually and as a team.</p>\r\n<p style=\"text-align: justify;\"><strong>Every day you&rsquo;ll have a new window to discover, from today through to 24 December. </strong>When you open the window you&rsquo;ll find a topic for thinking about, acting upon, and discussing and sharing with your colleagues. By means of individual and team challenges, you&rsquo;ll manage to strengthen all these skills and get a little closer to your colleagues. As you achieve the challenges, you&rsquo;ll see how you feel more committed to yourself, your workmates and your environment.</p>\r\n<p style=\"text-align: justify;\">In the &ldquo;Progress&rdquo; tab you can see what&rsquo;s still required to achieve the final goal. Every individual or team challenge achieved, every comment or interaction you engage in on the calendar, will bring you closer to your goal.</p>\r\n<p style=\"text-align: justify;\">From today through to 24 December, be sure to open the corresponding window every day; if you forget one day, don&rsquo;t worry &ndash; you can always revisit the challenges of previous days. But don&rsquo;t try to get ahead of yourself&hellip; you&rsquo;ll never be able to open the windows of upcoming days! One window a day: an individual challenge to work on your personal wellbeing, and a team challenge to get a little closer to your colleagues.</p>\r\n<p style=\"text-align: justify;\">Ready to go?</p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>Learn to plan and prioritize</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The time of family reunions, embraces, lavish meals and lots of laughs is fast approaching. But before it all arrives, we have a long list of things to do. Don&rsquo;t get upset or stressed: the best thing to do is to start planning now that you have the time and organize everything that needs to be done. If you can do this, we&rsquo;re certain you&rsquo;ll enjoy those special moments to come even more.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">You&rsquo;ve got the whole month to prepare everything that this season entails; there is always time provided you make a plan, which will avoid all that last-minute stress.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Here&rsquo;s a few tips to get you started:</span></p>\r\n</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/depositphotos-321909386-xl-2015.jpg\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Use your head when decorating the house.</strong></span><br /><span style=\"font-size: 12pt;\"> If you haven&rsquo;t yet put up the Christmas tree or decorations, we suggest that today you take everything Christmas-related out of storage: decorations, lights, the tree if it&rsquo;s reusable, and if you buy one every year, now is the time to do it. Check the decorations and write a list of what&rsquo;s missing to get the ambience you want: get ideas from interior d&eacute;cor magazines and decide on the theme that will inspire you this Christmas: gold, silver, rustic, Scandi style, etc.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Put on a bit of music.</strong></span><br /><span style=\"font-size: 12pt;\">Let the Christmas spirit invade every corner of your house! While you&rsquo;re in full Christmas decoration mode, turn on your computer or smartphone and play a bit of Christmas music. Can&rsquo;t you just feel the Christmas spirit already?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Plan your Christmas shopping.</strong></span><br /><span style=\"font-size: 12pt;\">Grab a paper and pen and write down all the people you would like to give a gift to. When you have the names, take a moment to think about what they might like. Don&rsquo;t hit the shops without a predetermined idea; browse the internet, ask the person concerned, or talk to other people who know them well. Give something original: an experience you can do together, a bouquet of flowers, a photo with a dedication, a book that&rsquo;s been recommended to you, a photo album of the best photos of the year or a trip you have been on, a voucher for a restaurant, for a massage, for an excursion or a weekend break, or just a lovely letter expressing everything you never get around to saying on a day-to-day basis. The important thing about gifts is not what they are but the feeling you convey when you give them. When things are done with love, they never fail.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Set yourself a budget.</strong></span><br /><span style=\"font-size: 12pt;\">Bearing in mind your expenses and your financial situation, set a realistic budget for what you can spend this Christmas. Avoid temptations. Think twice before you buy anything. Above all, ask yourself this question: is it really necessary?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Plan meals and Christmas menus.</strong></span><br /><span style=\"font-size: 12pt;\">This is unquestionably one of the biggest tasks and responsibilities of the festive period, but they also cause a lot of stress to whoever is in charge of preparing them. If you want to avoid this stress, first of all make a list of all the guests and make a note of their food preferences, intolerances and allergies. Once you know the number of guests and their dietary preferences, it&rsquo;s much easier to plan the Christmas menu. To make your job easier, choose dishes that you can prepare in advance and combine them with a couple that need finishing just before serving. You can do a trial run shop on a supermarket website to get a preliminary idea of what it will cost you. If you&rsquo;re not happy with that, you can adjust the menu. Remember that if you buy in advance you can also avoid the price increases in the immediate lead-up to Christmas.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong> Share the load &ndash; don&rsquo;t be afraid of delegating.</strong></span><br /><span style=\"font-size: 12pt;\">To streamline the process, establish what each person is going to be responsible for. Don&rsquo;t be shy about asking for help, sharing tasks and assigning responsibilities! Teamwork is the key to success!</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Learn to start planning ahead: this will help to reduce your stress levels and you&rsquo;ll manage to enjoy this very special time of year.</strong></span></p>\r\n</div>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">So today we challenge you to plan all those tasks that you will have to carry out during these days, and for that we leave you this template that will be very useful to optimize your time during this month.</span></p>\r\n<p><a class=\"btn btn-primary\" href=\"../../../../storage/files/uploads/plan-de-navidad-en.pdf\">Christmas organizer</a></p>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Don&rsquo;t let Christmas be a reason for stress</h2>\r\n<p style=\"text-align: justify;\">To help you cope better with this joyful yet stressful time of year, we&rsquo;d like to share some important tips to help you forget about stress and relieve tension, which we hope you&rsquo;ll put into practice to make this period as enjoyable as possible.</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Also today we encourage you to share with your colleagues the Christmas task that you enjoy the most these days, feel free to accompany your comment with a photo!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/fotos-calendario-navidad-copia.gif\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-22 09:53:47','2022-11-24 15:21:33'),(64,27,'en','Find a way of helping others','<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Christmas</strong>&nbsp;is the most family-oriented time of year, a very special moment when we eat far too much and give and receive gifts left, right and centre. The time has finally come around again for company Christmas meals, get-togethers with friends, Father Christmas, the Three Kings, Secret Santa, mince pies and Christmas carols. However,&nbsp;<strong>not everyone is fortunate enough to be able to enjoy this very special festive season as it should be enjoyed.</strong> That&rsquo;s why Christmas invites us to look beyond the Christmas tree and bring out our generous side.</span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">Christmas is the most familiar time of the year, a very special time of the year in which we eat a lot of food and receive gifts everywhere. However, not everyone is lucky enough to be able to enjoy these special days as much as they should. Therefore, Christmas invites us to look beyond the tree and to bring out our generosity.</p>\r\n<p style=\"text-align: justify;\">Solidarity really is the cornerstone of human society, bearing in mind that it is only by taking care of each other that we can survive. However, in many cases it gets overlooked or occupies only a tiny part of our lives due to the numerous things we need to do and issues we need to solve.</p>\r\n<p style=\"text-align: justify;\">There are many ways of demonstrating solidarity, but why is it so important?</p>\r\n<ol>\r\n<li style=\"text-align: justify;\"><strong>It brings emotional benefits: </strong>it has been shown that helping other people benefits the giver too. It increases empathy, positivity and sociability.</li>\r\n<li style=\"text-align: justify;\"><strong>Fighting for a cause: </strong>to effect change in the world, you need to fight for what you believe in. Supporting a cause and getting involved in achieving its ends means you experience it in a deeper way, and you&rsquo;ll be able to do your bit for something you believe in.</li>\r\n<li style=\"text-align: justify;\"><strong>You give something back to society: </strong>donating your knowledge and experiences through teaching or providing something is a way of giving back what others have altruistically given to you.</li>\r\n</ol>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>The smallest action is worth more than the biggest intention</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">There is no single way to be altruistic &ndash; in fact there are countless ways &ndash; but the most important thing is that it is implicit in the way you think and act. Every day we make decisions that may be more or less altruistic in terms of the path we choose.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Here are some ideas and initiatives for donating and bringing joy to those who are most in need at this significant time of year:</span></p>\r\n</div>\r\n<div class=\"col-md-12\" style=\"text-align: justify;\"><img src=\"../../../../storage/files/uploads/3%20(7).png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\" style=\"text-align: justify;\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Donate something you don&rsquo;t use anymore. </strong>Check your house from top to bottom Books, clothing, toys&hellip; obviously you should check that they are in a good condition and will be useful to the person who receives them.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Offer your time to someone who needs it. </strong>Your time is worth more than your money, don&rsquo;t you think? There are many associations and NGOs who would be extremely grateful for a little of your time this Christmas. You could even sign up for an organization where you can offer help all year round and not just at Christmas.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Contribute to an NGO. There are countless NGOs </strong>&ndash; make a point of looking for one that focuses on something you really want to support.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Become a gourmet chef. </strong>Go to the supermarket and buy the food necessary to make a wonderful Christmas meal, and then you have two options: take the products to whoever you think needs them, or prepare the meal yourself with lots of TLC and take it to a person or family member you know may be in need. Sometimes it&rsquo;s the little gestures that make the difference.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>An afternoon of visits. </strong>At Christmas, many people who live alone feel even lonelier. Take your contact list and go and spend an afternoon visiting the people who you know need a bit of company, or call that friend who you know won&rsquo;t be able to spend Christmas with their family and invite them to come and spend this special day with you.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Altruistic toys. </strong>Play is a fundamental human right for children. Through play, children learn to build the world of tomorrow; a better world. There are many entities that collect new toys and arrange to give them to families with few financial resources so that their children can experience all the joy of Christmas too.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Practice solidarity at work, too. </strong>Solidarity can and must be a part of our day-to-day lives, and hence our working lives too. Here are some tips to put it into practice.</span></p>\r\n<ul>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Develop an open-minded attitude. </strong>This means being willing to accept that people have different ways of working, relating to each other, understanding the business, and so on. This will make it easier to be more willing to support others.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Share information with your colleagues. </strong>If the team shares information, we increase the chances of making more of the right business decisions. At the same time, sharing information builds trust and commitment.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Make sure you communicate clearly with other people. </strong>Observe, listen, and use empathy to understand what others need from you to achieve the team&rsquo;s goals. When you disagree, work on your relationship from a basis of respect and cooperation.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Celebrate and rejoice in the achievements </strong>of your colleagues in a genuine way.</span></li>\r\n</ul>\r\n</div>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">And finally, we challenge you to take this test and measure your level of solidarity and where you are right now; remember that the aim of the test is to give you food for thought on where there is still room for improvement.</span></p>\r\n<p><a class=\"btn btn-primary\" href=\"https://iuk3zut73vv.typeform.com/to/D3P0gqYS\">TEST</a></p>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Helping others is like helping yourself- Henry Flagler</h2>\r\n<p style=\"text-align: justify;\">Christmas is associated with a number of values such as kindness, friendship, generosity and solidarity, among many others. This is the perfect time of year to take stock of the year that is ending and to set new goals for the next 365 days.</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we challenge you to share with your colleagues what will be your personal gesture of solidarity this Christmas or next year. You can also share a photo of the initiative you decide to adopt. Don&rsquo;t forget that solidarity is highly contagious and you&rsquo;re bound to pass on some good ideas to all your colleagues!</p>\r\n<p style=\"text-align: justify;\">Good work! Every challenge achieved brings us closer to our final goal!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/fotosgifs-calendario.jpg\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-22 10:27:20','2022-11-29 10:00:50'),(65,26,'en','Let Christmas invade you home','<h2>Did you know that your home influences your brain and emotions?</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Decorating is more than just creating nice rooms. When you choose the shapes, colours and sounds that surround you, you influence the minds of the people who live in your home. You can make them feel safer, more protected and more relaxed. Or you can stimulate their minds to achieve all their creative and intellectual potential.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>The home, after all, is our stronghold against the world,</strong> and the objects, furniture and ornamental elements that decorate it are one of the most telling features of our personality.&nbsp; The fact is, like so many other things in life, everything is in the detail, so in addition to keeping our personal space clean and tidy we also need to pay attention to how each item is placed and the character this gives to the room as a whole.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">To have a &ldquo;well-furnished&rdquo; mind, you not only have to look after yourself mentally and physically, but also ensure your living space and comfort zone are arranged optimally.</span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\"><strong>Decorating is more than just creating beautiful environments. </strong>By choosing the shapes, colors and sounds that surround you, you influence the brains of the people who live in your home. You can make them feel more safe, secure and relaxed. Or you can stimulate their minds to reach their full creative and intellectual potential.</p>\r\n<p style=\"text-align: justify;\"><strong>Today, we want to inspire you to give some thought to your home. </strong>Even more so at a time when you&rsquo;re probably decorating and theming the house for Christmas, in fact, this is a great time to rearrange things, isn&rsquo;t it?</p>\r\n<p style=\"text-align: justify;\">It&rsquo;s not just a question of how big the space is or how long you&rsquo;ve been in your current home, and ideally the time to give some serious thought to this is when you&rsquo;re about to do some building work or refurbishment, but even so there are a lot of things you can do right now to make your home a more welcoming and dynamic space.</p>\r\n<p style=\"text-align: justify;\">We encourage you to take a look at certain aspects of the decoration and layout of your home.</p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>Your space can change your mind</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">In a few days a new year will be beginning; the counter is set to zero, and we&rsquo;ll be back to spending a lot of time at home. It&rsquo;s therefore worth making an effort to arrange it to your liking so the time you spend in it is as cosy and pleasant as possible. Don&rsquo;t you think?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">We want to inspire you to think about what you could do to your home to make it even better. Make a list of what you might like to improve:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Here are a few ideas&hellip;</span></p>\r\n</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/fotos-1080-x-810-2.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<ul>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Change the paintwork of a room</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Add or change the wallpaper</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Add to or change the lighting</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Incorporate fresh decorative features such as baskets, candles, a plant, a mirror&hellip;</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Empty the house of things you don&rsquo;t use</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Change or upcycle a piece of furniture</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Organize your wardrobes better</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Change the textiles: throws, rugs, cushions or curtains</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Take advantage of dead space to turn it into something useful</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Tidy a cluttered space or overcrowded shelving unit</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Change or introduce a new home fragrance</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Spend a few days quietly at home to put on some music, light some candles, and walk around the house to see what things or changes you could do to make yourself feel even more comfortable in it. It&rsquo;s not about pulling down the walls, but sometimes it&rsquo;s just a matter of adding a few candles, a new rug, or some cushions. Changes, when done properly, can cause energy to flow back into a space that seemed to have stagnated.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>We encourage you to make a list of everything that you would like to do over the next year, and gradually tick them off as and when your time and finances allow. And going back to the Christmas theme, have fun with this game of matching pairs of Christmas decorations!</strong></span></p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">And back to Christmas decorating, have fun with this game and create your Christmas tree!</p>\r\n</div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"width: 100%;\">\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"DECORACI&Oacute;N &Aacute;RBOL NAVIDAD ES/EN\" src=\"https://view.genial.ly/637e58b1e2a5dd001937408a\" width=\"1200\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>\r\n</div>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">Have you started your Christmas decorations yet? Are you someone who just puts out a few objects, or do you like to pull out all the stops in every corner of the house? Do you let the children decide for you, or do you get out the ornaments you&rsquo;ve inherited over the years, or do you decide on a particular style and stick to it? A more traditionalist style, or perhaps more Scandi or minimalist? Are you a fan of sustainable decorations or do you tend to overlook sustainability at this time of year?</p>\r\n<p style=\"text-align: justify;\">One thing is evident, and that is that a picture is worth a thousand words. Don&rsquo;t you think?</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Share a photo of your house decorated for Christmas with your colleagues, or maybe just a particular space or corner you&rsquo;d like to show off. This will almost certainly give us a clue about the way you celebrate Christmas and your tastes and customs. Feel free to explain anything you want about the photo. We&rsquo;re sure you&rsquo;ll be an inspiration to some of your colleagues!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520-2.png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-11-22 10:44:58','2022-11-30 08:33:05'),(66,42,'en','Enjoy time with your family','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size: 12pt;\">At this time of the year, sharing family traditions and transmitting the importance of giving and receiving, as well as enjoying the little things in life, become the best gift that we can offer to our loved ones.</span></strong></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The need to spend time as a family is born from the desire to share enriching experiences with the people we love. These times of the year are ideal for creating bonds that last over time and allow us to overcome adversity.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">It is essential to enjoy happy quality time with the family. Christmas is a time of customs and traditions that invite us to participate with our loved ones.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Christmas is a key opportunity to give quality time and to strengthen the bonds with our families. </span></p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>At this time of the year, sharing family traditions and transmitting the importance of giving and receiving, as well as enjoying the little things in life, become the best gift that we can offer to our loved ones.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">A family is a group of people that are linked by kinship or affinity who live together in a certain place. Together they learn about principles and values in order to integrate properly into society.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Sometimes, with the fast pace of life, we tend to lose certain customs, such as enjoying family life. That is why it is important to recover the value of spending more time with your loved ones. Keep in mind that the best way to get to know each of the members of your family, in all its aspects, is by sharing time together.</span></p>\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-size: 12pt;\">Don\'t let duties, work and today&rsquo;s pace of life separate you from your family!</span></strong></p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<h2>Christmas is a time to share as a family</h2>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Christmas is more than presents, it is a time to share, to show solidarity and to reaffirm our affection for our family and friends. It is a good time to share and motivate to live well in harmony.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">During the holidays, there are plenty of opportunities to spend quality time with our families. It does not matter if there are children or not, there are many things we can do while enjoying the company of those family members who are so important to us.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"> Here are a few ideas:</span></p>\r\n</div>\r\n<div class=\"col-md-12\"><img src=\"../../../../storage/files/uploads/fotos-1080-x-810-10.png\" alt=\"\" width=\"1080\" height=\"810\" /></div>\r\n</div>\r\n<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Create a Christmas atmosphere. </strong>Decorating the house together is a very special ritual, playing Christmas songs, getting out the decorations and getting down to work is undoubtedly a fun and endearing activity. Don\'t forget that creating a good Christmas atmosphere depends solely on us.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Prepare the greeting cards. </strong>Another activity you can do is to prepare the Christmas cards, whether you buy them or make them yourself, especially if there are children at home, together you can decide who writes to whom and you can spend a very entertaining afternoon.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Visit a Christmas market. </strong>At Christmas time, almost every city has a Christmas market, either to buy handmade gifts or to buy the decorations and sweets that are typical of this special time of year. Going to a Christmas market together is an activity that you can\'t miss on your Christmas agenda.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Christmas crafts as a family. </strong>Crafts are not just for children (although the youngest members of the family enjoy them the most), there are also infinite alternatives for creating Christmas decorations for the older ones. Just browse a bit in internet and you will find an infinite number of decorations that you can create with things that you have around the house!</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Cooking as a family. </strong>There are very few things more fun than cooking as a family! You can prepare the Christmas menu together, some biscuits, a typical Christmas sweet or any meal that comes up during the holidays can be a good excuse to spend quality time as a family.</span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><strong>Afternoon at the cinema. </strong>This is also an interesting leisure option. All you have to do is agree on which film will be chosen, garnish it with some popcorn or some sweets and... Action!</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Prepare a game together.</strong> This is definitely a fun activity! Collect questions together and create a game/contest for Christmas Day. What year did the grandparents get married? What was the aunt\'s first job? Each member of the family can come up with a series of questions that will be part of the game. Who does really know the family best?</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Gratitude jar.</strong> This is without doubt a very endearing activity. We suggest that you get your family together and ask them to create a gratitude jar. In the days before Christmas, you will put in it a series of messages written on duly folded pieces of paper, in which you will express your gratitude for events that have taken place throughout the year. On Christmas Day, read them one by one. The messages can be anonymous. If so, you will have to be able to guess who has written the message!</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\"><strong>Afternoon of games. </strong>Playing is always a good choice, it\'s one of the best ways to socialise, having fun and relieving stress. The choice is endless, the only trouble will be to agree on the games you play!</span></p>\r\n</div>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Finally, we challenge you and your relatives to build your family tree. Up to which generation will you be able to reach? Maybe you will have to call a relative to help you complete it. It is definitely a good excuse to connect with relatives you haven\'t talked to for a long time.</span></p>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\" style=\"text-align: justify;\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/ima%CC%81genes-420x520.png\" alt=\"\" width=\"420\" height=\"520\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2 style=\"text-align: justify;\">Time that is enjoyed is the time that has really been lived</h2>\r\n<p style=\"text-align: justify;\">Family time is an essential factor that helps create strong bonds, love, connections and relationships between family members. Spending quality time with family helps to overcome challenges, instils a strong feeling of security, transmits family values and fills all family members with big confidence.</p>\r\n<p style=\"text-align: justify;\">Today we encourage you to think about the time you spend with your family. Is it really enough? Is it of good quality? If the answers are &ldquo;no&rdquo;, think about how you could improve it!</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today, we also encourage you to share a family picture on the wall! It can be old or current, it does not matter. W we would love to know what you like most about your family.</p>\r\n</div>\r\n</div>','2022-11-24 10:41:31','2022-11-24 10:47:35'),(67,31,'en','Keep playing, no matter how old you are','<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Play is a source of relaxation and stimulation for both the body and mind, and for both adults and children. Play is a safe and entertaining way to develop imagination and creativity as well as problem-solving skills. <strong>It facilitates learning, relieves stress, and connects us with other people and the world around us.</strong></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Although play makes us feel more alive, it is something that adults often overlook and don&rsquo;t pay enough attention to because we have so many other things to do. But play is not a luxury, it is a necessity.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Indeed, play is just as important for our physical and mental health as getting enough sleep, eating well and doing exercise.</span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">Play is a source of relaxation and stimulation for both the body and mind, and for both adults and children. Play is a safe and entertaining way to develop imagination and creativity as well as problem-solving skills. <strong>It facilitates learning, relieves stress, and connects us with other people and the world around us.</strong></p>\r\n<p style=\"text-align: justify;\">We have inherited a belief, almost certainly from industrialised society, that an individual is measured by what they do, what they produce; this means that any activity performed solely for diversion and entertainment is seen as a waste of time. From this perspective, a truly productive and busy person has no time to waste on children&rsquo;s pastimes.</p>\r\n<p style=\"text-align: justify;\"><em><strong>However, play can help us to feel closer to other people, to alleviate stress, to connect with others and the world around us, and even in the working world it can make our working life more productive, enjoyable and collaborative.</strong></em></p>\r\n<p style=\"text-align: justify;\">We need to be able to break away from these old beliefs and become aware of everything that play can do for us and our wellbeing. What do you think?</p>\r\n<p style=\"text-align: justify;\">Ask yourself this: &ldquo;When was the last time I really had fun playing something?&rdquo; If you can&rsquo;t come up with a good answer quickly, it&rsquo;s very likely that it&rsquo;s been far too long since you took some time for yourself.</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>\"We don&rsquo;t stop playing because we grow old. We grow old because we stop playing.\" George Bernard Shaw</h2>\r\n<p style=\"text-align: justify;\">The range of games is infinite, based on the fact that there are so many types of play. Have you ever stopped to think what kind of game gives you the most fun and enjoyment? It&rsquo;s almost certainly related to the kind of player you are.</p>\r\n<p style=\"text-align: justify;\">In the early 2000s, Briton Richard Bartle created a player a classification based on two axes: a preference between relating to other players or immersion in the gaming world (the relaxation axis) and a preference between action or interaction (the competition axis).</p>\r\n<p style=\"text-align: justify;\">Using these criteria, he established four player profiles: Achievers, Socializers, Killers and Explorers. Learn a little more about what defines each player to find out which one is closest to your gaming approach.</p>\r\n<ul style=\"text-align: justify;\">\r\n<li><strong>Achievers: </strong>They relate to the world of gaming and action. They like to achieve objectives and overcome specific challenges. They are independent players, focused on success and achieving a status within the gaming community.</li>\r\n<li><strong>Explorers: </strong>They like to immerse themselves in the gaming world, but enjoy observing the game itself, discovering its secrets and the ways of improving their play. They are individualistic players, focused on constantly learning and improving.</li>\r\n<li><strong>Socializers: </strong>These are players who gain the most enjoyment from interacting with other players rather than from the game itself. They are good team players and like collaborating and contributing, as well as establishing bonds with the other players.</li>\r\n<li><strong>Killers:</strong> Also enjoy interacting with other players, but because they are so action-driven, their goal is competition, not collaboration.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">It is often the case that the way we behave when playing bears similarities with our attitude in our professional activities.</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we encourage you to reflect on how you behave when playing. Play this game to find out which games best suit your playing style.</p>\r\n<div style=\"width: 100%;\">&nbsp;</div>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/4%20(5).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/5%20(4).png\" alt=\"\" width=\"420\" height=\"520\" /></p>\r\n</div>\r\n</div>\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<div style=\"position: relative; padding-bottom: 56.25%; padding-top: 0; height: 0;\"><iframe style=\"position: absolute; top: 0; left: 0; width: 100%; height: 100%;\" title=\"SIGUE JUGANDO\" src=\"https://view.genial.ly/637ced9d9e97e0001756bbdb\" width=\"520\" height=\"675\" frameborder=\"0\" scrolling=\"yes\" allowfullscreen=\"allowfullscreen\"></iframe></div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>Make life a game that you want to keep going back to play.</h2>\r\n<p style=\"text-align: justify;\">Now you know all the benefits that come from play, and what your player profile is. Have you ever stopped to think what kind of game gives you the most fun and enjoyment? The range of games is infinite and extremely varied.</p>\r\n<p style=\"text-align: justify;\">Do you enjoy playing in the open air, or practising a competitive sport? Perhaps you&rsquo;re someone who prefers quieter surroundings to strengthen your logical thinking processes. Maybe what you enjoy doing are strategy games, classical games, video games&hellip; as you can see, the options are endless.</p>\r\n<div>And today we have a prize! Among all of the participants in today\'s challenge we will draw:</div>\r\n<div>&nbsp;</div>\r\n<ul>\r\n<li><strong>2 puzzles of the brand Aniwood, </strong>an Original and innovative puzzle, for children and adults. The originality of this puzzle lies in the way it is assembled, as each piece is unique and can be made according to the level or age of the person. Ideal for, once assembled, can be used as a decorative element at home!</li>\r\n<li><strong>2 Safari board games.</strong> This is a board game in which the fun of board games meets the curiosity for animals and planet earth. A game of travel and strategy in which you will have to rescue the animals and complete as many boards as possible.&nbsp;</li>\r\n</ul>\r\n<div>You have until December 12th to participate. The winners will be announced in a few days in the \"prizes\" section.</div>\r\n<div>&nbsp;</div>\r\n<div>Good luck!</div>\r\n</div>\r\n<div class=\"col-md-6\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/fotos-calendario-navidad.png\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<!-- este es el separador de 10px-->\r\n<p><img style=\"float: right;\" src=\"../../../../storage/files/uploads/captura-de-pantalla-2022-12-03-a-las-19-21-08.png\" alt=\"\" width=\"420\" height=\"420\" /></p>\r\n</div>\r\n<!-- Columna Izda fin--><!-- este es el separador de 10px--></div>\r\n<div style=\"width: 100%;\">\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n<div>&nbsp;</div>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Today we suggest you share your favourite game or type of game with your colleagues. You can support your comments with photos as a real-life example.</p>\r\n<p style=\"text-align: justify;\">Who knows? Maybe you&rsquo;ll find your ideal gaming partner here!</p>\r\n<p>&nbsp;</p>','2022-11-24 16:20:21','2022-12-03 18:23:25'),(68,36,'en','Sueña en grande','<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Everyone in this life has dreams we would like to fulfill, whether they are small or big dreams, but we constantly wish for something we don\'t have and want to achieve.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">To have identified our dreams, helps us to focus more on what we want. They are the fuel to make us go further. If you allow yourself to dream big, your possibilities increase, because if you focus all your energy, time and dedication on achieving your dreams, that energy will be back, and you will achieve everything you set out to do.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">The fact of dreaming big and being perseverant with your dreams, will help you to make all those goals come true, that is why dreaming big is fundamental. It is also important to have a plan of action to indicate where you should go and what you have to do to achieve all your goals.</span></p>','<div class=\"row\">\r\n<div class=\"col-md-12\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Everyone in this life has dreams we would like to fulfill, whether they are small or big dreams, but we constantly wish for something we don\'t have and want to achieve.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">To have identified our dreams, helps us to focus more on what we want. They are the fuel to make us go further. If you allow yourself to dream big, your possibilities increase, because if you focus all your energy, time and dedication on achieving your dreams, that energy will be back, and you will achieve everything you set out to do.</span></p>\r\n<p style=\"text-align: justify;\">But what are the benefits of allowing ourselves to dream big and go for our dreams? The benefits are countless, but here are some of the most important benefits:</p>\r\n<ol style=\"text-align: justify;\">\r\n<li><strong>It increases the feeling of personal accomplishment. </strong>The fact of achieving goals, however small they may be, makes us feel proud of ourselves, and our self-esteem increases. At the same time, our sense of personal accomplishment increases and helps us to set more goals and be more committed.</li>\r\n<li><strong>Feeling of motivation and renewed energy. </strong>Being clear about your goals and where you want to get to, will allow you to be motivated in your day to day life, and make decisions according to your goal. Being motivated and committed to your goals will help you live with a positive and renewed energy.</li>\r\n<li><strong>You will have a point of focus. </strong>Defining your objectives well, will allow you to have a clear focus and put order in your life. It will allow you to go with a clear direction in your day to day life, and not to go aimlessly.</li>\r\n<li><strong>It helps you get out of your comfort zone. </strong>The fact of dreaming big, allows you to have the ability to want to achieve many things, since there are no limits, and makes you get out of your routine and the fear of the unknown.</li>\r\n</ol>\r\n<p style=\"text-align: justify;\">Put into practice the fact of dreaming high, and see for yourself the benefits they bring you. We motivate you to aim as high as possible!</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>\"Make your life a dream, and your dream a reality.\" Antoine de Saint - Exup&eacute;ry</h2>\r\n<p style=\"text-align: justify;\">You are in charge of your own life, and of creating the reality you live, that\'s why you have to dare to let your imagination fly and to unleash your greatest aspirations, giving you the opportunity to make them come true.</p>\r\n<p style=\"text-align: justify;\">By dreaming big, you can achieve many more opportunities, and you can create the life you desire. Anyone has the ability to turn their dreams into a reality and the chances of achieving great things in life are very high. So now you know!</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">After having explained some of the benefits of dreaming big and the importance of it, the challenge we propose you today is to make a list of the dreams you want to achieve. Say all the details about these dreams, explain them as if you have already achieved them, how you feel etc.. This will allow you to define them and be more aware of them, and go for it!</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/10%20(3).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<p style=\"text-align: justify;\">To live big, you have to dream big, and this only depends on you! As we have explained above, it is important that you have defined your dreams and where you want to go, because knowing the direction of your life will allow you to never lose sight of your dreams.</p>\r\n<p style=\"text-align: justify;\">In addition to benefiting you in many aspects of your life, it is also important to know that dreams are a reason to get up and continue in the gray days, as they give you the strength to face adverse circumstances.</p>\r\n<p style=\"text-align: justify;\">So you know, don\'t lose sight of your dreams, they are what will make you go far!</p>\r\n<h4 style=\"text-align: justify;\">CHALLENGE</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">That\'s why today we want to challenge you to share with your colleagues a dream that you have already achieved and how you did it, or one that you have pending to achieve. You can also explain how you felt when you achieved it, how you feel about your new goals... Motivated? Nervous? Proud?</p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/9%20(1).png\" alt=\"\" width=\"420\" height=\"520\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','2022-12-15 10:51:33','2022-12-15 10:51:33'),(69,64,'es','Llena tu vida de buenos momentos','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Incorporar alegr&iacute;a y significado a nuestra vida constituye la esencia misma de nuestra existencia. Este prop&oacute;sito confiere importancia y sentido a cada jornada que vivimos. Cada d&iacute;a se nos presenta como un regalo que merece ser apreciado en su totalidad, invit&aacute;ndonos a disfrutar plenamente de las m&uacute;ltiples experiencias que nos brinda. Los buenos momentos, que pueden manifestarse tanto en eventos significativos como en las peque&ntilde;as y simples rutinas diarias, como compartir un caf&eacute; o un aperitivo con alguien apreciado, son los componentes fundamentales que enriquecen nuestra vida.</span></p>\r\n<p><span style=\"font-size: 12pt;\">La valoraci&oacute;n de estos instantes nos insta a ser conscientes de la importancia de vivir en el presente y a detenernos en medio de la vor&aacute;gine de la vida acelerada que llevamos. Este acto nos permite aprender a saborear plenamente cada faceta de nuestra existencia.</span></p>\r\n<p class=\"txtdestacadow\" style=\"text-align: justify;\">&nbsp;</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p style=\"text-align: justify;\"><span style=\"font-size: 12pt;\">Incorporar alegr&iacute;a y significado a nuestra vida constituye la esencia misma de nuestra existencia. Este prop&oacute;sito confiere importancia y sentido a cada jornada que vivimos. Cada d&iacute;a se nos presenta como un regalo que merece ser apreciado en su totalidad, invit&aacute;ndonos a disfrutar plenamente de las m&uacute;ltiples experiencias que nos brinda.</span></p>\r\n<p><span style=\"font-size: 12pt;\">La vida est&aacute; tejida con hilos de momentos especiales que nos colman de satisfacci&oacute;n, nos hacen disfrutar y nos invitan a experimentar la vida en su m&aacute;xima expresi&oacute;n. Estos momentos constituyen la esencia de nuestra identidad, ya que estamos moldeados por los recuerdos y las experiencias que atesoramos. Compartir estas vivencias con los dem&aacute;s se vuelve a&uacute;n m&aacute;s valioso.</span></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n</div>\r\n</div>','<div class=\"row\">\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\">\r\n<h2>La magia est&aacute; en los momentos compartidos</h2>\r\n<p><span style=\"font-family: Karla; color: #374151;\">La magia de los momentos compartidos no solo radica en la ocasi&oacute;n en s&iacute;, sino en la habilidad de detenernos y sumergirnos plenamente en la experiencia. Estos momentos se transforman en tesoros que atesoramos a lo largo del tiempo, record&aacute;ndonos la importancia de valorar lo que tenemos en el momento presente. As&iacute;, cada instante se convierte en una oportunidad para celebrar la vida y fortalecer los lazos que nos unen.</span></p>\r\n<p><span style=\"font-family: Karla; color: #374151;\">Cada uno de nosotros ha experimentado momentos inolvidables junto a personas especiales que han dejado una huella imborrable en nuestras vidas. </span></p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Hoy os animamos a reflexionar sobre estos momentos. Selecciona uno de estos recuerdos significativos y obsequia a esa persona especial con una fotograf&iacute;a que capture ese instante &uacute;nico para ambos: ya sea una celebraci&oacute;n de cumplea&ntilde;os, una boda, un aniversario, un viaje o simplemente un d&iacute;a lleno de cari&ntilde;o y complicidad.</p>\r\n<p><span style=\"font-family: Karla; color: #374151;\">Cualquier ocasi&oacute;n especial que haya quedado inmortalizada en una imagen se convierte ahora en un regalo significativo. Este gesto e seguramente llenar&aacute; de alegr&iacute;a a la persona receptora, record&aacute;ndole ese momento especial cada vez que contemple la fotograf&iacute;a.</span></p>\r\n</div>\r\n<div class=\"col-md-6\" style=\"text-align: left; font-size: 12pt;\"><img style=\"float: right; margin-top: 10%;\" src=\"../../../../storage/files/uploads/buenos-momentos-1.jpg\" alt=\"\" width=\"420\" height=\"420\" />\r\n<div style=\"clear: both; margin: 10px;\">&nbsp;</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','<div class=\"row\" style=\"text-align: left !important;\">\r\n<div class=\"col-md-6\"><img style=\"margin: 10px auto; display: block;\" src=\"../../../../storage/files/uploads/buenos-momentos-2.jpg\" alt=\"\" width=\"420\" height=\"420\" /></div>\r\n<br />\r\n<div class=\"col-md-6\" style=\"font-size: 12pt;\">\r\n<h2>&nbsp;</h2>\r\n<p>Esperamos que todos lo pasarais genial en la comida de Navidad de ayer y que hay&aacute;is creado recuerdos incre&iacute;bles. Queremos que el encuentro de ayer sea uno de esos momentos que record&eacute;is siempre con una sonrisa.</p>\r\n<h4 style=\"text-align: justify;\">DESAF&Iacute;O</h4>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">Estamos deseando ver esas fotos llenas de risas y buen rollo que os hicisteis ayer. &iexcl;As&iacute; que hoy os animamos a que colgu&eacute;is en el muro alguna foto que os hay&aacute;is sacado con vuestros compis en la comida de Navidad!</p>\r\n<p>&iexcl;Que las risas no paren y que esta sea solo la primera de muchas reuniones festivas! &iexcl;Venga, equipo, a compartir esas fotos y a revivir la magia de ayer!</p>\r\n<p class=\"txtdestacadog\" style=\"text-align: justify;\">&nbsp;</p>\r\n</div>\r\n</div>','2023-11-27 16:55:18','2023-12-12 10:58:39');
