INSERT INTO `system_settings` VALUES (1,'system.design.frontend','h3, h4 {\r\ncolor: #a78126;\r\n}\r\n.navbar-nav {\r\n    font-family: \"Karla\", sans-serif;\r\n    font-size: medium;\r\n}\r\n.navbar-nav-logo {\r\n    width: 180px;\r\n}\r\n.footer {\r\nborder-top: 1px solid #E2E8E6;\r\n}\r\n.main-section p { \r\n    font-size: medium;\r\n}\r\n.text-md-center {\r\n    text-align: center !important;\r\n    padding-bottom: 1.5rem;\r\n}\r\n.activity-name-txt h2 {\r\n    font-style: inherit;\r\n}\r\n.btn-group-sm > .btn, .btn-sm {\r\n    padding: .30rem .6rem;\r\n    font-size: 1.3rem;\r\n    line-height: 1.5;\r\n    border-radius: .2rem;\r\n}\r\n.pt-5, .py5 {\r\n    padding-top: 3rem !important;\r\n    padding-bottom: 3rem !important;\r\n}\r\n.txtdestacadog {\r\n    padding: 15px 15px 20px 15px;\r\n    border-left: 5px solid #a78126;\r\n    color: #000;\r\n    font-size: 1.1em;\r\n    font-family: Recoleta,sans-serif;\r\n    background: #ffffff;\r\n    margin-bottom: 30px;\r\n    line-height: 1.5em !importan\r\n}\r\n\r\n.txtdestacadow {\r\n    padding: 15px 15px 20px 15px;\r\n    border-left: 5px solid #a78126;\r\n    color: #000;\r\n    font-size: 1.1em;\r\n    font-family: Recoleta,sans-serif;\r\n    background-color: rgb(248, 248, 248);\r\n    margin-bottom: 30px;\r\n    line-height: 1.5em !important;\r\n\r\n}\r\n.activity-title-name {\r\n    line-height: 1.2em;\r\n}\r\n.btnctr {\r\ndisplay: flex;\r\n  align-items: center;\r\n  justify-content: center;\r\n  }\r\n}\r\nhr {\r\n  border-top: 1px solid #a78126;\r\n  height: 2px;\r\n  max-width: 200px;\r\n  padding: 0;\r\n  margin: 20px auto 0 auto;\r\n}','Reglas CSS para la parte frontend','2021-05-03 12:57:24','2022-11-22 20:54:35'),(2,'system.design.backend',NULL,'Reglas CSS para la parte backend','2021-05-03 12:57:24','2021-05-03 15:43:20'),(3,'app.notifications.activity-published','0','Notificación enviada al usuario informando que se han publicado desafíos','2021-05-03 12:57:24','2024-01-15 15:56:59'),(4,'app.notif